INSERT INTO `challenge_descriptions` VALUES (1,1,1,'Desafio All-Star','Enfrente personagens de todo o jogo e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span> 50 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 25 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena All-Star e Mestre da Arena All-Star<br />\n<span class=\"laranja\">Mascotes:</span> Hydranoid e Titanium Dragonoid<br />'),(3,3,1,'Desafio Pirata','Enfrente personagens do anime One Piece e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span> 20 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 130 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena Pirata e Mestre da Arena Pirata<br />\n<span class=\"laranja\">Mascotes:</span> Saco de Tesouros e Saco Grande de Tesouros<br />'),(2,2,1,'Desafio Ninja','Enfrente personagens do anime Naruto e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span> 75 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 5 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena Ninja e Mestre da Arena Ninja<br />\n<span class=\"laranja\">Mascotes:</span> Juubi e Shinju<br />'),(4,4,1,'Desafio Z','Enfrente personagens do anime Dragon Ball e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span> 40 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 40 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena Z e Mestre da Arena Z<br />\n<span class=\"laranja\">Mascotes:</span> Esferas do Dragão e Esferas do Dragão de Namekusei<br />'),(5,5,1,'Desafio Mágico','Enfrente personagens do anime Fairy Tail e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span> 30 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 50 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena Mágica e Mestre da Arena Mágica<br />\n<span class=\"laranja\">Mascotes:</span> Dragonoid e Dorma Anim<br />'),(6,6,1,'Desafio Aterrorizante','Enfrente personagens do Dia das Bruxas, colabore com o evento e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span>25 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 25 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena de Halloween e Mestre da Arena de Halloween<br />\n<span class=\"laranja\">Mascotes:</span> Abóbora de Gostosuras e Abóbora de Travessuras<br /><br /><br />\n<span class=\"verde\">Disponível entre os dias 26 de Outubro e 02 de Novembro!<br />'),(7,7,1,'Desafio Mafioso','Enfrente personagens do anime Katekyou Hitman Reborn e tente conseguir as recompensas exclusivas:<br /><br />\n<span class=\"laranja\">Experiência:</span> 5 Pontos de Experiência por Andar<br />\n<span class=\"laranja\">Moedas:</span> 75 Moedas por Andar<br />\n<span class=\"laranja\">Títulos:</span> Desafiante da Arena Mafiosa e Mestre da Arena Mafiosa<br />\n<span class=\"laranja\">Mascotes:</span> Falco e Leon<br />');
