INSERT INTO `character_theme_items` VALUES (1,2,1,1,3,'Oiroke no Jutsu','Naruto se transforma em uma mulher, geralmente nua, para distrair o inimigo.','oiroke-no-jutsu.png'),(2,5,1,1,2,'Kage Bunshin no Jutsu','Naruto cria até cinco clones das sombras para atacar o inimigo.','kage-bunshin.png'),(3,10,1,1,2,'Uzumaki Naruto Rendan','Utilizando o Kage Bunshin, Naruto acerta o inimigo com uma sequência de golpes, arremessando-o para cima e chutando-o novamente para o chão.','uzumaki-rendan.png'),(4,12,1,1,3,'Rasengan','Naruto concentra chakra em suas mãos, rotacionando em alta velocidade, formando uma esfera, e acerta o inimigo à uma distância curta.','rasengan.png'),(5,17,1,1,3,'Harem no Jutsu','Naruto cria diversos clones de mulheres, geralmente nuas. Causa distração em praticamente todo mundo, e na maioria das vezes causando hemorragia nasal.','harem-no-jutsu.png'),(6,19,1,1,2,'Tajuu Kage Bunshin no Jutsu','Naruto cria centenas de clones das sombras para avançar contra o inimigo.','tajuu-kage-bunshin.png'),(7,24,1,1,3,'Nanairo no Rasengan','Um Rasengan feito com o Chakra de Sete Cores.','nanairo-rasengan.png'),(8,26,1,1,3,'Tsuin Rasengan','Um Rasengan duplo, formado um com chakra, e outro com algum item especial, como a Pedra Gellel.','tsuin-rasengan.png'),(9,31,1,1,3,'Mikazuki Rasengan','Um Rasengan formado com a energia da Lua.','mikazuki-rasengan.png'),(10,35,1,1,2,'Gamabunta Bakushin','Naruto invoca Gamabunta, que dá uma investida poderosa no inimigo.','gamabunta-bakushin.png'),(11,2,31,1,3,'Rasengan','Naruto concentra chakra em suas mãos, rotacionando em alta velocidade, formando uma esfera, e acerta o inimigo à uma distância curta.','rasengan.png'),(12,5,31,1,2,'Tajuu Kage Bunshin no Jutsu','Naruto cria centenas de clones das sombras para avançar contra o inimigo.','tajuu-kage-bunshin.png'),(13,10,31,1,3,'Oodama Rasengan','Um Rasengan maior e mais forte que o comum, feito juntamente com um Kage Bunshin.','oodama-rasengan.png'),(14,12,31,1,1,'Fuuton Rasengan','Um Rasengan misturado com uma pequena quantidade de Chakra do Vento.','fuuton-rasengan.png'),(15,17,31,1,3,'Harem no Jutsu','Naruto cria diversos clones de mulheres, geralmente nuas. Causa distração em praticamente todo mundo, e na maioria das vezes causando hemorragia nasal.','harem-no-jutsu.png'),(16,19,31,1,1,'Fuuton Gama Teppou','Naruto invoca Gamatatsu, que dispara um jato de água pela boca.','fuuton-gama-teppou.png'),(17,24,31,1,1,'Fuuton Gamayu Endan','Naruto invoca Gamatatsu e Gamakichi, misturando óleo, fogo e água para disparar no inimigo.','fuuton-gamayu-endan.png'),(18,26,31,1,1,'Gufuu Suika no Jutsu','Misturando uma grande quantidade de Chakra de Vento com algum fogo, Naruto cria um enorme tufão flamejante.','gufuu-suika-no-jutsu.png'),(19,31,31,1,3,'Rasen Chou Tarengan','Utilizando o Tajuu Kage Bunshin do Jutsu, Naruto cria um Rasengan com cada um deles e pula no inimigo.','rasen-chou-tarengan.png'),(20,35,31,1,1,'Fuuton Rasenshuriken','A forma perfeita do Rasengan misturado com o Chakra do Vento, que ao acertar o inimigo, é a mesma impressão de um milhão de agulhas penetrando o seu corpo.','fuuton-rasenshuriken.png'),(21,2,2,1,5,'Soushuriken no Jutsu','Sasuke utiliza linhas presas em shurikens para controlá-las.','soushuriken-no-jutsu.png'),(22,5,2,1,5,'Soufuushasan no Tachi','Utilizando o Soushuriken no Jutsu, Sasuke consegue enrolar o inimigo em uma pedra ou tronco, deixando-o imobilizado.','soufuushasan-no-tachi.png'),(23,10,2,1,2,'Shishi Rendan','Sasuke movimenta-se rapidamente, acertando uma sequência de golpes no inimigo, finalizando com um chute no estômago, esmagando o inimigo no chão.','shishi-rendan.png'),(24,12,2,1,1,'Chidori','Sasuke concentra chakra em uma das mãos utilizando elemento raio, quanto mais velocidade maior o dano sobre o oponente.','chidori.png'),(25,17,2,1,2,'Hayabusa Otoshi','Sasuke agarra o inimigo no ar, o vira de cabeça para baixo e esmaga a cabeça dele no chão.','hayabusa-otoshi.png'),(26,19,2,1,3,'Sharingan no Jutsu','Sasuke ativa seu Sharingan e consegue ler os movimentos do inimigo.','sharingan-no-jutsu.png'),(27,24,2,1,1,'Katon Ryuuka no Jutsu','Utilizando o Soufuushasan no Tachi, Sasuke solta o elemento fogo nas linhas das shurikens e queima o inimigo preso.','katon-ryuuka-no-jutsu.png'),(28,26,2,1,2,'Sharingan Rendan','Prevendo os movimentos do inimigo, Sasuke consegue uma combinação perfeita de golpes.','sharingan-rendan.png'),(29,31,2,1,1,'Katon Goukakyuu no Jutsu','Sasuke cria uma enorme bola de fogo aumentando a potência com seu chakra.','katon-goukakyuu-no-jutsu.png'),(30,35,2,1,1,'Chidori Heki','Ao acertar o Chidori e perfurar o inimigo, Sasuke ainda consegue \'explodir\' seu chakra de raio e eletrocutar tudo ao seu redor.','chidori-heki.png'),(31,2,32,1,1,'Chidori','Sasuke concentra chakra em uma das mãos utilizando elemento raio, quanto mais velocidade maior o dano sobre o oponente.','chidori.png'),(32,5,32,1,1,'Katon Goukakyuu no Jutsu','Sasuke cria uma enorme bola de fogo aumentando a potência com seu chakra.','katon-goukakyuu-no-jutsu.png'),(33,10,32,1,4,'Jagei Jubaku','Sasuke solta duas cobras brancas pelas mangas para prender seus inimigos.','jagei-jubaku.png'),(34,12,32,1,1,'Chidori Nagashi','Usando o Chidori, Sasuke solta uma descarga elétrica pelo seu corpo, acertando vários inimigos.','chidori-nagashi.png'),(35,17,32,1,1,'Chidori Senbon','Sasuke transforma seu Chidori em várias agulhas de raio e dispara no inimigo.','chidori-senbon.png'),(36,19,32,1,1,'Chidori Eisou','Sasuke expande seu Chidori em forma de lança, que ao acertar o inimigo, se expande em várias direções de dentro pra fora.','chidori-eisou.png'),(37,24,32,1,3,'Magen Kasegui no Jutsu','Sasuke prende o inimigo em um Genjutsu, que tem a sensação de estar sendo torturado com diversas estacas atravessando seu corpo.','magen-kasegui-no-jutsu.png'),(38,26,32,1,4,'Kusanagi no Tsurugi Chidorigatana','Sasuke usa seu Chidori em sua katana.','chidorigatana.png'),(39,31,32,1,1,'Katon Gouryuuka no Jutsu','Sasuke solta diversas bolas de fogo gigantes no formato de cabeças de dragões, que servem para aquecer a atmosfera.','katon-gouryuuka-no-jutsu.png'),(40,35,32,1,1,'Kirin','Após utilizar o Katon Gouryuuka no Jutsu, Sasuke estende sua mão para o céu e cria um dragão de relámpago, arremessando-o no inimigo e criando uma enorme explosão.','kirin.png'),(61,2,3,1,3,'Bunshin no Jutsu','Sakura cria dois clones usados para confundir o inimigo.','bunshin-no-jutsu.png'),(62,5,3,1,2,'Bunshin Rendan','Usando seus clones, Sakura avança no inimigo por todas as direções e o acerta.','bunshin-rendan.png'),(63,10,3,1,3,'Sakura Kyouran','Sakura desperta sua fúria e aumenta sua força consideravelmente.','sakura-kyouran.png'),(64,12,3,1,3,'Sakura Toukai','Sakura prende o inimigo em um genjutsu e o faz pensar que o lugar está sendo destruído.','sakura-toukai.png'),(65,17,3,1,2,'Sakura Rendan','Sakura desfere uma série de socos e chutes no inimigo.','sakura-rendan.png'),(66,19,3,1,2,'Hitokeri Takai','Um poderoso chute alto.','hitokeri-takai.png'),(67,24,3,1,3,'Kai','Sakura libera seu chakra e é capaz de sair de qualquer alucinação.','kai.png'),(68,26,3,1,2,'Sakura Panchi','Sakura concentra chakra em seus punhos e soca o inimigo.','sakura-panchi.png'),(69,31,3,1,3,'Uchi Naru Kyouran','Sakura desperta sua personalidade inteiror e consegue atacar o inimigo fisicamente e psicologicamente.','uchi-naru-kyouran.png'),(70,35,3,1,3,'Uchi Naru Tsubusu','A personalidade interior de Sakura entra na mente do inimigo e o esmaga.','uchi-naru-tsubusu.png'),(71,2,42,1,2,'Daichi Shougeki','Sakura contra-ataca o inimigo esmagando uma de suas partes no chão com um soco.','daichi-shougeki.png'),(72,5,42,1,3,'Shousen Jutsu','Sakura consegue recuperar ou drenas a energia vital concentrando chakra em suas mãos.','shousen-jutsu.png'),(73,10,42,1,3,'Saikan Chuushutsu no Jutsu','Sakura consegue injetar ou remover, através de chakra, veneno na pele do inimigo.','saikan-chuushutsu-no-jutsu.png'),(74,12,42,1,2,'1000M Panchi','Sakura dá um soco tão forte no estômago do inimigo que ele é enviado à 1km de distância.','1000m-panchi.png'),(75,17,42,1,2,'Tobikomi Jishin','Sakura salta e mergulha no chão, causando um terremoto.','tobikomi-jishin.png'),(76,19,42,1,4,'Surotaiju','Sakura consegue pegar um imenso objeto, como uma árvore gigante, e esmagar o inimigo com ela.','surotaiju.png'),(77,24,42,1,2,'Megaton Panchi','Sakura puxa o inimigo e em seguida soca seu estômago, destruindo todos os órgãos interiores dele.','megaton-panchi.png'),(78,26,42,1,3,'Kekkai Shihou Fuujin','Com a ajuda de Bunshins, Sakura consegue criar uma barreira para prender o inimigo.','kekkai-shihou-fuujin.png'),(79,31,42,1,2,'Oukashou','Sakura soca o chão com quanta força, que um terremoto é causado e o chão é desintegrado.','oukashou.png'),(80,35,42,1,2,'Daichi Kujo','Sakura arremessa o inimigo para o ar, e o finaliza esmagando-o no chão com um soco no estômago tão forte que, além de destruir o corpo do inimigo, destrói o cenário ao redor.','daichi-kujo.png'),(81,2,4,1,2,'Sennen Goroshi','Kakashi junta as mãos em forma de Selo de Tigre, e acerta o traseiro do inimigo, o arremessando para o alto com uma imensa dor.','sennen-goroshi.png'),(82,5,4,1,4,'Tsuiga no Jutsu','Kakashi invoca diversos cães ninja que saem do chão debaixo do inimigo e o prendem com mordidas.','tsuiga-no-jutsu.png'),(83,10,4,1,1,'Doton Shinjuu Zanshu no Jutsu','Kakashi entra na terra, aparece embaixo do inimigo e o puxa para dentro, deixando apenas sua cabeça de fora.','doton-shinjuu-zanshu-no-jutsu.png'),(84,12,4,1,1,'Raikiri','Kakashi concentra chakra de Raio em uma de suas mãos, e corre em direção ao inimigo, podendo perfurá-lo facilmente.','raikiri.png'),(85,17,4,1,1,'Doton Doryuuheki no Jutsu ','Cria uma parede imensa com cabeças de cães, usadas para se defender ou prender o inimigo.','doton-doryuuheki-no-jutsu.png'),(86,19,4,1,1,'Raijuu Hashiri no Jutsu','Atacando de longa distância, Kakashi cria um cão feito de relâmpago que avança rapidamente para cima do inimigo.','raijuu-hashiri-no-jutsu.png'),(87,24,4,1,1,'Raiton Bunshin','Kakashi instantaneamente substitui seu corpo com um clone seu feito de raio, que ao ser acertado, eletrocuta o inimigo.','raiton-bunshin.png'),(88,26,4,1,1,'Raikiri Sousenkou','Kakashi usa o Raikiri em ambas as mãos, atacando o inimigo por todas as direções.','raikiri-sousenkou.png'),(89,31,4,1,1,'Souraishin ','Usando o Raikiri Sousenkou, Kakashi avança rapidamente para baixo do inimigo, arremessando-o para cima com um soco no queixo, e o acertando por todas as direções no ar, finalizando arremessando o inimigo diretamente para o chão.','souraishin.png'),(90,35,4,1,3,'Kamui','Kakashi usa seu Sharingan e abre uma fenda no espaço-tempo, mandando o alvo para outra dimensão.','kamui.png'),(91,2,43,1,4,'Kiritateru Jinsoku','Kakashi usa sua tantou e desfere inúmeros golpes no inimigo.','kiritateru-jinsoku.png'),(92,5,43,1,4,'Hangeki','Um ataque tão rápido com sua tantou que consegue previnir e contra-atacar qualquer golpe.','hangeki.png'),(93,10,43,1,5,'Takusan Kibaku Fuda','Preenche o campo com milhares de selos explosivos que são ativados simultaneamente, criando uma imensa explosão.','takusan-kibaku-fuda.png'),(94,12,43,1,1,'Chidori','Kakashi concentra chakra de Raio em uma de suas mãos, e corre em direção ao inimigo, podendo perfurá-lo facilmente.','chidori.png'),(95,17,43,1,2,'Kyougaku Hitokeri','Aparece rapidamente em um ponto cego do inimigo e o ataca com um chute.','kyougaku-hitokeri.png'),(96,19,43,1,1,'Chidori Raishuu','Controla o Chidori em sua mão para não perfurar, mas sim eletrocutar e nocautear o inimigo.','chidori-raishuu.png'),(97,24,43,1,4,'Hakkou Chakra Tou','Kakashi concentra um chakra branco especial em sua tantou, fortacelendo seus golpes.','hakkou-chakra-tou.png'),(98,26,43,1,4,'Tokkan Tobikomi','Kakashi pula de um lugar muito alto e cai atacando o inimigo de cima, podendo cortá-lo no meio.','tokkan-tobikomi.png'),(99,31,43,1,3,'Sharingan no Jutsu','Kakashi usa seu Sharingan para ler os movimentos do inimigo e contra-atacar facilmente.','sharingan-no-jutsu.png'),(100,35,43,1,1,'Sharingan Chidori Rendan','Prevendo todos os movimentos do inimigo, Kakashi consegue fortificar e acertar seu Chidori de uma forma precisa no inimigo.','sharingan-chidori-rendan.png'),(101,2,5,1,3,'Suna no Yoroi','Gaara cria uma grossa armadura de areia por cima de sua pele, tornando-se quase impenetrável.','suna-no-yoroi.png'),(102,5,5,1,3,'Sabaku Fuyuu','Gaara cria uma plataforma de areia usada para voar.','sabaku-fuyuu.png'),(103,10,5,1,5,'Rendan Suna Shigure','Gaara atira centenas de senbons feitas de areia que podem facilmente perfurar uma pele humana.','rendan-suna-shigure.png'),(104,12,5,1,3,'Gokusa Maisou','Gaara cria uma areia movediça envolta do inimigo que o engole.','gokusa-maisou.png'),(105,17,5,1,3,'Ryuusa Bakuryuu','Gaara cria uma onda gigantesca de areia que enterra tudo e a todos ao seu alcance.','ryuusa-bakuryuu.png'),(106,19,5,1,3,'Sabaku Kyuu','Gaara envolve o inimigo com um caixão de areia, o leva para o céu e explode seu corpo, esmagando-o com a areia.','sabaku-kyuu.png'),(107,24,5,1,3,'Suna Bunshin','Cria um clone de areia usado para bloquear ataques.','suna-bunshin.png'),(108,26,5,1,3,'Sabaku Sousou','Após usar o Gokusa Maisou, Gaara explode a areia, despedaçando o alvo.','sabaku-sousou.png'),(109,31,5,1,4,'Saikou Zettai Bougyo : Shukaku no Tate','Cria um escudo gigante com o poder do bijuu de uma cauda.','shukaku-no-tate.png'),(110,35,5,1,4,'Saikou Zettai Kougeki : Shukaku no Hoko','Cria uma poderosa lança de areia com o poder do bijuu de uma cauda.','shukaku-no-hoko.png'),(111,2,44,1,5,'Daisan no Me','Gaara cria um clone feito de areia para espionar o inimigo de um lugar seguro.','daisan-no-me.png'),(112,5,44,1,3,'Sabaku Fuyuu','Gaara cria uma plataforma de areia usada para voar.','sabaku-fuyuu.png'),(113,10,44,1,3,'Sabaku Kyuu','Gaara envolve o inimigo com um caixão de areia, o leva para o céu e explode seu corpo, esmagando-o com a areia.','sabaku-kyuu.png'),(114,12,44,1,3,'Sabaku Sousou','Após usar o Gokusa Maisou, Gaara explode a areia, despedaçando o alvo.','sabaku-sousou.png'),(115,17,44,1,3,'Ryuusa Bakuryuu','Gaara cria uma onda gigantesca de areia que enterra tudo e a todos ao seu alcance.','ryuusa-bakuryuu.png'),(116,19,44,1,5,'Suna no Taihou','Gaara dispara areia como se fosse um canhão.','suna-no-taihou.png'),(117,24,44,1,3,'Suna no Tate','Gaara cria um grosso escudo de areia, se protegendo quase que perfeitamente.','suna-no-tate.png'),(118,26,44,1,2,'Shukaku no Tsume','Gaara usa sua areia para criar garras semelhantes ao de Shukaku.','shukaku-no-tsume.png'),(119,31,44,1,3,'Kuusa Bouheki','Usando toda areia ao seu redor, Gaara cria uma imensa barreira que é capaz de proteger uma vila inteira.','kuusa-bouheki.png'),(120,35,44,1,3,'Sabaku Rou','Gaara usa uma imensa quantidade de areia para envolver o inimigo em todas as direções e capturá-lo, tornando praticamente impossível escapar.','sabaku-rou.png'),(121,2,6,1,3,'Rasengan','Jiraiya concentra chakra em suas mãos, rotacionando em alta velocidade, formando uma esfera, e acerta o inimigo à uma distância curta.','rasengan.png'),(122,5,6,1,1,'Katon Endan','Jiraiya dispara um lança-chamas pela boca.','katon-endan.png'),(123,10,6,1,3,'Gamayudan','Jiraiya cospe óleo de sapo pela boca.','gamayudan.png'),(124,12,6,1,1,'Katon Gamayu Endan','Jiraiya mistura o óleo disparado por Gamabunta junto com seu Katon Endan, tornando-o muito mais poderoso.','katon-gamayu-endan.png'),(125,17,6,1,3,'Gamaguchi Shibari','Transforma o local como se fosse dentro do estômago de um sapo.','gamaguchi-shibari.png'),(126,19,6,1,3,'Kaeru Kaeru no Jutsu','Utilizando o Gamaguchi Shibari, Jiraiya consegue prender os inimigos nas paredes e no chão.','kaeru-kaeru-no-jutsu.png'),(127,24,6,1,2,'Hari Jizou','Jiraiya expande seu cabelo, criando uma barreira espinhosa ao redor de seu corpo.','hari-jizou.png'),(128,26,6,1,1,'Doton Yomi Numa','Jiraiya cria um pântano 