o de sua armadura para se proteger de qualquer ataque, sendo capaz de contra atacar em seguida.','escudo-de-atena.png'),(496,19,63,1,3,'Regeneração Divina','Saori, sendo uma deusa, consegue utilizar seu cosmo para recuperar completamente qualquer pessoa que esteja por um fio de vida.','regeneracao-divina.png'),(497,24,63,1,3,'Armadura Sagrada de Atena','Saori derrama seu sangue na Estátua de Atena, despertando a armadura divina.','armadura-sagrada-atena.png'),(498,26,63,1,4,'Benção dos Cavaleiros de Atena','Saori ataca com seu cajado, recebendo o cosmo dos 5 cavaleiros de bronze, e perfura o inimigo com seus poderes combinados.','bencao-cavaleiros-atena.png'),(499,31,63,1,3,'Milagre da Deusa da Sabedoria','Saori, com a Armadura da Deusa Atena, consegue realizar milagres, podendo evitar conflitos ou acabar com eles.','milagre-deusa-sabedoria.png'),(500,35,63,1,3,'Invocação Sagrada dos 88 Cavaleiros','Saori ergue seu cajado para os céus, e o ambiente se transforma na própria galáxia. Então todas as estrelas das 88 costelações de seus cavaleiros caem do seu sob seu inimigo, o destruindo por completo.','invocacao-sagrada-88-cavaleiros.png'),(501,2,19,1,2,'Gomu Gomu no Pistol ','Consiste em um soco normal, acrescentado pela elasticidade de Luffy.','gomu-gomu-no-pistol.png'),(502,5,19,1,2,'Gomu Gomu no Bazooka','Luffy estica seus braços para trás, esticando-os bem e depois dá um duplo soco com potência devastadora, acertando com as duas palmas da mão aberta ou com o punho fechado mesmo.','gomu-gomu-no-bazooka.png'),(503,10,19,1,2,'Gomu Gomu no Gatling Gun','Luffy usa uma sequência enorme de socos elásticos em alta velocidade, como se fosse centenas de Gomu Gomu no Pistol seguidos, dando até a impressão de que tem vários braços.','gomu-gomu-no-gatling-gun.png'),(504,12,19,1,2,'Gomu Gomu no Rifle','Luffy enrola seu braço como uma mola e dá um soco poderoso. ','gomu-gomu-no-rifle.png'),(505,17,19,1,2,'Gomu Gomu no Cannon','Luffy aplica vários socos, mas nenhum acerta o adver