u Haki para endurecer o braço. Em seguida, estica o braço para trás que juntamente com a velocidade do Gear Second, inflama, causando dano devastador.','6.png'),(517,24,64,1,3,'Haoshoku Haki','Tipo mais raro e forte de Haki que existe, mais conhecido como Haki do Rei, Luffy usa-o em uma massiva escala e força desacordando todos em sua volta.','7.png'),(518,26,64,1,1,'Gomu Gomu no Thor Elephant Gun','Luffy desfere um Elephant Gun de cima para baixo. A colisão do golpe com o inimigo, gera raios, eletrocutando o adversário.','8.png'),(519,31,64,1,4,'Gomu Gomu no Grizzly Magnum','Luffy combina sua Giant Bazooka com o Busoshoku Haki, resultando em um golpe poderosíssimo.','9.png'),(520,35,64,1,4,'Gomu Gomu no Elephant Gatling Gun','Luffy usa uma sequência enorme de  Elephant Gun, causando um dano absurdo e destruindo absolutamente tudo em seu caminho.','10.png'),(521,2,20,1,4,'Oni Giri','Zoro segura duas espadas com as mãos e uma com a boca. Então ele e aproxima do inimigo com grande velocidade e corta com as três lâminas.','oni-giri.png'),(522,5,20,1,4,'Santoryu Ogi: Sanzen Senkai','Zoro forma um ângulo com suas espadas e as gira rapidamente, partindo para cima do adversário e cortando-o.','santoryu-ogi-sanzen-senkai.png'),(523,10,20,1,4,'Toro Nagashi','Zoro se aproxima do inimigo e o bloqueia usando duas espadas, e a terceira usa para feri-lo. ','toro-nagashi.png'),(524,12,20,1,4,'Ushi Bari','Zoro ataca usando duas espadas nas mãos como chifres de touro, e continua atacando com a espada da boca.','ushi-bari.png'),(525,17,20,1,4,'Hyakuhachi Pound Ho','Usando o movimento de suas três espadas, Zoro cria rajadas cortantes.','hyakuhachi-pound-ho.png'),(526,19,20,1,4,'Daigekken','Usando suas duas katanas grudadas ao nunchaku gigante de concreto ele começa a manipular a arma inteira.','daigekken.png'),(527,24,20,1,4,'Sanjoroku Pound Ho','Usando o movimento de sua espada, Zoro cria uma única rajada cortante.','sanjoroku-pound-ho.png'),(528,26,20,1,2,'Mutoryu','Neste estilo, Zo