 ou mágicos de volta para o oponente.','Energy-Deflection.png'),(1503,10,77,1,4,'Nobiro Reiken','Kuwabara estende sua espada para ficar similar com uma lança, podendo ser usada para pular ou atacar.','Nobiro-Reiken.png'),(1504,12,77,1,4,'Nobiro Kaibutsu','Kuwabara estica sua Reiken para empalar diversos inimigos juntos e prendê-los em algum lugar.','Nobiro-Kaibutsu.png'),(1505,17,77,1,4,'Reiken Nitouryuu','Kuwabara cria uma Reiken em cada mão, podendo atacar muito mais rápido e com a mesma força.','Reiken-Nitouryuu.png'),(1506,19,77,1,3,'Spiritual Strike','Kuwabara estende sua espada para ficar flexível e acertar o oponente.','Spiritual-Strike.png'),(1507,24,77,1,5,'Rei Shuriken','Kuwabara lança diversos raios de sua mão, similar à uma shuriken, podendo acertar diversos inimigos ao mesmo tempo.','Rei-Shuriken.png'),(1508,26,77,1,4,'Tameshi No Ken','Kuwabara usa uma espada que cria uma forma única, criando uma enorme lâmina prismática feita inteiramente de energia espiritual.','Tameshi-No-Ken.png'),(1509,31,77,1,4,'Kyodai Reikibou','Kuwabara usa sua Tameshi no Ken para criar uma espécie de mata-moscas para acertar o inimigo.','Kyodai-Reikibou.png'),(1510,35,77,1,3,'Jigen Tou','Kuwabara amplifica os poderes da sua espada espiritual, tornando uma espada dimensional capaz de cortar qualquer coisa.','Jigen-Tou.png'),(1511,2,78,1,4,'Bara Kyoku Ben Jin','Kurama usa sua energia demoníaca para crescer uma rosa em forma de chicote, que pode cortar até aço.','Bara-Kyoku-Ben-Jin.png'),(1512,5,78,1,4,'Kagon Retsuzanshi','Kurama ataca rapidamente com seus chicotes em múltiplas direções.','Kagon-Retsuzanshi.png'),(1513,10,78,1,3,'Fuuka Enbu Jin','Kurama gira o chicote ao seu redor, espalhando pétalas de rosas que paralisam seus oponentes.','Fuuka-Enbu-Jin.png'),(1514,12,78,1,1,'Shimaneki Sou','Kurama planta sementes no corpo de seu oponente e faz as flores crescerem com sua energia demoníaca, matando o oponente.','Shimaneki-Sou.png'),(1515,17,78,1,1,'Kyuuketsu Shokubutsu','Kurama 