s braços gigantes para prender seus inimigos ela usa os outros oito para estapea-los repetidamente.','6.png'),(2325,24,117,1,2,'Ochenta Fleur - Cuatro Manos: Clutch','Robin cria quarto mãos gigantescas e usa-as em grandes inimigos ou contra um grande número de oponentes, com as mãos gigantescas ela os prende com uma força esmagadora e quebra os ossos do corpo de seu oponente.','7.png'),(2326,26,117,1,3,'Cien Fleur: Wing','Técnica de Robin que utiliza cem braços, Robin cria cem braços em suas costas e utiliza-os para criar asas, e usa-as para ajudar algum amigo ou para um ataque surpresa.','8.png'),(2327,31,117,1,3,'Cien Fleur: Delphinium','Robin cria cem braços e utiliza-os para criar um \'caminho\' com seus braços usando-o para socorrer algum de seus aliados ou para fazer o inimigo rolar para longe com o intuito de desarma-lo ou até mesmo matá-lo dependendo da distância.','9.png'),(2328,35,117,1,3,'Cien Fleur: Big Tree','Técnica suprema de Robin que utiliza cem braços, Robin pode criar uma gigantesca quantidade de mãos que se assemelham a uma grande árvore, usada para dar um dano massivo em todos atingidos ou para destruir um inimigo muito grande.','10.png'),(2329,41,117,1,NULL,'Arqueóloga - Iniciante','O estágio Iniciante da Especialidade de Robin.','esp-1.png'),(2330,42,117,1,NULL,'Arqueóloga - Intermediário','O estágio Intermediário da Especialidade de Robin.','esp-2.png'),(2331,43,117,1,NULL,'Arqueóloga - Avançado','O estágio Avançado da Especialidade de Robin.','esp-3.png'),(2332,44,117,1,NULL,'Arqueóloga - Profissional','O estágio Profissional da Especialidade de Robin.','esp-4.png'),(2333,45,117,1,NULL,'Arqueóloga - Mestre','O estágio Mestre da Especialidade de Robin.','esp-5.png'),(2335,37,117,1,NULL,'Hana Hana no Mi - Intermediário','O estágio Intermediário da Habilidade de Robin.','hab-2.png'),(2336,38,117,1,NULL,'Hana Hana no Mi - Avançado','O estágio Avançado da Habilidade de Robin.','hab-3.png'),(2337,39,117,1,NULL,'Hana Hana no Mi - Profissional','O estágio Profissional da Habilidade de Robin.','hab-4.png'),(2338,40,117,1,NULL,'Hana Hana no Mi - Mestre','O estágio Mestre da Habilidade de Robin.','hab-5.png'),(2339,2,118,1,2,'Cuarenta Fleur - Cuatro Mano: Hold','Criando quatro braços gigantescos usando quarenta braços, Robin agarra seu oponente desarmando-o e em seguida o rende, em um movimento de submissão.','1.png'),(2340,5,118,1,2,'Cuarenta Fleur - Cuatro Mano: Spank','Técnica em que RObin cria quatro braços gigantes para agarrar e estapear forte e repetidamente seus inimigos.','2.png'),(2341,10,118,1,2,'Cien Fleur: Rindo','Robin contorce a parte de cima do corpo de seu oponente, causando um forte dano e desarmando-o.','3.png'),(2342,12,118,1,2,'Cien Fleur: Dos Mano','Técnica que Robin utiliza cem braços para criar dois braços grandes, utiliza-os para atingir uma grande quantidade de inimigos ou para segurar um oponente maior.','4.png'),(2343,17,118,1,2,'Mille Fleur: Gigantesco Mano','Robin cria dois braços gigantescos em qualquer lugar, ambos com uma força física enorme mesmo usados embaixo da água.','5.png'),(2344,19,118,1,2,'Mille Fleur - Gigantesco Mano: Stomp','Usando duas pernas gigantes criadas pelo Mille Fleur: Gigantesco Mano, Robin pisa em seus oponentes esmagando-os com uma força enorme.','6.png'),(2345,24,118,1,2,'Mille Fleur - Gigantesco Mano: Spank','Usando dois braços gigantescos criados pelo Mille Fleur: Gigantesco Mano, Robin ataca seus inimigos estapeando-os repetidamente.','7.png'),(2346,26,118,1,2,'Mille Fleur: Campo de Flores','Robin cria mil braços em uma grande área em volta de si, capturando qualquer inimigo ali presente.','8.png'),(2347,31,118,1,3,'Cuerpo Fleur','Robin cria uma cópia de seu corpo em uma determinada parte de seu inimigo, ela também pode criar partes extras como braços e pernas ao mesmo tempo.','9.png'),(2348,35,118,1,2,'Cuerpo Fleur: Doble Clutch','Robin cria uma cópia de seu corpo com braços extras que ela usa para prender a cabeça de seu inimigo, enquanto ela mesma agarra as pernas dele e então ela utiliza a técnica Clutch simultaneamente em ambas as partes do corpo de seu alvo quebrando o pescoço e as pernas de seu oponente.','10.png'),(2349,41,118,1,NULL,'Arqueóloga - Iniciante','O estágio Iniciante da Especialidade de Robin.','esp-1.png'),(2350,42,118,1,NULL,'Arqueóloga - Intermediário','O estágio Intermediário da Especialidade de Robin.','esp-2.png'),(2351,43,118,1,NULL,'Arqueóloga - Avançado','O estágio Avançado da Especialidade de Robin.','esp-3.png'),(2352,44,118,1,NULL,'Arqueóloga - Profissional','O estágio Profissional da Especialidade de Robin.','esp-4.png'),(2353,45,118,1,NULL,'Arqueóloga - Mestre','O estágio Mestre da Especialidade de Robin.','esp-5.png'),(2355,37,118,1,NULL,'Hana Hana no Mi - Intermediário','O estágio Intermediário da Habilidade de Robin.','hab-2.png'),(2356,38,118,1,NULL,'Hana Hana no Mi - Avançado','O estágio Avançado da Habilidade de Robin.','hab-3.png'),(2357,39,118,1,NULL,'Hana Hana no Mi - Profissional','O estágio Profissional da Habilidade de Robin.','hab-4.png'),(2358,40,118,1,NULL,'Hana Hana no Mi - Mestre','O estágio Mestre da Habilidade de Robin.','hab-5.png'),(2359,2,119,1,4,'Bisento Haki','Fortalecendo seu Bisento com Haki, Edward ataca seu inimigo fortamente cortando até mesmo usuarios de Logia.','1.png'),(2360,5,119,1,3,'Jishinshouten','Edward golpeia o ar com força criando tremores fortes o suficiente para criar terremotos derrubando todos a sua volta.','2.png'),(2361,10,119,1,4,'Kabutowari','Edward concentra sua enorme força em um único ponto, para criar um devastador e explosivo ataque capaz de arremessar todos a sua volta.','3.png'),(2362,12,119,1,3,'Shougekiha','Edward canaliza sua força em um ataque causando massivas ondas de choque arremessando seus inimigos fortemente ao ar e destruindo tudo em sua volta.','4.png'),(2363,17,119,1,3,'Kaishin','Edward literalmente trinca o ar usando sua massiva força criando devastadoras ondas de choque pelo ar que vai em direção ao lugar apontado, as ondas são capazes de atingirem qualquer coisa destruindo tudo por onde passa.','5.png'),(2364,19,119,1,4,'Naginata Rasetsu','Edward concentra sua força na ponta do seu Bisento aumenta e muito seu poder destrutivo capaz de arremessar para longe seus oponentes e destruir construções inteiras.','6.png'),(2365,24,119,1,3,'Gekishin','Muito pareceido com o \'Kaishin\', só que mais perto, causando um dano massivo e extremamente destrutivo capaz de destruir oponentes muito fortes com apenas um ataque.','7.png'),(2366,26,119,1,3,'Watatsumi Jishin','Edward canaliza sua força em ambas as mãos e logo em seguida golpeia fortemente o ar com ambas trincado-o tão forte criando enormes maremotos.','8.png'),(2367,31,119,1,3,'Haoshoku Haki','Tipo mais raro e forte de Haki que existe, mais conhecido como Haki do Rei, Edward usa-o em uma massiva escala e força desacordando todos em sua volta.','9.png'),(2368,35,119,1,3,'Shima Yurashi','Edward \'prende\' uma determinada aréa, segurando o ar em sua volta e rapidamente puxa-o. Fazendo isso ele é capaz de distorcer uma ilha inteira e distorcer até mesmo o oceano esse poder como disse Sengoku, é o poder que pode destruir o mundo!','10.png'),(2369,41,119,1,NULL,'Yonkou: Barba Branca - Iniciante','O estágio Iniciante da Especialidade de Edward.','esp-1.png'),(2370,42,119,1,NULL,'Yonkou: Barba Branca - Intermediário','O estágio Intermediário da Especialidade de Edward.','esp-2.png'),(2371,43,119,1,NULL,'Yonkou: Barba Branca - Avançado','O estágio Avançado da Especialidade de Edward.','esp-3.png'),(2372,44,119,1,NULL,'Yonkou: Barba Branca - Profissional','O estágio Profissional da Especialidade de Edward.','esp-4.png'),(2373,45,119,1,NULL,'Yonkou: Barba Branca - Mestre','O estágio Mestre da Especialidade de Edward.','esp-5.png'),(2375,37,119,1,NULL,'Gura Gura no Mi - Intermediário','O estágio Intermediário da Habilidade de Edward.','hab-2.png'),(2376,38,119,1,NULL,'Gura Gura no Mi - Avançado','O estágio Avançado da Habilidade de Edward.',