ntes que circulam ao seu redor e do oponente. Enquanto luta, as espadas atacam de lugares aleatórios, acertando o inimigo sempre em seu ponto cego.','Senkei.png'),(2407,31,121,1,4,'Goukei','Byakuya cria inúmeras espadas para fazer uma formação esférica, que avançam todas de uma vez no inimigo, obliterando-o.','Goukei.png'),(2408,35,121,1,3,'Shoukei Hakuteiken','Byakuya transforma suas espadas da Bankai em uma só, aumentando drasticamente seu poder ofensivo, tomando a forma de um enorme pássaro branco.','Shoukei-Hakuteiken.png'),(2409,41,121,1,NULL,'Zanjutsu - Iniciante','O estágio Iniciante da Especialidade de Byakuya.','esp-1.png'),(2410,42,121,1,NULL,'Zanjutsu - Intermediário','O estágio Intermediário da Especialidade de Byakuya.','esp-2.png'),(2411,43,121,1,NULL,'Zanjutsu - Avançado','O estágio Avançado da Especialidade de Byakuya.','esp-3.png'),(2412,44,121,1,NULL,'Zanjutsu - Profissional','O estágio Profissional da Especialidade de Byakuya.','esp-4.png'),(2413,45,121,1,NULL,'Zanjutsu - Mestre','O estágio Mestre da Especialidade de Byakuya.','esp-5.png'),(2415,37,121,1,NULL,'Senbonzakura Kageyoshi - Intermediário','O estágio Intermediário da Habilidade de Byakuya.','hab-2.png'),(2416,38,121,1,NULL,'Senbonzakura Kageyoshi - Avançado','O estágio Avançado da Habilidade de Byakuya.','hab-3.png'),(2417,39,121,1,NULL,'Senbonzakura Kageyoshi - Profissional','O estágio Profissional da Habilidade de Byakuya.','hab-4.png'),(2418,40,121,1,NULL,'Senbonzakura Kageyoshi - Mestre','O estágio Mestre da Habilidade de Byakuya.','hab-5.png'),(2419,2,122,1,3,'Mend Beam','Majin Buu usa seu Ki para recuperar seus ferimentos ou impedir que os ferimentos do inimigo se recuperem.','Mend-Beam.png'),(2420,5,122,1,3,'Vaporize','Majin Buu coloca seus braços para frente e dispara um imenso raio esverdeado, criando uma esfere que arremessa o alvo para o espaço.','Vaporize.png'),(2421,10,122,1,1,'Flame Shower Breath','Majin Buu inala uma grande quantidade de ar e exala com muita força, criando um tornado que pode destruir uma cidade inteira.','Flame-Shower-Breath.png'),(2422,12,122,1,3,'Chocolate Beam','Majin Buu lança um raio que transforma seus inimigos em comidas, como chocolates e biscoitos. Em seguida os devora.','Chocolate-Beam.png'),(2423,17,122,1,2,'Innocence Express','Majin Buu corre em alva velocidade para seu inimigo e o derruba usando seu corpo.','Innocence-Express.png'),(2424,19,122,1,5,'Potbelly Attack','Majin Buu arranca um pedaço de seu corpo e o arremessa no inimigo.','Potbelly-Attack.png'),(2425,24,122,1,3,'Gack','Majin Buu lança um poderoso e devastadir raio de energia rosada de sua boca.','Gack.png'),(2426,26,122,1,3,'Enjoy Browning','Majin Buu dispara diversas esferas de energia de uma vez, podendo destruir grandes lugares facilmente.','Enjoy-Browning.png'),(2427,31,122,1,3,'Angry Explosion','Majin Buu aumenta muito sem poder, criando uma aura rosada ao seu redor, que cresce e explode, causando um dano massivo.','Angry-Explosion.png'),(2428,35,122,1,3,'Vanishing Beam','Majin Buu dispara um poderoso raio circular de suas mãos, sem precisar carregar nenhuma energia, pegando o inimgio de surpresa.','Vanishing-Beam.png'),(2429,41,122,1,NULL,'Comilão - Iniciante','O estágio Iniciante da Especialidade de Majin Buu.','esp-1.png'),(2430,42,122,1,NULL,'Comilão - Intermediário','O estágio Intermediário da Especialidade de Majin Buu.','esp-2.png'),(2431,43,122,1,NULL,'Comilão - Avançado','O estágio Avançado da Especialidade de Majin Buu.','esp-3.png'),(2432,44,122,1,NULL,'Comilão - Profissional','O estágio Profissional da Especialidade de Majin Buu.','esp-4.png'),(2433,45,122,1,NULL,'Comilão - Mestre','O estágio Mestre da Especialidade de Majin Buu.','esp-5.png'),(2435,37,122,1,NULL,'Majin - Intermediário','O estágio Intermediário da Habilidade de Majin Buu.','hab-2.png'),(2436,38,122,1,NULL,'Majin - Avançado','O estágio Avançado da Habilidade de Majin Buu.','hab-3.png'),(2437,39,122,1,NULL,'Majin - Profissional','O estágio Profissional da Habilidade de Majin Buu.','hab-4.png'),(2438,40,122,1,NULL,'Majin - Mestre','O estágio Mestre da Habilidade de Majin Buu.','hab-5.png'),(2439,2,123,1,3,'Ki Blast','Kid Buu lança uma esfera de energia com suas mãos. ','Ki-Blast.png'),(2440,5,123,1,2,'Elastic Tentacle','Kid Buu usa o tentáculo de sua cabeça para atacar e imobilizar seus oponentes.','Elastic-Tentacle.png'),(2441,10,123,1,3,'Nightmare Impact','Kid Buu soca o estômago do oponente, e então coloca as mãos no rosto do oponente e cria uma explosão de energia.','Nightmare-Impact.png'),(2442,12,123,1,1,'Electric Shock','Kid Buu cria eletricidade em seu corpo para atacar o oponente e eletrocutá-lo.','Electric-Shock.png'),(2443,17,123,1,3,'Finger Beam','Kid Buu concentra energia na ponta de seu dedo indicador e dispara um poderoso raio de energia.','Finger-Beam.png'),(2444,19,123,1,2,'Buu Rocket','Kid Buu envolve seu corpo com uma energia rosada e voa em direção ao inimigo como um foguete, atravessando o corpo do oponente.','Buu-Rocket.png'),(2445,24,123,1,3,'Assault Rain ','Kid Buu levanta sua mão e dispara uma chuva de raios de energia, que caem todos de uma vez diretamente no inimigo.','Assault-Rain.png'),(2446,26,123,1,3,'Vanishing Beam','Kid Buu dispara um poderoso raio circular de suas mãos, sem precisar carregar nenhuma energia, pegando o inimgio de surpresa.','Vanishing-Beam.png'),(2447,31,123,1,3,'Shocking Ball','Kid Buu cria uma esfera elétrica com suas mãos e a arremessa no oponente.','Shocking-Ball.png'),(2448,35,123,1,3,'Planet Burst','Kid Buu cria uma massiva esfera de energia, que cresce até o ponto que ao arremessá-la, pode destruir o planeta.','Planet-Burst.png'),(2449,41,123,1,NULL,'Maldade Pura - Iniciante','O estágio Iniciante da Especialidade de Kid Buu.','esp-1.png'),(2450,42,123,1,NULL,'Maldade Pura - Intermediário','O estágio Intermediário da Especialidade de Kid Buu.','esp-2.png'),(2451,43,123,1,NULL,'Maldade Pura - Avançado','O estágio Avançado da Especialidade de Kid Buu.','esp-3.png'),(24