imigos para outra dimensão.','Kamui.png'),(2468,35,124,1,3,'Izanagi','Quando ativado, Tobi remove as fronteiras entre realidade e ilusão dentro de seu espaço pessoal. Até certo ponto isso permite que ele controle o seu estado de existência.','Izanagi.png'),(2479,2,125,1,1,'Katon Goukakyuu no Jutsu','Obito cospe uma enorme bola de fogo capaz de queimar tudo ao seu alcance.','Katon-Goukakyuu-no-Jutsu.png'),(2480,5,125,1,1,'Doton Moguragakure no Jutsu','Obito entra na terra e puxa o oponente pelo pé, prendendo-o no chão e deixando apenas a cabeça de fora.','Doton-Moguragakure-no-Jutsu.png'),(2481,10,125,1,1,'Kibaku Jirai','Obito entra no chão e planta diversas minas explosivas por todo campo de batalha.','Kibaku-Jirai.png'),(2482,12,125,1,3,'Genjutsu Sharingan','Obito utiliza seu poder ocular para criar ilusões na mente de seus oponentes.','Genjutsu-Sharingan.png'),(2483,17,125,1,3,'Toumegane no Jutsu','Obito utiliza uma espécie de bola de cristal para observar os inimigos à distância.','Toumegane-no-Jutsu.png'),(2484,19,125,1,3,'Mogura Tataki no Jutsu','Obito cava buracos com uma velocidade incrível, podendo entrar e sair da terra sem ser visto por seus oponentes.','Mogura-Tataki-no-Jutsu.png'),(2485,24,125,1,4,'Sharingan Kunai','Obito ativa seu Sharingan e perfura o ponto mais fraco de seu oponente.','Sharingan-Kunai.png'),(2486,26,125,1,1,'Mokuton Sashiki no Jutsu','Obito arremessa uma estaca de madeira que perfura o alvo e cresce diversos galhos, perfurando o inimigo de dentro pra fora.','Mokuton-Sashiki-no-Jutsu.png'),(2487,31,125,1,3,'Kamui','Obito cria uma fenda no tempo-espaço capaz de teletransportar si mesmo ou os inimigos para outra dimensão.','Kamui.png'),(2488,35,125,1,1,'Mokuton Chika Tsukene no Jutsu','Obito invoca uma gigantesca árvore ao seu redor que perfura todos os inimigos e faz com que mais árvores cresçam dentro de cada um, criando um mar de sangue.','Mokuton-Chika-Tsukene-no-Jutsu.png'),(2499,2,146,1,2,'Dark Fist','Teach envolve sua mão com trevas e em seguida golpeia seu inimigo causando um forte dano.','1.png'),(2500,5,146,1,3,'Black Beam','Teach canaliza suas forças em uma mão das mãos e em seguida libera um forte raio de trevas em seu oponente esmagando e ferindo a área atingida.','2.png'),(2501,10,146,1,2,'Darkness Strike','Teach transforma todo o seu corpo em trevas e avança sobre seu oponente em um ataque frontal mas porem muito poderoso.','3.png'),(2502,12,146,1,5,'Dark Matter','Teach cria uma enorme bola de trevas e a joga em seu oponente, bloqueando a sua visão e o ferindo gravemente.','4.png'),(2503,17,146,1,2,'Kurouzu: Black Vortex','Teach estende um de seus braços na direção do seu oponente, então ele o puxa usando seus poderes gravitacionais e agarra-o anulando sua Akuma no Mi e o golpeando massivamente.','5.png'),(2504,19,146,1,3,'Black Pillar','Teach cria um gigantesco Pilar de trevas empalando seu inimigo ferindo-o massivamente.','6.png'),(2505,24,146,1,3,'Black World','Teach cobre a área ao seu redor completamente usando as trevas bloqueando a visão do inimigo.','7.png'),(2506,26,146,1,2,'Eternal Darkness','Após usar o Black World, Teach transforma todo o seu corpo em trevas, atacando seu oponente impiedosamente.','8.png'),(2507,31,146,1,3,'Black Hole','Teach espalha suas trevas por uma enorme área engolindo tudo nela presente, tudo que for engolido é submetido a uma enorme pressão gravitacional sendo totalmente esmagado.','9.png'),(2508,35,146,1,3,'Black Hole: Liberation','Após usar o Black Hole para engolir tudo em sua volta, Teach libera tudo aquilo de uma vez massacrando todos em sua volta.','10.png'),(2509,41,146,1,NULL,'Shichibukai: Barba Negra - Iniciante','O estágio Iniciante da Especialidade de Teach.','esp-1.png'),(2510,42,146,1,NULL,'Shichibukai: Barba Negra - Intermediário','O estágio Intermediário da Especialidade de Teach.','esp-2.png'),(2511,43,146,1,NULL,'Shichibukai: Barba Negra - Avançado','O estágio Avançado da Especialidade de Teach.','esp-3.png'),(2512,44,146,1,NULL,'