ência absurda, Mu é capaz de usar telecinese controlando a mente de seus oponentes desarmando-os.','4.png'),(2543,17,149,1,3,'Muralha de Cristal','Mu cria um muro invisível ao olho humano. Esta barreira defende e reflete qualquer que seja o ataque, repelindo-os com a mesma força e velocidade disparada contra ele.','5.png'),(2544,19,149,1,3,'Teletransporte','Mu pode se teleportar para qualquer lugar a qualquer hora, isso pertindo-o uma vantagem em batalha atacando seu oponente de vários lugares.','6.png'),(2545,24,149,1,3,'Extinção Estelar','Mu acumula seu cosmo que é liberado na forma de choques múltiplos e brilhantes, parecendo uma espécie de galáxia. O adversário atingido pelo ataque é então engolido pela luz. Uma vez que a entrada de luz se fecha, tudo que foi tocado pelo ataque desaparece.','7.png'),(2546,26,149,1,3,'Chuva de Meteoros','Mu desfere rajadas de energia concetradas em seu inimigo destruindo completamente seu corpo.','8.png'),(2547,31,149,1,3,'Revolução Estelar','Mu faz a partir de seu cosmo vários feixes de luz, que atacam simultaneamente o inimigo, a movimentação dos feixes de luz tem a aparência de milhares de estrelas caindo do céu e estraçalhando o adversário.','9.png'),(2548,35,149,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2549,41,149,1,NULL,'Cavaleiro de Ouro - Iniciante','O estágio Iniciante da Especialidade de Mu.','esp-1.png'),(2550,42,149,1,NULL,'Cavaleiro de Ouro - Intermediário','O estágio Intermediário da Especialidade de Mu.','esp-2.png'),(2551,43,149,1,NULL,'Cavaleiro de Ouro - Avançado','O estágio Avançado da Especialidade de Mu.','esp-3.png'),(2552,44,149,1,NULL,'Cavaleiro de Ouro - Profissional','O estágio Profissional da Especialidade de Mu.','esp-4.png'),(2553,45,149,1,NULL,'Cavaleiro de Ouro - Mestre','O estágio Mestre da Especialidade de Mu.','esp-5.png'),(2555,37,149,1,NULL,'Sétimo Sentido - Intermediário','O estágio Intermediário da Habilidade de Mu.','hab-2.png'),(2556,38,149,1,NULL,'Sétimo Sentido - Avançado','O estágio Avançado da Habilidade de Mu.','hab-3.png'),(2557,39,149,1,NULL,'Sétimo Sentido - Profissional','O estágio Profissional da Habilidade de Mu.','hab-4.png'),(2558,40,149,1,NULL,'Sétimo Sentido - Mestre','O estágio Mestre da Habilidade de Mu.','hab-5.png'),(2559,2,150,1,2,'Punho de Titã','Ataque impiedoso de Aldebaran que massacra seu oponente com um soco focalizado.','1.png'),(2560,5,150,1,2,'Fúria Esmagadora','Usando sua força bruta esmagadora, Aldebaran golpeia seu oponente várias vezes massacrando seu oponente.','2.png'),(2561,10,150,1,2,'Punho de Aço','Aldebaran combina sua força física descomunal com seu grande cosmo, podendo com um soco, desferir uma grande quantidade de cosmo, causando grandes danos.','3.png'),(2562,12,150,1,3,'Esquiva Ilusória','Aldebaran se esquiva do golpe inimigo, mas cria uma ilusão contra atacando com uma força destruidora.','4.png'),(2563,17,150,1,2,'Esmagamento de Touro','Aldebaran concentra sua força em ambas as mãos e da um ataque preciso na cabeça de seu oponente, as vezes causando a morte imediata.','5.png'),(2564,19,150,1,3,'Grande Chifre: Defensivo','Aldebaran descruza e cruza de novo os braços a velocidade da luz, e, ao movimentar os braços nessa velocidade, ele forma uma onde de choque causando ferimentos em seu inimigo ou se defendendo dos ataques.','6.png'),(2565,24,150,1,3,'Explosão de Touro','Aldebaran envolve seu corpo usando seu cosmo de tal forma que assume a imagem de um grande touro dourado atacando impiedosamente seu oponente.','7.png'),(2566,26,150,1,3,'Grande Chifre: Ofensivo','Aldebaran concentra seu cosmo em seus punhos e dispara uma onda de choque com sua cosmo energia que tinha concentrado para frente, podendo assim, despedaçar seu inimigo.','8.png'),(2567,31,150,1,3,'Nova Titã','Aldebaran atinge o chão e cria uma gigantesca explosão que destrói todo o solo ao redor','9.png'),(2568,35,150,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2569,41,150,1,NULL,'Cavaleiro de Ouro - Iniciante','O estágio Iniciante da Especialidade de Aldebaran.','esp-1.png'),(2570,42,150,1,NULL,'Cavaleiro de Ouro - Intermediário','O estágio Intermediário da Especialidade de Aldebaran.','esp-2.png'),(2571,43,150,1,NULL,'Cavaleiro de Ouro - Avançado','O estágio Avançado da Especialidade de Aldebaran.','esp-3.png'),(2572,44,150,1,NULL,'Cavaleiro de Ouro - Profissional','O estágio Profissional da Especialidade de Aldebaran.','esp-4.png'),(2573,45,150,1,NULL,'Cavaleiro de Ouro - Mestre','O estágio Mestre da Especialidade de Aldebaran.','esp-5.png'),(2575,37,150,1,NULL,'Sétimo Sentido - Intermediário','O estágio Intermediário da Habilidade de Aldebaran.','hab-2.png'),(2576,38,150,1,NULL,'Sétimo Sentido - Avançado','O estágio Avançado da Habilidade de Aldebaran.','hab-3.png'),(2577,39,150,1,NULL,'Sétimo Sentido - Profissional','O estágio Profissional da Habilidade de Aldebaran.','hab-4.png'),(2578,40,150,1,NULL,'Sétimo Sentido - Mestre','O estágio Mestre da Habilidade de Aldebaran.','hab-5.png'),(2579,2,151,1,2,'Acubens','O cosmo de Máscara da Morte é concentrado nas pernas da Armadura de Ouro de Câncer. Em seguida, ele aperta o inimigo entre as pernas com força suficiente para partí-lo em dois como se fosse uma pinça de um caranguejo.','1.png'),(2580,5,151,1,1,'Chamas Demoníacas','Máscara da Morte incinera as almas ao redor através do uso de fogo-fátuo, utilizando-as para alimentar as chamas que ferem diretamente a alma do adversário.','2.png'),(2581,10,151,1,3,'Ondas do Inferno','Máscara da Morte concentra sua cosmo-energia na ponta de seu dedo indicador, e dispara um aura branca, que envolve o inimigo e o arrasta para a entrada do mundo dos mortos, podendo separar a alma do inimigo de seu corpo e enviá-lo para a entrada da morte, ou também enviando seu corpo junto de sua alma.','3.png'),(2582,12,151,1,3,'Declínio Infernal','Máscara da Morte preenche o corpo de duas marionetes para dispararem um rajada de energia do Ondas do Inferno no oponente e arremessá-lo violentamente para cima.','4.png'),(2583,17,151,1,5,'Guia das Trevas','Concentrando sua energia cósmica do Ondas do Inferno na mão direita, Máscara da Morte cria uma esfera de energia de cosmo e a lança com toda a velocidade em direção ao adversário.','5.png'),(2584,19,151,1,3,'Buraco Negro','Máscara da Morte cria um buraco negro que aparece em baixo de seu oponente, sugando sua alma e a enviando para a entrada da morte, a Colina do Yomotsu Hirasaga.','6.png'),(2585,24,151,1,3,'Hecatombe dos Espíritos','Máscara da Morte usa as almas como pólvora, provocando uma grande explosão. A explosão depende da quantidade de almas envolvidas no local.','7.png'),(2586,26,151,1,3,'Limbo do Inferno','Máscara da Morte levanta os dois braços e os cruza, concentrando sua cosmo energia do Ondas do Inferno nas duas mãos, criando duas esferas de energia. Depois, ele as une num só ataque, que toma a forma de um tornado de cosmo que destrói a alma do oponente e o arremessa diretamente nas profundezas do Mundo dos Mortos.','8.png'),(2587,31,151,1,3,'Réquiem das Almas','Ataque devastador de Máscara da Morte onde ele libera todas as almas armazenadas por ele em um único movimento destruindo tudo em sua volta.','9.png'),(2588,35,151,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2599,2,152,1,3,'Raio de Energia','Aioria focaliza seu cosmo em uma das mãos e libera um forte raio de energia.','1.png'),(2600,5,152,1,3,'Rugido do Leão','Aioria o grande leão dourado que é capaz de intimidar até os oponentes mais fortes atravez de sua presença.','2.png'),(2601,10,152,1,2,'Patada de Leão','Um fortíssimo ataque em que Aioria usa ambas as mãos em um ataque esmagador.','3.png'),(2602,12,152,1,5,'Cápsula do Poder','Aioria desfere um soco no ar no qual dispara um enorme projétil de energia.','4.png'),(2603,17,152,1,3,'Raio Perfurador','Aioria concentra seu cosmo e utilizando apenas um dedo ele desfere um poderoso raio perfurante.','5.png'),(2604,19,152,1,3,'Explosão de Poder','Aioria eleva seu cosmo ao máximo criando uma poderosa aura de raios atacando todos em sua volta.','6.png'),(2605,24,152,1,2,'Soco Relâmpago','Aioria desfere um soco com uma força esmagadora e extrema velocidade.','7.png'),(2606,26,152,1,3,'Choque do Trovão','Aioria concentra todo o seu poder em ambas as mãos e sem seguida libera um devastador trovão de energia.','8.png'),(2607,31,152,1,3,'Relâmpago de Plasma','Aioria solta um golpe de meteoro na velocidade da luz, que consegue desferir mais de cem milhões de socos por segundo, sob a forma de feixes de luz, acabando com todos que entram em seu raio de alcance.','9.png'),(2608,35,152,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2619,2,153,1,3,'Luz Divina','Shaka concentra seu cosmo em ambas as mãos liberando um poderoso raio de luz.','1.png'),(2620,5,153,1,3,'Ohm','Consiste em um mantra que Shaka utiliza para intensificar o seu cosmo acumulado por meditação, Ao queimar o seu cosmo através deste mantra, Shaka atinge o alvo e o afasta de suas proximidades pela irradiação provida de sua energia.','2.png'),(2621,10,153,1,3,'Kahn','Ao empregá-lo, Shaka cria uma poderosa parede esférica de cosmo-energia que envolve o seu corpo em todos os pontos, protegendo-o por inteiro do ataque inimigo.','3.png'),(2622,12,153,1,3,'Benção do Senhor das Trevas','Utilizando uma pequena quantidade de seu sangue ou sendo ferido em batalha, Shaka faz com que mesmo em pequena quantidade, forme um Inferno de Sangue; uma imensa poça de sangue que semelhante a um pântano, faz com que seu inimigo comece a afundar, mas por se tratar de uma poça este acaba morrendo afogado antes.','4.png'),(2623,17,153,1,3,'Selo Conquistador do Mal','Shaka usa um selo para prender no chão todos aqueles que se opõe a Buda, seja armas ou até mesmo corpos.','5.png'),(2624,19,153,1,3,'Ciclo das Seis Existências','Shaka retira a alma dos corpos dos oponentes que estiverem em seu raio de alcance.','6.png'),(2625,24,153,1,3,'Invocação dos Espíritos Malignos','Shaka materializa espíritos malignos e, em meio a múltiplas ilusões, lança-os sobre o inimigo. Esses espíritos seguem em forma espectral avançando rapidamente contra o adversário atacando-o diretamente e/ou causando uma grande explosão.','7.png'),(2626,26,153,1,3,'Rendição Divina','Shaka concentra seu cosmo e libera a energia concentrada contra o adversário. Caso Shaka abra os olhos ao utilizar este ataque o seu poder de destruição aumenta assustadoramente.','8.png'),(2627,31,153,1,3,'Tesouro do Céu','O cosmo que Shaka acumula mantendo seus olhos fechados (ou seja, privando-se de um de seus sentidos), explode quando ele os abre, criando um golpe perfeito que une ataque e defesa, pois não dá chances de o adversário contra-atacar.','9.png'),(2628,35,153,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2639,2,154,1,4,'Escudo de Libra','Dohko utiliza ambos escudos de sua armadura para bloquear qualquer golpe e contra-atacar o inimigo rapidamente.','1.png'),(2640,5,154,1,2,'Dragão Nascente','Dohko concenta seu cosmo em uma das mãos e libera a energia acumulada de uma só vez dando um poderoso soco frontal em seu inimigo.','2.png'),(2641,10,154,1,2,'Fúria do Dragão','Dohko começar a golpear seu oponente incansávelmente na velocidade da luz incontáveis vezes por segundo.','3.png'),(2642,12,154,1,2,'Coléra do Dragão','Basicamente um soco direto, emanado com cosmo parecido com uma rajada de um dragão que, se acertar, leva o oponente pelos ares, enquanto o poder do golpe varia pelo cosmo que Dohko mostra no momento de sua execução.','4.png'),(2643,17,154,1,3,'Dragão Dourado','Um poderoso raio concetrado de Dohko na forma de um Dragão Dourado que destroi tudo o que toca pela frente.','5.png'),(2644,19,154,1,4,'Armas de Libra','Dohko utiliza as armas da Armadura de Libra para atacar o oponente.','6.png'),(2645,24,154,1,2,'Último Dragão','Golpe suicida de Dohko, onde ele sobe aos céus com o inimigo sem parar até que os corpos de ambos virem pó.','7.png'),(2646,26,154,1,3,'Supremo Dragão de Rouzan','Soco supremo de Dohko que de tão forte foi capaz de mudar o curso de uma cachoeira, fazendo-a correr ao contrário.','8.png'),(2647,31,154,1,3,'Cólera dos Cem Dragões','A técnica suprema de Dohko, praticamente idêntica ao de Shiryu, mas a um nível superior. Ao queimar o seu Cosmo máximo, Dohko com os braços estendidos libera toda a sua energia liberando uma onda de choque devastadora que avança, destruindo tudo em seu caminho.','9.png'),(2648,35,154,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2659,2,155,1,5,'Agulha Inicial','Milo usa seu dedo indicador para perfurar o corpo do oponente, que além de causar uma dor enorme ainda causa hemorragia.','1.png'),(2660,5,155,1,3,'Restrição','Milo se concentra, liberando ondas de energia que, como o veneno do escorpião, atingem o sistema nervoso central e endócrino do inimigo, anestesiando-o temporariamente, paralisando assim todas as suas funções.','2.png'),(2661,10,155,1,2,'Veneno Mortal','Milo perfura o alvo e deixa um veneno que provoca uma dor insuportável em todo o corpo de seu oponente.','3.png'),(2662,12,155,1,5,'Agulha Carmesim','Milo expande seu cosmo e usa as mãos para criar inúmeras agulhas de energia vermelha que avançam com toda a força contra o adversário, gerando pequenas explosões ao atingí-lo.','4.png'),(2663,17,155,1,5,'Agulha Escarlate','Milo usa o cosmo na ponta de seu dedo indicador para perfurar o oponente em diversos pontos, fazendo-o sangrar sem parar.','5.png'),(2664,19,155,1,1,'Agulha Incandescente','Milo perfura o corpo do seu oponente na formação das estrelas da constelação de escorpião, que fazem o sangue do oponente ferver.','6.png'),(2665,24,155,1,5,'Agulha Infernal','Milo solta uma agulhada que massacra seu oponente mentalmente e fisicamente, sendo a última agulhada antes da Antares.','7.png'),(2666,26,155,1,2,'Turbilhão de Antares','Milo concentra seu cosmo na palma de suas mãos e depois cria uma correnteza de energia destrutiva. ','8.png'),(2667,31,155,1,5,'Antares','Milo usa seu dedo como um ferrão de um escorpião lendário, capaz de matar qualquer mortal ou provocar uma dor insuportável até mesmo nos deuses.','9.png'),(2668,35,155,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2669,41,155,1,NULL,'Cavaleiro de Ouro - Iniciante','O estágio Iniciante da Especialidade de Milo.','esp-1.png'),(2670,42,155,1,NULL,'Cavaleiro de Ouro - Intermediário','O estágio Intermediário da Especialidade de Milo.','esp-2.png'),(2671,43,155,1,NULL,'Cavaleiro de Ouro - Avançado','O estágio Avançado da Especialidade de Milo.','esp-3.png'),(2672,44,155,1,NULL,'Cavaleiro de Ouro - Profissional','O estágio Profissional da Especialidade de Milo.','esp-4.png'),(2673,45,155,1,NULL,'Cavaleiro de Ouro - Mestre','O estágio Mestre da Especialidade de Milo.','esp-5.png'),(2675,37,155,1,NULL,'Sétimo Sentido - Intermediário','O estágio Intermediário da Habilidade de Milo.','hab-2.png'),(2676,38,155,1,NULL,'Sétimo Sentido - Avançado','O estágio Avançado da Habilidade de Milo.','hab-3.png'),(2677,39,155,1,NULL,'Sétimo Sentido - Profissional','O estágio Profissional da Habilidade de Milo.','hab-4.png'),(2678,40,155,1,NULL,'Sétimo Sentido - Mestre','O estágio Mestre da Habilidade de Milo.','hab-5.png'),(2679,2,156,1,2,'Ataque Relâmpago','Aioros envolve seu punho com seu cosmo e da um poderoso ataque focalizado.','1.png'),(2680,5,156,1,2,'Rasante de Sagitário','Aioros voa com as asas de sua armadura e avança no inimigo.','2.png'),(2681,10,156,1,2,'Tempestade de Raios','Aioros desfere vários ataques em uma velocidade surpreendente, parecendo vários raios.','3.png'),(2682,12,156,1,1,'Trovão Atômico','Aioros concentra uma grande energia em uma das mãos e a dispara contra o adversário na forma de uma rajada reluzente, semelhante a um trovão, formada de centenas de rajadas que golpeiam o inimigo várias vezes.','4.png'),(2683,17,156,1,2,'Fúria Dourada','Aioros avança sobre seu oponente desferindo uma incalculável quantidade de golpes massacrando o seu corpo.','5.png'),(2684,19,156,1,5,'Flecha de Sagitário','Aioros concentra seu Cosmo em seu arco e lança uma de suas flechas de luz, que transpassam as armaduras dos inimigos, levando-os à morte.','6.png'),(2685,24,156,1,5,'Lança de Luz','Aioros concentra seu cosmo em sua Flecha criando uma enorme aura ao redor dela, que toma o formato de uma lança com um devastador poder.','7.png'),(2686,26,156,1,3,'Impulso da Luz de Quíron','Aioros queima seu cosmo e cria um gigantesco turbilhão de vento dourado que se transforma em uma verdadeira tempestade de ventos.','8.png'),(2687,31,156,1,5,'Flecha Sagrada','Aioros concentra seu cosmo e os daqueles que estão ao seu redor, lançando-a e liberando uma devastadora quantidade de energia em formato de uma flecha gigante, através de seu arco.','9.png'),(2688,35,156,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2699,2,157,1,4,'Excalibur','Shura adquire o poder de corte de uma espada em seu braço, podendo atacar o inimigo de perto ou lançar um corte de energia de longe.','1.png'),(2700,5,157,1,3,'Corte Divino','Shura faz um rápido e preciso corte luminoso em larga escala.','2.png'),(2701,10,157,1,4,'Empalamento de Caprinórnio','Usando a Excalibur, Shura avança sobre seu oponente e perfura seu corpo.','3.png'),(2702,12,157,1,4,'Dança das Lâminas','Shura realiza inúmeros cortes com sua Exacalibur a felocidade da luz cortando tudo em sua volta.','4.png'),(2703,17,157,1,4,'Lâminas Gêmeas de Capricórnio','Shura executa um massivo corte em cruz que destrói tudo o que toca.','5.png'),(2704,19,157,1,2,'Pedras Saltitantes','Shura contra-ataca o inimigo, desviando de seu golpe e saltando sobre seus ombros, arremessando o inimigo para cima e fazendo-o cair de cabeça no chão.','6.png'),(2705,24,157,1,4,'Decapitação de Capricórnio','Em um movimento extremamente rápido e preciso, Shura decapita seu inimigo brutalmente.','7.png'),(2706,26,157,1,4,'Excalibur Máxima','O poder máximo de Shura, no qual seus braços e pernas adquirem o mesmo poder de corte que a lendária espada Excalibur, cortando tudo que for tocado, sendo utilizado em batalhas corporais ou o propagando em forma de feixes luminosos.','8.png'),(2707,31,157,1,4,'Divisor de Mundos','Shura concentra a força da Excalibur Máxima em apenas um único braço, e executa um corte tão poderoso capaz de cortar um oceano.','9.png'),(2708,35,157,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2719,2,158,1,1,'Círculo de Gelo','Camus forma uma barreira de gelo na forma de um círculo, prendendo o inimigo.','1.png'),(2720,5,158,1,1,'Pó de Diamante','Camus congela o ar ao seu redor criando cristais de gelo. Em seguida, ele dispara com seu punho uma rajada de cristais de gelo que ataca o inimigo de frente, congelando-o.','2.png'),(2721,10,158,1,2,'Turbilhão de Gelo','Camus executa um gancho, que joga o oponente para os ares, enquanto cristais de gelo formam um turbilhão que engolem o inimigo, congelando seu corpo por inteiro e o destroçando.','3.png'),(2722,12,158,1,1,'Esquife de Gelo','Camus eleva sua mão para o alto, disparando diversos feixes gélidos que investem contra o adversário, congelando-o e aprisionando-o em um esquife de gelo.','4.png'),(2723,17,158,1,1,'Tempestade de Diamante','Camus concentra o ar frio do pó de diamantes em uma rajada condensada, aumentando sua efetividade e usa diversos cristais de gelo para refletir a rajada por todo o campo de batalha acertando o adversário mais de uma vez ou acertando múltiplos adversários.','5.png'),(2724,19,158,1,1,'Avalanche','Camus cria uma quantidade enorme de gelo e a joga em seu inimigo destruindo e esmagando tudo que toca pela frente.','6.png'),(2725,24,158,1,1,'Aurora Boreal','Raio concentrado e preciso de Camus que congela tudo o que toca, é extremamente rápido e poderoso.','7.png'),(2726,26,158,1,1,'Trovão Aurora Ataque','É um ataque de grande impacto, na qual Camus dispara com as duas mãos juntas e fechadas uma veloz onda de inúmeros cristais de gelo concentrados, o impacto é tão forte que o adversário e mandado pelos ares.','8.png'),(2727,31,158,1,1,'Execução Aurora','Camus posiciona os braços em forma da ânfora de Aquário e ao abaixar suas mãos, dispara uma poderosa rajada de ar frio, em -273,15 °C (Zero Absoluto), que é a temperatura mais baixa que se pode atingir nesse universo.','9.png'),(2728,35,158,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2739,2,159,1,3,'Perfume das Flores','Afrodite exala perfume de suas rosas para paralisar o corpo do oponente, e então dispara uma rajada de cosmo.','1.png'),(2740,5,159,1,3,'Campo de Flores','Afrodite cria um enorme campo de flores drenando a energia de todos ao seu redor.','2.png'),(2741,10,159,1,4,'Chicote de Espinhos','Afrodite ataca seu inimigo usando um chicote feito de espinhos, dilacerando o corpo de seu oponente.','3.png'),(2742,12,159,1,5,'Rosas Diabólicas Reais','Afrodite usa rosas que soltam veneno do pólen e dos espinhos, fazendo que o oponente caia em um sono profundo, porém ele não sente dor e vai morrendo lentamente enquanto perde seus cinco sentidos.','4.png'),(2743,17,159,1,3,'Rosas Guardiãs','Afrodite consegue utilizar as rosas negras como um escudo para bloquear ataques inimigos e contra atacar logo em seguida.','5.png'),(2744,19,159,1,5,'Rosas Perfurantes','Afrodite diminui o tamanho de suas rosas fazendo que pareceram pequenos dardos, e dispara no inimigo, perfurando seu corpo.','6.png'),(2745,24,159,1,5,'Rosas Piranhas','Afrodite joga rosas negras que são capazes de devorar tudo que esteja em seu caminho, pois seus espinhos são afiados como dentes das piranhas, destruindo tudo ao menor contato.','7.png'),(2746,26,159,1,3,'Tempestade de Rosas','Afrodite ataca usando uma forte tempestade de inúmeras rosas cortando o corpo de seu oponente.','8.png'),(2747,31,159,1,5,'Rosa Sangrenta','Afrodite lança uma rosa diretamente no coração do oponente, que perfura seu corpo e absorve todo o sangue.','9.png'),(2748,35,159,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2759,2,160,1,3,'Rajada Cósmica','Shion concentra seu cosmo em uma das suas mãos e dispara uma rajada no seu oponente.','1.png'),(2760,5,160,1,3,'Telecinese','Shion usa a telecinese para entrar na mente dos inimigos e destruí-los mentalmente.','2.png'),(2761,10,160,1,3,'Muralha de Cristal','Shion usa seu Cosmo para criar uma barreira invisível e muito resistente, capaz de refletir qualquer técnica com a mesma intensidade e velocidade disparada contra ela.','3.png'),(2762,12,160,1,3,'Teletransporte','Shion pode se teleportar para qualquer lugar a qualquer hora, isso pertindo-o uma vantagem em batalha atacando seu oponente de vários lugares.','4.png'),(2763,17,160,1,3,'Turbilhão Estelar','Shion arremessa o inimigo para o alto e centenas de estrelas acertam o corpo de seu oponente.','5.png'),(2764,19,160,1,5,'Esfera Gravitacional','Shion concentra seu cosmo em ambas as mãos criando uma massiva esfera de energia arremessando-a em seu inimigo e esmagando seu corpo e destruindo seus cinco sentidos.','6.png'),(2765,24,160,1,3,'Vacúo Dimensional','Shion cria em uma certa área um vacúo desintregando por completo o corpo daquele atingido.','7.png'),(2766,26,160,1,3,'Marcha dos Espíritos','Shion usa os espíritos de de cavaleiros mortos da geração anterior e de almas de inimigos roubadas para formar um exército de fantasmas que avançam diante do inimigo, roubando sua alma aos poucos para se juntar à Marcha de Shion.','8.png'),(2767,31,160,1,3,'Revolução Estelar','Shion lança uma poderosa cosmo-energia ofensiva, na forma de centenas estrelas cadentes, na direção do inimigo. Se atingido, o adversário sofre um poderoso impacto de cada uma das estrelas disparadas contra ele.','9.png'),(2768,35,160,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(2779,2,126,1,1,'Kagerou','Zetsu é capaz de entrar na terra e em árvores e se mover em alta velocidade, contra-atacando o inimigo facilmente.','kagerou.png'),(2780,5,126,1,2,'Kanchi','Zetsu sente a energia vital do seu oponente e acerta no seu ponto mais fraco.','Kanchi.png'),(2781,10,126,1,3,'Chakra Kyuuin Jutsu','Zetsu drena a energia vital do seu oponente com apenas um toque.','Chakra-Kyuuin-Jutsu.png'),(2782,12,126,1,3,'Renraku Kagerou','Zetsu é capaz de se comunicar com a natureza através de seu chakra e controlar as árvores.','Renraku-Kagerou.png'),(2783,17,126,1,3,'Narikawari no Jutsu','Zetsu absorve a energia de qualquer um que tocar e se transforma completamente nessa pessoa, podendo copiar o próprio oponente e usar os mesmos golpes contra ele.','Narikawari-no-Jutsu.png'),(2784,19,126,1,1,'Kisei Bunshin','Zetsu cria diversos clones usando a energia natural e cerca o inimigo.','Kisei-Bunshin.png'),(2785,24,126,1,3,'Jiken Kiroku','Zetsu é capaz de memorizar todas as situações em que vive, criando uma vantagem em batalha contra seus oponentes.','Jiken-Kiroku.png'),(2786,26,126,1,1,'Mokuton Tsukene no Jutsu','Zetsu cria diversos galhos com seu corpo que entram no chão e prendem o oponente.','Mokuton-Tsukene-no-Jutsu.png'),(2787,31,126,1,3,'Hyoumei Mune','Zetsu toma posse do corpo do oponente e controla por vontade própria, podendo fazer até mesmo o oponente se matar.','Hyoumei-Mune.png'),(2788,35,126,1,1,'Mokuton Chika Tsukene no Jutsu','Zetsu invoca uma gigantesca árvore ao seu redor que perfura todos os inimigos e faz com que mais árvores cresçam dentro de cada um, criando um mar de sangue.','Mokuton-Chika-Tsukene-no-Jutsu.png'),(2799,2,127,1,1,'Kagerou','Zetsu é capaz de entrar na terra e em árvores e se mover em alta velocidade, contra-atacando o inimigo facilmente.','kagerou.png'),(2800,5,127,1,2,'Kanchi','Zetsu sente a energia vital do seu oponente e acerta no seu ponto mais fraco.','Kanchi.png'),(2801,10,127,1,3,'Chakra Kyuuin Jutsu','Zetsu drena a energia vital do seu oponente com apenas um toque.','Chakra-Kyuuin-Jutsu.png'),(2802,12,127,1,3,'Renraku 