ade.','Suiton-Bakusui-Shouha.png'),(2824,19,128,1,1,'Suiton Suikoudan no Jutsu','Kisame cria um tubarão de água ao redor de seu corpo que devora o oponente e o leva para o fundo do mar.','Suiton-Suikoudan-no-Jutsu.png'),(2825,24,128,1,1,'Suiton Dai Bakusui Shouha','Kisame cospe muito mais água da sua boca do que no Bakusui Shouha, criando uma tsunami controlada por sua própria vontade.','Suiton-Dai-Bakusui-Shouha.png'),(2826,26,128,1,5,'Suiton Amesuikouha','Kisame cria uma chuva intensa, no qual as gotas se transformam em pequenos tubarões que cortam facilmente a carne dos seus oponentes.','Suiton-Amesuikouha.png'),(2827,31,128,1,1,'Suiton Senshokukou','Kisame cria uma tsunami feita inteiramente de tubarões, que devoram tudo por onde passam.','Suiton-Senshokukou.png'),(2828,35,128,1,1,'Suiton Daikoudan no Jutsu','Kisame junta suas mãos e cria um enorme tubarão de água capaz de absorver o chakra por onde passa, aumentando seu tamanho quanto mais chakra, e explodindo ao acertar o alvo.','Suiton-Daikoudan-no-Jutsu.png'),(2839,2,129,1,1,'Mizu Bunshin no Jutsu','Kisame usa a água para criar clones e cercar o inimigo.','Mizu-Bunshin-no-Jutsu.png'),(2840,5,129,1,4,'Doton Dochuu Senkou','Kisame entra na terra e deixa um pedaço da sua espada para fora, similar à uma barbatana de um tubarão, e rasgando por onde passa.','Doton-Dochuu-Senkou.png'),(2841,10,129,1,1,'Suirou no Jutsu','Kisame cria uma bola de água corrente ao redor do inimigo para aprisioná-lo e sufocá-lo.','Suirou-no-Jutsu.png'),(2842,12,129,1,1,'Suiton Goshokuzame','Kisame cria diversos tubarões feitos de água que são tão letais quanto um de verdade.','Suiton-Goshokuzame.png'),(2843,17,129,1,1,'Suiton Bakusui Shouha','Kisame cospe uma quantidade enorme de água de sua boca, criando uma onda controlada por sua própria vontade.','Suiton-Bakusui-Shouha.png'),(2844,19,129,1,1,'Suiton Suikoudan no Jutsu','Kisame cria um tubarão de água ao redor de seu corpo que devora o oponente e o leva para o fundo do mar.','Suiton-