sta para expandir seus poderes físicos e mágicos, atacando o inimigo sem parar.','Kai.png'),(3117,31,174,1,3,'Souzou Saisei','Tsunade ativa o selo Byakugou de sua testa para aplificar seus poderes e curar ferimentos, sendo capaz de persistir mais em batalhas.','Saisei.png'),(3118,35,174,1,3,'Byakugou no Jutsu','Tsunade libera por completo o selo de sua testa e ganha regeneração instantânea de células, permitindo-a ir para a linha de frente sem hesitar.','Byakugou.png'),(3119,2,175,1,4,'Charge','Zaraki investe contra o inimigo para desferir um forte golpe com zua Zanpakuto.','charge.png'),(3120,5,175,1,4,'Slashing Cross','Um golpe rápido com a espada após um bloqueio.','slashing-cross.png'),(3121,10,175,1,4,'Multiple Strike','Atinge diversas vezes o oponente, com golpes de diversas direções.','multiple-strike.png'),(3122,12,175,1,2,'Reversal','Segura o oponente após alguma brecha e desfere um golpe oportuno.','reversal.png'),(3123,17,175,1,4,'Shredding','Um golpe aparentemente simples, porém rápido que causa severos danos ao atingir o inimigo, abrindo cortes profundos.','shredding.png'),(3124,19,175,1,4,'Piercing Blow','Um golpe usado como uma estocada, toda a energia do movimento de Zaraki vai para a ponta da espada perfurando praticamente tudo no caminho.','puncture.png'),(3125,24,175,1,4,'Bloody Slash','Despretencioso, Zaraki corta profundamente seu oponente de cima a baixo, para lhe mostrar que se quisesse, poderia ter partido-o ao meio.','bloody-slash.png'),(3126,26,175,1,3,'Shockwave','A intensa reiatsu de Zaraki ao ser liberada de forma abrupta, explode e uma onda é gerada se alastrando e causando dano a muitos metros de distância dele.','shockwave.png'),(3127,31,175,1,4,'Overwhelming','Um golpe com força esmagadora, que mesmo ao ser bloqueado, o inimigo vai sentir o poder.','overwhelming.png'),(3128,35,175,1,4,'Ryodan','Uma das técnicas de Kendo, ao segurar a espada com as 2 mãos e desferir um golpe preciso, limpo, rápido e brutal.','ryodan.png'),(3129,2,176,