om o chakra amaldiçoado, amplificando seu poder.','Goukakyuu.png'),(3165,24,171,1,2,'Sen\'eijashu','Sasuke, transformado com o Selo Amaldiçoado nível 2, cria diversas cobras que saem de suas mangas e estrangulam o inimigo.','Sen.png'),(3166,26,171,1,1,'Chidori Eisou','Sasuke cria uma lâmina de raio que se estica e perfura o inimigo, eletrocutando-o.','Eisou.png'),(3167,31,171,1,1,'Katon Gouryuuka no Jutsu','Sasuke solta diversas bolas de fogo gigantes no formato de cabeças de dragões, que servem para aquecer a atmosfera.','katon-gouryuuka-no-jutsu.png'),(3168,35,171,1,1,'Kirin','Após utilizar o Katon Gouryuuka no Jutsu, Sasuke usa todo o poder do Selo Amaldiçoado e estende sua mão para o céu, criando um dragão de relâmpago, arremessando-o no inimigo e criando uma enorme explosão.','kirin.png'),(3169,2,172,1,3,'Bakedanuki no Koromo','Gaara cobre seu corpo com areia e chakra para ganhar a aparência da besta de uma cauda, aumentando muito seu ataque e sua defesa.','Bakedanuki.png'),(3170,5,172,1,5,'Suna Shuriken','Gaara, com o corpo do Ichibi, balança seus braços para disparar diversas shurikens de areia.','Suna.png'),(3171,10,172,1,1,'Fuuton Daitoppa','Lança uma destrutiva rajada de vento capaz de arrancar facilmente as árvores do chão.','Daitoppa.png'),(3172,12,172,1,3,'Sabaku Taisou','Gaara cobre o chão de areia e enterra todos que estiverem em cima dela.','Taisou.png'),(3173,17,172,1,3,'Suna no Kaiwan','Gaara usa o chakra do Ichibi para criar gigantescas mãos de areia que perseguem o oponente até esmagá-lo.','Kaiwan.png'),(3174,19,172,1,1,'Fuuton Mugen Sajin Daitoppa','Gaara usa o chakra do Ichibi para assoprar com muita força, impedindo que o inimigo se aproxime e lute para se manter no lugar.','Sajin.png'),(3175,24,172,1,4,'Saikou Zettai Bougyo : Shukaku no Tate','Cria um escudo gigante com o poder do bijuu de uma cauda.','shukaku-no-tate.png'),(3176,26,172,1,4,'Saikou Zettai Kougeki : Shukaku no Hoko','Cria uma poderosa lança de areia com o poder do bijuu de uma