nken','Ichigo libera seu poder através de sua espada, desferindo golpes rápidos.','kyoranken.png'),(3464,19,198,1,4,'Arashiken','Usando o poder de sua Bankai, Ichigo desfere inúmeros golpes em uma velocidade surpreendente.','arashiken.png'),(3465,24,198,1,3,'Blut Vene','Habilidade Quincy de Ichigo, no qual consegue enrijecer seu sangue que está escorrendo pela pele, negando os efeitos de qualquer golpe.','blut-vene.png'),(3466,26,198,1,3,'Cero Rojo','Ichigo, na sua forma Hollow, dispara um poderoso raio de energia avermelhada.','cero-rojo.png'),(3467,31,198,1,3,'Kuroi Getsuga Tenshou','A forma mais potente do Getsuga Tenshou, pois usa a reiatsu real de Ichigo, sendo mais comprimida, com maior raio e mais veloz do que a anterior.','kuroi-getsuga-tenshou.png'),(3468,35,198,1,3,'Mugetsu','Ichigo se torna o próprio Getsuga. A reiatsu emitida por este ataque é negra e altamente comprimida, a area atingida pelo golpe se torna toda negra por alguns instantes e o dano causado é muito severo.','mugetsu.png'),(3469,2,199,1,4,'Shitonegaeshi','Urahara derruba o inimigo e o imobiliza e cria uma lâmina espiritual próximo de seu rosto.','Shito.png'),(3470,5,199,1,4,'Houzuri','Urahara executa um simples, mas preciso golpe com sua espada no rosto do inimigo.','Houruzi.png'),(3471,10,199,1,3,'Keikaigi','Urahara usa sua energia espiritual para conectar os mundos e jogar o inimigo dentro da fenda.','Keikaigi.png'),(3472,12,199,1,3,'Nake, Benihime','Urahara usa sua espada para criar um corte de energia avermelhada que fere e repele os inimigos.','Nake.png'),(3473,17,199,1,4,'Chikasumi no Tate','Urahara cria um escudo gigante e esmaga o inimigo no chão.','Tate.png'),(3474,19,199,1,3,'Kamisori, Benihime','Urahara cria uma onda de energia capaz de cortar materiais e substâncias, controlando-a livremente.','Kamisori.png'),(3475,24,199,1,5,'Kirisaki, Benihime','Urahara dispara centenas de balas de energia, que explodem ao acertar alguma superfície.','Kirisaki.png'),(3476,26,199,1,3,'Tsuppane