ximum Combination','Ryouhei desfere milhares de socos em alta velocidade, tornando impossível o inimigo desviar.','Maximum-Combination.png'),(3946,26,245,1,1,'Maximum Ingram Hataka','Ryouhei se multiplica e desfere vários socos utilizando a água fervente de algum lugar, causando um enorme dano no inimigo enquanto queima seu corpo.','Maximum-Ingram-Hataka.png'),(3947,31,245,1,3,'Maximum Sun Cannon','Ryouhei dispara um enorme canhão de energia usando o poder de suas Chamas.','Maximum-Sun-Cannon.png'),(3948,35,245,1,3,'Solarstorm Fang','Ryouhei invoca Kangaryuu e realiza um golpe combinado, causando uma gigantesca explosão que destrói tudo ao seu alcance.','Solarstorm-Fang.png'),(3949,2,246,1,1,'Cloud Flame','Kyouya usa suas Chamas para deixar seus ataques mais efetivos.','Cloud-Flame.png'),(3950,5,246,1,2,'Roll\'s Armor','Roll aumenta seus espinhos para atacar enquanto defende Kyouya.','Rolls-Armor.png'),(3951,10,246,1,4,'Cloud Handcuffs','Kyouya usa algemas para imobilizar o inimigo e o atacar livremente.','Alaudes-Handcuffs.png'),(3952,12,246,1,3,'Flame Radar','Kyouya expande suas Chamas para detectar qualquer coisa que tocar e atacar de surpresa.','Flame-Radar.png'),(3953,17,246,1,2,'Needle Sphere Form','Roll se transforma em uma esfera de espinhos e rola para cima do inimigo.','Needle-Sphere-Form.png'),(3954,19,246,1,4,'Cloud Tonfa','Kyouya invoca suas Chamas em suas tonfas para aumentar seu ataque e espancar o inimigo até a morte.','Cloud-Tonfa.png'),(3955,24,246,1,2,'Propagation','Kyouya usa as propriedades da sua Chama para propagar os espinhos de Roll e encher a sala de espinhos gigantes.','Propagation.png'),(3956,26,246,1,3,'Glowing Sphere','Kyouya e Roll combinam seus poderes para criar uma imensa esfera de luz que explode e atira espinhos para todos os lados.','Glowing-Sphere.png'),(3957,31,246,1,4,'Restraining Ability','Kyouya usa as algemas de Alaude para aprisionar o inimigo e diminuir o tamanho delas, quebrando o corpo do oponente em várias partes.','Re