amente e acerta o inimigo, arremessando-o muito longe.','Glowing-Spin.png'),(4103,17,261,1,1,'Thunder Rage','Yuuki encanta sua espada com um raio arroxado e acerta o alvo diversas vezes.','Thunder-Rage.png'),(4104,19,261,1,4,'Crossing Field','Yuuki acerta várias estocadas no inimigo, criando um corte em formato de X.','Crossing-Field.png'),(4105,24,261,1,2,'Dark Flash','Yuuki contra-ataca o inimigo num piscar de olhos, arremessando-o para trás com o impacto.','Dark-Flash.png'),(4106,26,261,1,1,'Imp Star','Yuuki encanta sua espada com trevas  e acerta o inimigo, criando uma explosão de sombras.','Imp-Star.png'),(4107,31,261,1,3,'Darkness Burst','Yuuki dispara um gigantesco raio arroxado que pode destruir construções gigantes facilmente.','Darkness-Burst.png'),(4108,35,261,1,4,'Mother\'s Rosario','Yuuki desfere 11 golpes seguidos em uma velocidade surpreendente, imobilizando seu alvo e o finalizando com uma enorme explosão.','Mothers-Rosario.png'),(4109,2,262,1,5,'Type 54 Black Star','Death Gun usa sua pistola Black Star para atirar o inimigo à médio alcance.','Type-54-Black-Star.png'),(4110,5,262,1,4,'Starship Metal Estoc','Death Gun tira uma estoc escondida dentro de seu rifle e perfura o inimigo.','Starship-Metal-Estoc.png'),(4111,10,262,1,5,'Mercy Shot','Death Gun usa a Black Star para imobilizar o inimigo atirando em suas pernas, pronto para ser finalizado.','Mercy-Shot.png'),(4112,12,262,1,4,'Wind Cutter','Death Gun usa sua estoc para atacar várias vezes seguidas em uma velocidade surpreendente, cortando o ar.','Wind-Cutter.png'),(4113,17,262,1,1,'Paralyze Bullet','Death Gun dispara um tiro paralisante com seu rifle, que acerta o inimigo e o eletrocuta.','Paralyze-Bullet.png'),(4114,19,262,1,4,'Illusion Step','Death Gun se move de uma forma que o inimgo não sabe exatamente onde ele vai atacar.','Illusion-Step.png'),(4115,24,262,1,3,'Cloak of Shadows','Death Gun usa sua capa de camuflagem para ficar invisível e pegar o inimigo de surpresa.','Cloak-of-Shadows.png'