arar em uma outra dimensão para sempre.','outra-dimensao.png'),(4127,31,263,1,3,'Explosão Galática','Queimando sua cosmo-energia intensamente, Saga lança no alvo uma poderosa onda de choque explosiva, que assume a forma de diversos planetas, que ao se chocarem, criam várias supernovas.','explosao-galatica.png'),(4128,35,263,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4129,2,264,1,2,'Acubens','O cosmo de Máscara da Morte é concentrado nas pernas da Armadura de Ouro de Câncer. Em seguida, ele aperta o inimigo entre as pernas com força suficiente para partí-lo em dois como se fosse uma pinça de um caranguejo.','1.png'),(4130,5,264,1,1,'Chamas Demoníacas','Máscara da Morte incinera as almas ao redor através do uso de fogo-fátuo, utilizando-as para alimentar as chamas que ferem diretamente a alma do adversário.','2.png'),(4131,10,264,1,3,'Ondas do Inferno','Máscara da Morte concentra sua cosmo-energia na ponta de seu dedo indicador, e dispara um aura branca, que envolve o inimigo e o arrasta para a entrada do mundo dos mortos, podendo separar a alma do inimigo de seu corpo e enviá-lo para a entrada da morte, ou também enviando seu corpo junto de sua alma.','3.png'),(4132,12,264,1,3,'Declínio Infernal','Máscara da Morte preenche o corpo de duas marionetes para dispararem um rajada de energia do Ondas do Inferno no oponente e arremessá-lo violentamente para cima.','4.png'),(4133,17,264,1,5,'Guia das Trevas','Concentrando sua energia cósmica do Ondas do Inferno na mão direita, Máscara da Morte cria uma esfera de energia de cosmo e a lança com toda a velocidade em direção ao adversário.','5.png'),(4134,19,264,1,3,'Buraco Negro','Máscara da Morte cria um buraco negro que aparece em baixo de seu oponente, sugando sua alma e a enviando para a entrada da morte, a Colina do Yomotsu Hirasaga.','6.png'),(4135,24,264,1,3,'Hecatombe dos Espíritos','Máscara da Morte usa as almas como pólvora, provocando uma grande explosão. A explosão depende da quantidade de almas envolvidas no local.','7.png'),(4136,26,264,1,3,'Limbo do Inferno','Máscara da Morte levanta os dois braços e os cruza, concentrando sua cosmo energia do Ondas do Inferno nas duas mãos, criando duas esferas de energia. Depois, ele as une num só ataque, que toma a forma de um tornado de cosmo que destrói a alma do oponente e o arremessa diretamente nas profundezas do Mundo dos Mortos.','8.png'),(4137,31,264,1,3,'Réquiem das Almas','Ataque devastador de Máscara da Morte onde ele libera todas as almas armazenadas por ele em um único movimento destruindo tudo em sua volta.','9.png'),(4138,35,264,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4139,2,265,1,4,'Excalibur','Shura adquire o poder de corte de uma espada em seu braço, podendo atacar o inimigo de perto ou lançar um corte de energia de longe.','1.png'),(4140,5,265,1,3,'Corte Divino','Shura faz um rápido e preciso corte luminoso em larga escala.','2.png'),(4141,10,265,1,4,'Empalamento de Caprinórnio','Usando a Excalibur, Shura avança sobre seu oponente e perfura seu corpo.','3.png'),(4142,12,265,1,4,'Dança das Lâminas','Shura realiza inúmeros cortes com sua Exacalibur a felocidade da luz cortando tudo em sua volta.','4.png'),(4143,17,265,1,4,'Lâminas Gêmeas de Capricórnio','Shura executa um massivo corte em cruz que destrói tudo o que toca.','5.png'),(4144,19,265,1,2,'Pedras Saltitantes','Shura contra-ataca o inimigo, desviando de seu golpe e saltando sobre seus ombros, arremessando o inimigo para cima e fazendo-o cair de cabeça no chão.','6.png'),(4145,24,265,1,4,'Decapitação de Capricórnio','Em um movimento extremamente rápido e preciso, Shura decapita seu inimigo brutalmente.','7.png'),(4146,26,265,1,4,'Excalibur Máxima','O poder máximo de Shura, no qual seus braços e pernas adquirem o mesmo poder de corte que a lendária espada Excalibur, cortando tudo que for tocado, sendo utilizado em batalhas corporais ou o propagando em forma de feixes luminosos.','8.png'),(4147,31,265,1,4,'Divisor de Mundos','Shura concentra a força da Excalibur Máxima em apenas um único braço, e executa um corte tão poderoso capaz de cortar um oceano.','9.png'),(4148,35,265,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4149,2,266,1,1,'Círculo de Gelo','Camus forma uma barreira de gelo na forma de um círculo, prendendo o inimigo.','1.png'),(4150,5,266,1,1,'Pó de Diamante','Camus congela o ar ao seu redor criando cristais de gelo. Em seguida, ele dispara com seu punho uma rajada de cristais de gelo que ataca o inimigo de frente, congelando-o.','2.png'),(4151,10,266,1,2,'Turbilhão de Gelo','Camus executa um gancho, que joga o oponente para os ares, enquanto cristais de gelo formam um turbilhão que engolem o inimigo, congelando seu corpo por inteiro e o destroçando.','3.png'),(4152,12,266,1,1,'Esquife de Gelo','Camus eleva sua mão para o alto, disparando diversos feixes gélidos que investem contra o adversário, congelando-o e aprisionando-o em um esquife de gelo.','4.png'),(4153,17,266,1,1,'Tempestade de Diamante','Camus concentra o ar frio do pó de diamantes em uma rajada condensada, aumentando sua efetividade e usa diversos cristais de gelo para refletir a rajada por todo o campo de batalha acertando o adversário mais de uma vez ou acertando múltiplos adversários.','5.png'),(4154,19,266,1,1,'Avalanche','Camus cria uma quantidade enorme de gelo e a joga em seu inimigo destruindo e esmagando tudo que toca pela frente.','6.png'),(4155,24,266,1,1,'Aurora Boreal','Raio concentrado e preciso de Camus que congela tudo o que toca, é extremamente rápido e poderoso.','7.png'),(4156,26,266,1,1,'Trovão Aurora Ataque','É um ataque de grande impacto, na qual Camus dispara com as duas mãos juntas e fechadas uma veloz onda de inúmeros cristais de gelo concentrados, o impacto é tão forte que o adversário e mandado pelos ares.','8.png'),(4157,31,266,1,1,'Execução Aurora','Camus posiciona os braços em forma da ânfora de Aquário e ao abaixar suas mãos, dispara uma poderosa rajada de ar frio, em -273,15 °C (Zero Absoluto), que é a temperatura mais baixa que se pode atingir nesse universo.','9.png'),(4158,35,266,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4159,2,267,1,3,'Perfume das Flores','Afrodite exala perfume de suas rosas para paralisar o corpo do oponente, e então dispara uma rajada de cosmo.','1.png'),(4160,5,267,1,3,'Campo de Flores','Afrodite cria um enorme campo de flores drenando a energia de todos ao seu redor.','2.png'),(4161,10,267,1,4,'Chicote de Espinhos','Afrodite ataca seu inimigo usando um chicote feito de espinhos, dilacerando o corpo de seu oponente.','3.png'),(4162,12,267,1,5,'Rosas Diabólicas Reais','Afrodite usa rosas que soltam veneno do pólen e dos espinhos, fazendo que o oponente caia em um sono profundo, porém ele não sente dor e vai morrendo lentamente enquanto perde seus cinco sentidos.','4.png'),(4163,17,267,1,3,'Rosas Guardiãs','Afrodite consegue utilizar as rosas negras como um escudo para bloquear ataques inimigos e contra atacar logo em seguida.','5.png'),(4164,19,267,1,5,'Rosas Perfurantes','Afrodite diminui o tamanho de suas rosas fazendo que pareceram pequenos dardos, e dispara no inimigo, perfurando seu corpo.','6.png'),(4165,24,267,1,5,'Rosas Piranhas','Afrodite joga rosas negras que são capazes de devorar tudo que esteja em seu caminho, pois seus espinhos são afiados como dentes das piranhas, destruindo tudo ao menor contato.','7.png'),(4166,26,267,1,3,'Tempestade de Rosas','Afrodite ataca usando uma forte tempestade de inúmeras rosas cortando o corpo de seu oponente.','8.png'),(4167,31,267,1,5,'Rosa Sangrenta','Afrodite lança uma rosa diretamente no coração do oponente, que perfura seu corpo e absorve todo o sangue.','9.png'),(4168,35,267,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4169,2,268,1,3,'Rajada Cósmica','Shion concentra seu cosmo em uma das suas mãos e dispara uma rajada no seu oponente.','1.png'),(4170,5,268,1,3,'Telecinese','Shion usa a telecinese para entrar na mente dos inimigos e destruí-los mentalmente.','2.png'),(4171,10,268,1,3,'Muralha de Cristal','Shion usa seu Cosmo para criar uma barreira invisível e muito resistente, capaz de refletir qualquer técnica com a mesma intensidade e velocidade disparada contra ela.','3.png'),(4172,12,268,1,3,'Teletransporte','Shion pode se teleportar para qualquer lugar a qualquer hora, isso pertindo-o uma vantagem em batalha atacando seu oponente de vários lugares.','4.png'),(4173,17,268,1,3,'Turbilhão Estelar','Shion arremessa o inimigo para o alto e centenas de estrelas acertam o corpo de seu oponente.','5.png'),(4174,19,268,1,5,'Esfera Gravitacional','Shion concentra seu cosmo em ambas as mãos criando uma massiva esfera de energia arremessando-a em seu inimigo e esmagando seu corpo e destruindo seus cinco sentidos.','6.png'),(4175,24,268,1,3,'Vacúo Dimensional','Shion cria em uma certa área um vacúo desintregando por completo o corpo daquele atingido.','7.png'),(4176,26,268,1,3,'Marcha dos Espíritos','Shion usa os espíritos de de cavaleiros mortos da geração anterior e de almas de inimigos roubadas para formar um exército de fantasmas que avançam diante do inimigo, roubando sua alma aos poucos para se juntar à Marcha de Shion.','8.png'),(4177,31,268,1,3,'Revolução Estelar','Shion lança uma poderosa cosmo-energia ofensiva, na forma de centenas estrelas cadentes, na direção do inimigo. Se atingido, o adversário sofre um poderoso impacto de cada uma das estrelas disparadas contra ele.','9.png'),(4178,35,268,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4179,2,269,1,4,'Escudo de Libra','Dohko utiliza ambos escudos de sua armadura para bloquear qualquer golpe e contra-atacar o inimigo rapidamente.','1.png'),(4180,5,269,1,2,'Dragão Nascente','Dohko concenta seu cosmo em uma das mãos e libera a energia acumulada de uma só vez dando um poderoso soco frontal em seu inimigo.','2.png'),(4181,10,269,1,2,'Fúria do Dragão','Dohko começar a golpear seu oponente incansávelmente na velocidade da luz incontáveis vezes por segundo.','3.png'),(4182,12,269,1,2,'Coléra do Dragão','Basicamente um soco direto, emanado com cosmo parecido com uma rajada de um dragão que, se acertar, leva o oponente pelos ares, enquanto o poder do golpe varia pelo cosmo que Dohko mostra no momento de sua execução.','4.png'),(4183,17,269,1,3,'Dragão Dourado','Um poderoso raio concetrado de Dohko na forma de um Dragão Dourado que destroi tudo o que toca pela frente.','5.png'),(4184,19,269,1,4,'Armas de Libra','Dohko utiliza as armas da Armadura de Libra para atacar o oponente.','6.png'),(4185,24,269,1,2,'Último Dragão','Golpe suicida de Dohko, onde ele sobe aos céus com o inimigo sem parar até que os corpos de ambos virem pó.','7.png'),(4186,26,269,1,3,'Supremo Dragão de Rouzan','Soco supremo de Dohko que de tão forte foi capaz de mudar o curso de uma cachoeira, fazendo-a correr ao contrário.','8.png'),(4187,31,269,1,3,'Cólera dos Cem Dragões','A técnica suprema de Dohko, praticamente idêntica ao de Shiryu, mas a um nível superior. Ao queimar o seu Cosmo máximo, Dohko com os braços estendidos libera toda a sua energia liberando uma onda de choque devastadora que avança, destruindo tudo em seu caminho.','9.png'),(4188,35,269,1,3,'Exclamação de Atena','Golpe proibido dos Cavaleiros de Ouro, no qual cria uma explosão com a força de um Big Bang em um único alvo. Se não redirecionar para um alvo, é capaz de explodir o universo como o próprio Big Bang.','10.png'),(4189,2,270,1,2,'Martial Arts Attack','Eren utiliza técnicas de combate físico para imobilizar o alvo.','Martial-Attack.png'),(4190,5,270,1,2,'Running Tiger','Eren sai correndo em uma velocidade surpreendente em direção ao inimigo e o acerta diretamente no estômago.','Running-Tiger.png'),(4191,10,270,1,4,'Drill Spin','Eren gira muito rápido e perfura o alvo usando suas espadas.','Drill-Spin.png'),(4192,12,270,1,4,'Flying Falcon','Eren usa o 3DMG para se impulsionar para cima e acertar o inimigo, arremessando-o longe.','Flying-Falcon.png'),(4193,17,270,1,4,'Spinning Slash','Eren solta o gás do 3DMG para girar seu corpo e cortar o inimigo várias vezes.','Spinning-Slash.png'),(4194,19,270,1,3,'Full Moon Strike','Eren gira, criando o formato de uma lua cheia com o balançar das suas espadas, e em seguida corta o alvo.','Full-Moon-Strike.png'),(4195,24,270,1,1,'Spark Slide','Eren usa o 3DMG para deslizar pelo chão e criar faíscas que podem incendiar o campo de batalha.','Spark-Slide.png'),(4196,26,270,1,2,'Glory Dash','Eren sai correndo e atacando todos em seu caminho.','Glory-Dash.png'),(4197,31,270,1,4,'Total Gas Release','Eren prende o gancho no inimigo e libera todo o gás para pegar o máximo de impulso possível, para em seguida se puxar para o inimigo e o cortar no meio.','Total-Gas-Release.png'),(4198,35,270,1,4,'Titan Carnage','Eren se deixa levar pelos seus sentimentos de vingança e realiza uma carnificina, cortando tudo e todos que entrarem em seu caminho.','Titan-Carnage.png'),(4199,2,271,1,2,'Fury Kick','Eren sai correndo e desfere um poderoso chute no inimigo, arremessando-o à uma distância inimaginável.','Fury-Kick.png'),(4200,5,271,1,2,'Arm Break','Eren imobiliza o alvo e quebra seu braço.','Arm-Break.png'),(4201,10,271,1,2,'Atomic Punch','Movendo-se muito rápido, Eren desfere um soco capaz de destruir construções enormes.','Atomic-Punch.png'),(4202,12,271,1,1,'Ground Shake','Eren pisoteia o chão muito forte, criando um tremor.','Ground-Shake.png'),(4203,17,271,1,5,'Titan Throw','Eren arremessa um titã em seu inimigo.','Titan-Throw.png'),(4204,19,271,1,2,'Titanic Smash Jab','Eren desfere um soco frontal muito forte no inimigo, capaz de explodir sua cabeça.','Titanic-Smash-Jab.png'),(4205,24,271,1,3,'Hell Scream','Eren solta um grito capaz de ensurdecer pessoas e atrair titãs para ele.','Hell-Scream.png'),(4206,26,271,1,2,'Titanic Crunch','Eren morde o pescoço do inimigo e o ergue, esmagando-o no chão em seguida.','Titanic-Crunch.png'),(4207,31,271,1,2,'Headless Horizontal Punch','Eren assume a pose de artes marciais e desfere um soco tão poderoso que a cabeça do inimigo é arrancada do corpo.','Headless-Horizontal-Punch.png'),(4208,35,271,1,4,'Meteor Strike','Eren pega uma pedra de aproximadamente 20 metros e esmaga o inimigo com ela.','Meteor-Strike.png'),(4209,2,272,1,2,'Innocent Throw','Mikasa agarra o alvo e o arremessa na parede.','Innocent-Throw.png'),(4210,5,272,1,3,'Dual Light','Mikasa corta o ar, criando um rastro brilhante e acertando o inimigo.','Dual-Light.png'),(4211,10,272,1,4,'Double Dash','Mikasa corta o inimigo duas vezes em apenas um piscar de olhos.','Double-Dash.png'),(4212,12,272,1,4,'Slice and Dice','Mikasa fica voando ao redor do alvo e o cortando muito rápido.','Slice-and-Dice.png'),(4213,17,272,1,4,'Full Charge Fury','Mikasa usa todo seu gás para pegar velocidade máxima e cortar rapidamente seu inimigo.','Full-Charge-Fury.png'),(4214,19,272,1,4,'Blood Bath','Mikasa perfura o alvo com suas espadas, jorrando sangue para todo os lados.','Blood-Bath.png'),(4215,24,272,1,3,'Shining Slice','Mikasa junta as duas espadas e corta o alvo com um belo brilho.','Shining-Slice.png'),(4216,26,272,1,4,'Red Scarf Rage','Mikasa, enquanto está enfurecida, ataca o alvo sem parar, girando para cortar a carne mais facilmente.','Red-Scarf-Rage.png'),(4217,31,272,1,4,'Retaliate','Mikasa corta o mesmo alvo várias e várias vezes, o fazendo em pedaços.','Retaliate.png'),(4218,35,272,1,4,'Ballet of Swords','Mikasa se movimenta de uma maneira tão bela enquanto usa o 3DMG que parece estar dançando, porém cada mínimo movimento ela é capaz de cortar uma parte de um inimigo.','Ballet-of-Swords.png'),(4219,2,273,1,2,'Arm Grab','Armin agarra o braço do inimigo, imobilizando-o.','Arm-Grab.png'),(4220,5,273,1,4,'Precise Cut','Armin corta num ponto exato do inimigo, causando um ferimento profundo e doloroso.','Precise-Cut.png'),(4221,10,273,1,4,'Chop Slash','Armin faz um rápido movimento com suas espadas, cortando o inimigo.','Chop-Slash.png'),(4222,12,273,1,2,'Grabbing Hook','Armin usa seu 3DMG para agarrar o inimigo pelas costas e jogá-lo do alto.','Grabbing-Hook.png'),(4223,17,273,1,1,'Gas Boost','Armin libera muito gás do seu 3DMG, causando queimaduras no inimigo.','Gas-Boost.png'),(4224,19,273,1,4,'Force Stab','Armin enfia sua espada nas costas do inimigo e empurra com toda força para atravessá-lo.','Force-Stab.png'),(4225,24,273,1,5,'Green Flare','Armin dispara um sinalizador diretamente no inimigo, causando queimaduras.','Green-Flare.png'),(4226,26,273,1,4,'Swing Slash','Armin se balança com o 3DMG e vai cortando o inimigo por vários lados.','Swing-Slash.png'),(4227,31,273,1,4,'Jungle Trap','Armin se esconde nas árvores de uma floresta e pega o inimigo de surpresa.','Jungle-Trap.png'),(4228,35,273,1,4,'Bloody Stab','Armin, com fúria e convicção, perfura o alvo com sua espada em um ponto específico para fazê-lo sangrar muito até morrer.','Bloody-Stab.png'),(4229,2,274,1,2,'Low Kick','Annie desfere um chute forte na canela do oponente, fazendo-o cair no chão de dor.','Low-Kick.png'),(4230,5,274,1,4,'Spike Ring','Annie usa um anel com um espinho para cortar a pele do oponente.','Spike-Ring.png'),(4231,10,274,1,3,'Magic Blade','Annie salta e executa um corte preciso usando as duas espadas juntas.','Magic-Blade.png'),(4232,12,274,1,2,'Desarm','Annie ataca o inimigo e o desarma, deixando-o inofensivo.','Desarm.png'),(4233,17,274,1,1,'Shadow Boost','Annie, enquanto se esconde nas sombras, libera uma rajada de gás.','Shadow-Boost.png'),(4234,19,274,1,4,'Counter Blade','Annie contra-ataca a lâmina do inimigo, virando-a para ele.','Counter-Blade.png'),(4235,24,274,1,2,'Hi Jump Kick','Annie desfere um poderoso chute que joga o corpo inteiro do oponente para o ar.','Hi-Jump-Kick.png'),(4236,26,274,1,4,'Hidden Blades','Annie, aparentemente desarmada, retira rapidamente suas espadas e corta o inimigo inteiro em segundos.','Hidden-Blades.png'),(4237,31,274,1,3,'Cristalization','Annie cristaliza uma parte do seu corpo ou do inimigo que tocar.','Cristalization.png'),(4238,35,274,1,1,'Titan Golden Explosion','Annie libera todo seu poder e se transforma num titã, criando uma gigantesca explosão amarelada.','Titan-Golden-Explosion.png'),(4239,2,275,1,2,'Fabulous Kick','Levi desfere um chute surpresa no rosto do inimigo, arrancando até os dentes.','Fabulous-Kick.png'),(4240,5,275,1,4,'Hanging Cable','Levi prende o gancho em algum lugar e gira ao redor do inimigo, enforcando-o.','Hanging-Cable.png'),(4241,10,275,1,5,'Sonorous Flare','Levi dispara um sinalizador sonoro que ensurdece os inimigos.','Sonorous-Flare.png'),(4242,12,275,1,4,'Flesh Crusher','Levi se move em uma velocidade surpreendente entre os inimigos e os corta várias vezes.','Flesh-Crusher.png'),(4243,17,275,1,2,'Face Smash','Levi desfere uma poderosa joelhada no rosto do inimigo.','Face-Smash.png'),(4244,19,275,1,4,'Twister Chop','Levi gira horizontalmente muito rápido, cortando o inimigo várias vezes.','Twistter-Chop.png'),(4245,24,275,1,5,'Blades Pitch','Levi arremessa as lâminas de suas espadas para perfurar o inimigo.','Blades-Pitch.png'),(4246,26,275,1,3,'X Blades','Levi saca suas espadas em formato de X e corta o inimigo.','X-Blades.png'),(4247,31,275,1,1,'Burning Eyes','Levi perfura os olhos do oponente e solta muita faísca de suas espadas, queimando o rosto do inimigo.','Burning-Eyes.png'),(4248,35,275,1,4,'Freedom Chainsaw','Levi segura as espadas de um jeito diferente e gira em uma velocidade surpreendente, virando uma serra e triturando o corpo do inimigo inteiro.','Freedom-Chainsaw.png'),(4249,2,276,1,2,'Avoiding Jump','Titã Fêmea salta para desviar de golpes inimigos e cai em cima deles, os esmagando.','Avoiding-Jump.png'),(4250,5,276,1,3,'Crystal Smash','Titã Fêmea cristaliza seu punho e desfere uma sequência de socos no inimigo.','Crystal-Smash.png'),(4251,10,276,1,5,'Spinning Throw','Titã Fêmea pega o inimigo preso à um cabo e o gira muito rápido para arremessá-lo.','Spinning-Throw.png'),(4252,12,276,1,3,'Crystal Claws','Titã Fêmea cristaliza a ponta de seus dedos, criando unhas afiadas indestrutíveis, que poder perfurar qualquer coisa.','Crystal-Claws.png'),(4253,17,276,1,2,'Human Crush','Titã Fêmea agarra o inimigo com uma de suas mãos e o esmaga, explodindo-o em sangue.','Human-Crush.png'),(4254,19,276,1,3,'Crystal Uppercut','Titã Fêmea cristaliza seu braço inteiro e desfere um gancho no queixo do inimigo, destruindo seu maxilar.','Crystal-Uppercut.png'),(4255,24,276,1,5,'Titan Call','Titã Fêmea grita com toda sua força, chamando centenas de titãs ao seu redor.','Titan-Call.png'),(4256,26,276,1,3,'Crystal Heavy Kick','Titã Fêmea cristaliza sua canela e desfere um poderoso chute na perna do inimigo, arrancando ela fora.','Crystal-Heavy-Kick.png'),(4257,31,276,1,2,'Head Cutter','Titã Fêmea fica em pose de luta de artes marcias, e em seguida desfere um soco giratório que é capaz de cortar a cabeça do oponente no meio (e tudo 