nenosas.png'),(4272,12,278,1,1,'Garras de Trovão','Shina ergue sua mão em uma postura similar ao bote de uma cobra e parte em direção ao oponente, desferindo golpes com suas garras afiadas e cargas elétricas de 10.000 volts. O ataque perfura o corpo do inimigo como picadas de cobra.','Garras-de-Trovao.png'),(4273,17,278,1,2,'Estrangulamento da Cobra','Com sua ferocidade e agilidade em batalha, Shina consegue desviar dos golpes dos inimigos e, com suas garras, estrangular o inimigo.','Estrangulamento-da-Cobra.png'),(4274,19,278,1,3,'Aura Venenosa','Shina cria uma aura ao seu redor com propriedades tóxicas, envenenando qualquer um que fique próximo.','Aura-Venenosa.png'),(4275,24,278,1,1,'Tempestade de Trovão do Ofíuco','Extremamente mais poderoso que as Garras de Trovão, Shina combina sua destreza para atacar diversas vezes o inimigo com suas garras, contendo 100.000 volts em cada golpe.','Tempestade-de-Trovao-do-Ofiuco.png'),(4276,26,278,1,2,'Caçadora Mortífera','Elevando sua cosmo-energia ao máximo, Shina atinge quase a velocidade dos cavaleiros de ouro, e combina todos os seus ataques, retalhando o inimigo em pedaços.','Cacadora-Mortifera.png'),(4277,31,278,1,2,'Ataque Surpresa da Cobra','Shina aparece de surpresa atrás do inimigo e o perfura com suas garras.','Sentenca-Final.png'),(4278,35,278,1,3,'Aura da Morte do Ofíuco','Shina cria uma aura de cosmo com sede da morte, capaz de causar pânico e até a morte para aqueles que ficarem muito próximos.','Aura-da-Morte.png'),(4279,2,279,1,2,'Soco de Pégaso Negro','Pégaso Negro desfere um soco com a força e o cosmo de um Pégaso.','soco-de-pegaso.png'),(4280,5,279,1,2,'Chute de Pégaso Negro','Pégaso Negro desfere um chute com a força e o cosmo de um Pégaso.','chute-de-pegaso.png'),(4281,10,279,1,3,'Meteoro Negro','Pégaso Negro lança socos ou chutes capazes de atingir o inimigo cem vezes por segundo, parecendo meteoros, podendo até mesmo atingir o inimigo a longas distâncias.','meteoro-de-pegaso.png'),(4282,12,279,1,2,'Golpe Alado','Pégaso Negro saltar bem alto, Seiya desfere um chute na cabeça do adversário.','golpe-alado.png'),(4283,17,279,1,2,'Turbilhão de Pégaso','Pégaso Negro agarra o oponente, logo em seguida envolvendo os dois por uma poderosa energia, salta girando no ar projetando toda esta energia contra o inimigo lançando-o para o chão com uma violenta força.','turbilhao-de-pegaso.png'),(4284,19,279,1,3,'Barreira de Cosmo','Pégaso Negro libera seu cosmo por todo seu corpo, aumentando suas forças.','barreira-de-cosmo.png'),(4285,24,279,1,5,'Cometa de Pégaso Negro','Pégaso Negro concentra a força de cem meteoros em seu punho formando um imenso cometa e se lança contra o inimigo e em fração de segundos uma enorme pulsante e poderosa bola de cosmo que se parece muito com um cometa surge e acaba detonando o corpo do adversário.','cometa-de-pegaso.png'),(4286,26,279,1,5,'Canhão de Pégaso','Pégaso Negro dispara uma imensa esfera de energia no inimigo.','Canhao-Pegaso.png'),(4287,31,279,1,3,'Turbilhão Cósmico de Pégaso','Pégaso Negro lança uma rajada cósmica que prende o inimigo e o arremessa para o ar com extrema violência.','Turbilhao-Cosmico.png'),(4288,35,279,1,3,'Morte Negra','Pégaso Negro acerta o inimigo com diversos socos que deixam marcas negras em seu corpo que consomem o sangue do inimigo.','Tempestade-Meteoros.png'),(4289,2,281,1,2,'Soco do Dragão Negro','Um soco com a força e o cosmo de um Dragão.','soco-do-dragao.png'),(4290,5,281,1,2,'Chute do Dragão Negro','Um chute com a força e o cosmo de um Dragão.','chute-do-dragao.png'),(4291,10,281,1,2,'Cólera do Dragão Negro','Dragão Negro desfere um soco de baixo para cima, emanado com cosmo parecido com uma rajada de um dragão que, se acertar, leva o oponente pelos ares.','colera-do-dragao.png'),(4292,12,281,1,2,'Investida Dracônica','Dragão Negro corre para cima do inimigo e o acerta mortalmente no estômago.','investida-feroz.png'),(4293,17,281,1,2,'Dragão Voador','É uma variação do Cólera do Dragão Negro, no qual Dragão Negro desfere um soco para frente, ao invés de para cima.','dragao-voador.png'),(4294,19,281,1,2,'Dragão Crescente','Dragão Negro desfere uma poderosa joelha no inimigo, similar ao Cólera do Dragão, mas com as pernas.','dragao-crescente.png'),(4295,24,281,1,3,'Destruição Negra','Dragão Negro aponta para o inimigo e cria uma poderosa explosão.','poderosa-espada-excalibur.png'),(4296,26,281,1,2,'Último Dragão','Golpe suicida de Dragão Negro, no qual ele continuará a subir no ar e eventualmente no espaço, morrendo junto do inimigo.','ultimo-dragao.png'),(4297,31,281,1,4,'Fúria do Dragão Negro','Dragão Negro libera todo seu poder e desfere diversos cortes no inimigo, parecendo cortes de espadas.','Furia-Dragao.png'),(4298,35,281,1,3,'Cólera dos Cem Dragões','O Cosmo de Dragão Negro atinge o máximo e ele ataca o inimigo com os braços estendidos e mãos abertas, soltando inúmeras rajadas de Cosmo que se parecem com a fúria de cem dragões ao mesmo tempo.','colera-dos-cem-dragoes.png'),(4299,2,283,1,2,'Soco de Gelo Negro','Um soco congelante com a força e o cosmo de um Cisne.','soco-de-gelo.png'),(4300,5,283,1,1,'Aura de Gelo','Cisne Negro libera seu cosmo pelo seu corpo, criando uma aura fria ao se redor, congelando inimigos próximos.','aura-de-gelo.png'),(4301,10,283,1,1,'Círculo de Gelo','Cisne Negro forma uma barreira de gelo na forma de um círculo, prendendo o inimigo.','circulo-de-gelo.png'),(4302,12,283,1,1,'Nevasca das Trevas','Cisne Negro dispara com seu punho uma rajada de cristais de gelo que ataca o inimigo de frente, congelando-o e/ou paralisando-o.','po-de-diamante.png'),(4303,17,283,1,2,'Turbilhão de Gelo Negro','Cisne Negro executa um gancho, que joga o oponente para os ares, enquanto cristais de gelo formam um tubilhão que engolem o inimigo, congelando seu corpo por inteiro e o destroçando.','turbilhao-de-gelo.png'),(4304,19,283,1,1,'Trovão Aurora Ataque','Cisne Negro dispara com as duas mãos juntas e fechadas uma veloz onda de inúmeros cristais de gelo con