.png'),(4369,2,288,1,4,'Corrente de Andrômeda','As correntes de Shun, sob seu comando, avançam para cima de sua vítima de uma maneira veloz e objetiva, visando acertá-lo por algum ângulo. Possuem a finalidade de danificar o inimigo.','corrente-andromeda.png'),(4370,5,288,1,2,'Punição de Virgem','Shun golpeia o corpo do inimigo em vários pontos, parando a circulação de sangue.','defesa-circular.png'),(4371,10,288,1,4,'Rede de Andrômeda','Utilizando suas correntes, Shun transforma a corrente em forma de círculo em uma imensa rede, impedindo os movimentos do inimigo.','rede-andromeda.png'),(4372,12,288,1,4,'Espiral de Andrômeda','Shun utiliza suas correntes para prender e destruir alguma parte do corpo do inimigo.','espiral-andromeda.png'),(4373,17,288,1,4,'Bumerangue de Andrômeda','A corrente de Shun faz movimentos Circulares traçando uma rota no estilo de um bumerangue atingindo o inimigo por trás.','bumerangue-andromeda.png'),(4374,19,288,1,4,'Armadilha de Andrômeda','A corrente de Shun se espalha pelo chão formando uma grande armadilha, capturando o inimigo.','armadilha-andromeda.png'),(4375,24,288,1,1,'Corrente Nebulosa','Shun expele de seu corpo jatos de ar que vão diretamente até o oponente, paralisando o seu corpo e explodindo no menor movimento.','corrente-nebulosa.png'),(4376,26,288,1,5,'Disparos Divinos de Virgem','Shun lança diversos projéteis com o Cosmo da armadura de Virgem.','grande-captura-andromeda.png'),(4377,31,288,1,3,'Tesouro do Céu','O cosmo que Shun acumula mantendo seus olhos fechados (ou seja, privando-se de um de seus sentidos), explode quando ele os abre, criando um golpe perfeito que une ataque e defesa, pois não dá chances de o adversário contra-atacar.','onda-relampago.png'),(4378,35,288,1,1,'Tempestade Nebulosa','O golpe se faz através de potentes jatos de ar expelidos pelo corpo de Shun, que formam uma tempestade de ventos levando a vítima para o alto e fornecendo-lhe os piores danos de impacto.','tempestade-nebulosa.png'),(4379,2,289,1