 Samurai, focando toda sua magia em sua espada, Benisakura, tornando-a muito mais poderosa.','samurai-no-koromo-benisakura.png'),(4898,35,346,1,4,'Tenrin no Yoroi : Buruumenburatto','Erza equipa sua armadura Roda do Céu e invoca uma grande quantidade de espadas, cortando o inimigo com as duas que está segurando enquanto as outras invocadas voam em direção ao inimigo.','tenrin-no-yoroi-buruumenburatto.png'),(4899,2,345,1,4,'Taurus : Rampage','Lucy invoca o Espírito Celestial de Touro, que pula girando seu machado e acertando o chão, criando um terremoto em linha reta.','taurus-rampage.png'),(4900,5,345,1,1,'Aquarius : Giant Wave Attack','Lucy invoca o Espírito Celestial de Aquário, que absorve a água em sua urna e a dispara com uma tremenda força.','aquarius-giant-wave-attack.png'),(4901,10,345,1,3,'Virgo : Diver','Lucy invoca o Espírito Celestial de Virgem, que consegue mergulhar na terra e criar diversos buracos.','virgo-diver.png'),(4902,12,345,1,1,'Aquarius : Tidal Wave','Lucy invoca o Espírito Celestial de Aquário, que cria um maremoto com a água de sua urna.','aquarius-tidal-wave.png'),(4903,17,345,1,4,'Cancer : Scissor Max Speed Cut','Lucy invoca o Espírito Celestial de Câncer, que avança rapidamente em direção ao inimigo, utilizando suas tesouras para cortá-lo.','cancer-scissor-max-speed-cut.png'),(4904,19,345,1,3,'Leo : Regulus Blast','Lucy invoca o Espírito Celestial de Leão, que cria um círculo mágico na sua frente e dispara uma enorme rajada de luz.','leo-regulus-blast.png'),(4905,24,345,1,5,'Sagittarius : Triple Arrow Shot','Lucy invoca o Espírito Celestial de Sagitário, que utiliza seu arco para disparar três flechas ao mesmo tempo.','sagittarius-triple-arrow-shot.png'),(4906,26,345,1,3,'Leo : Lion Brilliance','Lucy invoca o Espírito Celestial de Leão, que cria um enorme clarão, cegando seus inimigos e causando dano.','leo-lion-brilliance.png'),(4907,31,345,1,1,'Virgo : Spica Lock','Lucy invoca o Espírito Celestial de Virgem, que prende o inimigo no meio de várias pedras.','virgo-spica-lock.png'),(4908,35,345,1,5,'Leo : Regulus Impact','Lucy invoca o Espírito Celestial de Leão, que dispara um rajada de luz no formato de uma cabeça de leão, arremessando o alvo à grandes distâncias.','leo-regulus-impact.png'),(4909,2,339,1,2,'Ura Omote Lovers','Me desperta de meu sono o cérebro, no meio da sala cheia de coisas boas. Depos que fui invadida por algo estranho chamado AMOR.','Ura-Omote-Lovers.png'),(4910,5,339,1,1,'Electric Angel','Sendo capaz de ficar com você...Só isso faz o coração tremer de eletricidade. Como um grande vento, meu coração bate.','Electric-Angel.png'),(4911,10,339,1,4,'Po Pi Po','Eu decidi que você deve beber agora! Então beba, o meu suco de vegetais! Custa apenas 2 yen!','Po-Pi-Po.png'),(4912,12,339,1,3,'The Disappearance','Eu existo para imitar humanos. Vocaloid fadado a cantar para sempre, mesmo se uma música já exista....','The-Disappearance.png'),(4913,17,339,1,5,'Love Words','Eu escondi dentro junto com os meus sentimentos. e tentei colocar em em uma canção. Minhas palavras de amor são: amor = dez vezes obrigado.','Love-Words.png'),(4914,19,339,1,4,'Romeo and Cinderella','Uma doce bala de ilusões, minha perna denuncia como estou nervosa. Até onde vamos chegar essa noite?','Romeo-and-Cinderella.png'),(4915,24,339,1,2,'Rolling Girl','A Garota Apaixonada está acabada em ruínas, fora do alcance de cores inacessíveis. Há vozes dentro de sua cabeça, e elas vão misturando, misturando...','Rollin-Girl.png'),(4916,26,339,1,1,'Melt','Derreta! Eu não consigo respirar. Minha mão, tocando a sua, está tremendo. Meu coração está disparado por baixo do guarda-chuva.','Melt.png'),(4917,31,339,1,5,'Tell Your World','Você é como uma luz pura e branca. Sua voz escorreu entre minhas mãos, o alcance dos meus dedos mudou de repente.','Tell-Your-World.png'),(4918,35,339,1,3,'World is Mine','Mas é claro, afinal eu sou...A princesa numero um do mundo. Certifique-se de me olhar ou eu vou pra algum lugar ein?','The-World-is-Mine.png'),(4919,2,340,1,2,'Finder','No início, nossos espíritos desastrados transformaram o momento em sons e palavras.','Finder.png'),(4920,5,340,1,1,'Torikororu ea Rain','Eu sabia disso no fundo do meu coração. A escolha mais difícil deveria ser a melhor.','Torikororu-ea-Rain.png'),(4921,10,340,1,3,'Out of the Gravity','Algum dia, eu vou quebrar a cadeia de gravidade, e o satélite vai voar em torno do espaço.','Out-of-the-Gravity.png'),(4922,12,340,1,5,'Mousou Suketchi','Kobore ochita sora no namida itsuwari no ame ga. Tsumetai hoho wo tsutawaru kare hateta kokoro umi ni, ichirin no hana ga saita.','Mousou-Suketchi.png'),(4923,17,340,1,4,'Haro Hawayu','\"Ah, tudo bem\" já se tornou minha frase preferida. As palavras de ontem passam por minha cabeça.','Haro-Hawayu.png'),(4924,19,340,1,5,'Koneko no Paya Paya','Koneko no payapaya wa, chiisana neko de. Kotoshi no hachi gatsu ni umareta bakari, ouchi no naka wa choito.','Koneko-no-Paya-Paya.png'),(4925,24,340,1,3,'Yume Yume','Amanhã, eu prometo que irei começar a sonhar outro sonho. Eu vou sonhar um diferente sonho, onde sem você todos os céus se tornaram cinza.','Yume-Yume.png'),(4926,26,340,1,1,'Watashi no Jikan','Ei, me diga porque meu tempo parou. Eu não consigo entender essa dor estranha perfurando o meu peito.','Watashi-no-Jikan.png'),(4927,31,340,1,2,'Triple Baka','Idiota idiota idiota! Quanto esforço você fez até agora?','Triple-Baka.png'),(4928,35,340,1,4,'Ievan Polkka','Nuapurista kuulu se polokan tahti jalakani pohjii kutkutti. Ievan äiti se tyttöösä vahti vaan kyllähän Ieva sen jutkutti.','Ievan-Polkka.png'),(4929,2,341,1,3,'Odds and Ends','O guarda-chuva saiu voando pelo vento. Não recebemos nem um \"Bom trabalho\" por darmos um passo a frente.','Odds-and-Ends.png'),(4930,5,341,1,5,'Karakuri Pierrot','Ah, eu girei e girei e girei até cansar. Ah, minha respiração, minha respiração parou.','Karakuri-Pierrot.png'),(4931,10,341,1,2,'Magnet','Eu quero que você me abrace,e que você me perceba. Me faça acreditar que o que estamos fazendo não é errado.','Magnet.png'),(4932,12,341,1,4,'Monochrome Blue Sky','Nestes intermináveis caminhos que me levam a lugar nenhum, eu irei provavelmente falhar ao procurar pelas coisas que desejo.','Monochrome-Blue-Sky.png'),(4933,17,341,1,3,'Miracle Paint','Shabadaba pappapparappa. Shabadaba taturirappara. Shabadaba papaparapa. Shabadaba pa.','Miracle-Paint.png'),(4934,19,341,1,1,'Chaining Intention','Chizu wo nakushi tatazumu suisou, fuyu wo yurasu panorama. Hora, kabe no ushiro ni linoleum ga mutsumeru uso no kao.','Chaining-Intention.png'),(4935,24,341,1,4,'Matryoshka','Um pacote cantado por uma dor de cabeça. O tempo pode passar, mas as mãos estão no 4. Não conte a ninguém, o mundo vai virar de cabeça para baixo.','Matryoshka.png'),(4936,26,341,1,5,'Time Dilation','Eu pude ver um pouco, as visões destes últimos cálidos dias. À direita, à esquerda, se extendem e me levam.','Time-Dilation.png'),(4937,31,341,1,2,'Once Upon a Me','Tem sido triste, tem sido angustiante, tem sido doloroso, mas ninguém me escuta. Então minha única amizade sou eu mesma.','Once-Upon-a-Me.png'),(4938,35,341,1,1,'Deep Sea Girl','A menina do fundo do mar, afundando cada vez mais, fechada na infeliz escuridão.','Deep-Sea-Girl.png'),(4939,2,342,1,1,'Snow Piece','Hosizora to yuki no butoukai, nee mite kyou no watasi kirei desyou?','Snow-Piece.png'),(4940,5,342,1,3,'Winter Alice','Como estamos, iremos andar sozinhos. Mesmo a voz cheia de mentiras já é fraca.','Winter-Alice.png'),(4941,10,342,1,2,'Hitohira No','Shiroi kakera kasanari ai? Yagate sekai wo somete boku no utagoe mo todokanai yo hieta kokoro atatamete hoshii?','Hitohira-No.png'),(4942,12,342,1,4,'Fuyu no Seiza','A neve empoeirada flutua para baixo, colorindo a montanha de branco.','Fuyu-no-Seiza.png'),(4943,17,342,1,5,'Soundless Voice','A neve é como uma pilha de luz, sem som, você a junta e sorri. Como minha voz esta soando agora?','Soundless-Voice.png'),(4944,19,342,1,2,'White Lights','Kimi to futari nagameta. Ano sora wa ima mo mune ni kasunda hikari torimodoshite miseru yo.','White-Lights.png'),(4945,24,342,1,4,'Yuki Usagi','Sotto iki o hisome warai atta nukumori wa. Mawaru hoshi no wa no shita de fuwariyume ni kieta.','Yuki-Usagi.png'),(4946,26,342,1,1,'Kimibun','Konna kimochi wa hajimete shoshinsha wa mazu Rom(mu) ttero. Kimi to shitashiku naritainda nareai nara VIP(PU) de yare.','Kimibun.png'),(4947,31,342,1,3,'Tsunaida Te','Nas ruas à beira do mar, ao longo dos trilhos vermelhos e enferrujados, nós mentíamos dizendo que estávamos felizes.','Tsunaida-Te.png'),(4948,35,342,1,5,'Fuyu no Mahou','Eu posso tocar sua mão, eu posso ouvir a sua voz. Ambos são tão quentes, eu não posso parar essas lágrimas de alegria.','Fuyu-no-Mahou.png'),(4949,2,343,1,3,'Sakurazensen Ijou Nashi','Meguri meguru kono kisetsu atatakaku natte kuru koro ni. Hana wo sakasete wa shikisai niji wo yume mite wa rairai.','Sakurazensen-Ijou-Nashi.png'),(4950,5,343,1,5,'Natsu ni Sarishi Kimi wo Omofu','Ame no kisetsu ga sugi sumiwataru sora o nagamete hitori omofu. Kitto kimi to no kyori wa mou ano kumo no you ni tooku natte shimatta.','Natsu-ni-Sarishi-Kimi-wo-Omofu.png'),(4951,10,343,1,1,'Sakura no Goya','Só estar com você para sempre é a única coisa que eu preciso, mas eu não posso ficar pra sempre.','Sakura-no-Goya.png'),(4952,12,343,1,4,'SpiCa','Quanto estou junto de você minha órbita sempre muda, como uma estrela circumpolar.','SPiCa.png'),(4953,17,343,1,2,'Sakura Maichiru Ano Oka de','Aqui do eu olho para mim e vejo a cidade do demônio que é tão escura. As faíscas vermelhas estão desaparecendo, mesmo dentro a meus sentidos distantes.','Sakura-Maichiru-Ano-Oka-e.png'),(4954,19,343,1,5,'Yume to Hazakura','A correnteza deste rio é como se ouvissemos um timbre suave. O vento que sopra acaricia minha face.','Yume-to-Hazakura.png'),(4955,24,343,1,4,'Sakura no Kisetsu','Sakura saku koro ni boku wa koko ni modoru to chikatta. Kimi to miageta sora o itsu made mo oboeteru yo.','Sakura-no-Kisetsu.png'),(4956,26,343,1,1,'Sakura no Ame','A chuva de pétalas de cerejeira que entrou pela janela da nossa sala de aula caiu gentilmente em nossas mãos, e tocou nossos corações.','Sakura-no-Ame.png'),(4957,31,343,1,3,'Senbonzakura','Milhares de cerejeiras se dissolvem na noite, e nem mesmo a sua voz irá chegar.','Senbonzakura.png'),(4958,35,343,1,2,'Fuyu no Sakura','Kimi ni aitai mou ichido dake chiisana negai yuki ni toketeku. Tsumoru omoi wo mune ni daite kimi wo kanjiru fuyu no echu-do.','Fuyu-no-Sakura.png'),(4959,2,344,1,1,'Nice Age','Mudando as épocas e as cores originais que são esquecidas. Chore com aquele tempo que sentimos juntos.','Nice-Age.png'),(4960,5,344,1,2,'Day Tripper','Ela é uma grande provocadora. Ela me levou metade do caminho.','Day-Tripper.png'),(4961,10,344,1,5,'Coming Together','Ikutsu mo no kako o koe mitsukedashita aratana jibun. Masshiro ni kitana (kega) renaku tôku o mitsumete.','Coming-Together.png'),(4962,12,344,1,3,'FATE','Quando me apaixonei, acreditei que era o destino, cheio de pensamentos de felicidade e palpitações.','FATE.png'),(4963,17,344,1,4,'Second Star','Seus olhos me dizem a verdade, a verdade, a verdade. Eu os conheço desde a nossa juventude, a juventude, a juventude.','Second-Star.png'),(4964,19,344,1,1,'New World','Estou procurando pelas palavras que apenas você pode ouvir, mas eu não consigo achá-las.','New-World.png'),(4965,24,344,1,2,'Let The Music Speak','Mayoi mo tomadoi mo gomakashita mama da kara, mune no naka panku shisou na hodo tamari ni tamatte\'ru.','Let-The-Music-Speak.png'),(4966,26,344,1,3,'Spectrum','Cortando tudo em seu caminho, ela era acompanhada por um rastro vermelho.','Spectrum.png'),(4967,31,344,1,5,'Let Me Fly','O pássaro que não voa pensou: ultimamente só aconteceram coisas ruins. Ele ficou depressivo e baixou abaixou a cabeça.','Let-Me-Fly.png'),(4968,35,344,1,4,'Love is War','Vamos começar, isso é guerra! Como poderia te ver feliz com outra pessoa? Ganhar no amor, isso é pecado. Eu vou te mostrar com