us','Hypnos tem os seus sentidos aguçados, portanto quando o inimigo ataca, facilmente desvia e contra ataca com um chute.','4.png'),(6857,17,534,1,4,'Demônio do Sono','Hypnos invoca um demônio que come os sonhos e sentimentos de seus oponentes.','5.png'),(6858,19,534,1,5,'Onda de Pesadelos','Hypnos lança uma rajada de cosmo que faz com que os inimigos entrem em pânico.','6.png'),(6859,24,534,1,3,'Cosmo Divino','Hypnos utiliza seu cosmo divino para intimidar o seus inimigos.','7.png'),(6860,26,534,1,5,'Cosmo Infernal','Hypnos eleva seu cosmo ao nono sentindo e lança uma rajada infernal, que em contato com o inimigo, perde seus cinco sentido.','8.png'),(6861,31,534,1,3,'Pesadelo Eterno','Hypnos leva seus inimigos em seus piores pesadelos e lá ficam presos por toda eternidade.','9.png'),(6862,35,534,1,3,'Sono Eterno','Uma área de escuridão é criada e envolve Hypnos e suas vítimas, numa espécie de limbo, onde a frota inimiga confuso e despido de sua vontade de cair inconsciente mergulhou em um sono eterno, enquanto o sono horríveis imagens de morte e flutuando no limbo deus do sono.','10.png'),(6863,2,535,1,3,'Esfera de Energia','Thanatos cria uma esfera de energia que é capaz de sugar a vida do inimigo.','1.png'),(6864,5,535,1,3,'Alma da Morte','Thanatos cria uma alma que atormenta o inimigo, levando-o a morte psicologicamente.','2.png'),(6865,10,535,1,5,'Esfera da Morte','Thanatos cria uma esfera de energia que quando arremessada e atingida no inimigo causa morte instantânea.','3.png'),(6866,12,535,1,3,'Olhar Divino','Thanatos destrói todos objetos que são lançados contra ele, usando apenas seu olhar divino.','4.png'),(6867,17,535,1,3,'Lua da Morte','Thanatos usa a lua como forma de matar lentamente todos que olhar diretamente para ela.','5.png'),(6868,19,535,1,1,'Tufão das Trevas','Thanatos cria um tufão feito de cosmo negativo que corta o inimigo em pedaços.','6.png'),(6869,24,535,1,5,'Buraco Negro','Cria um buraco negro na palma de suas mãos e que pode ser arremes