ilize','Kaoru se coloca em cima das costas do inimigo para impedir que ele se mova.','4.png'),(6917,17,540,1,4,'Gedan no Kamae','A espada é posicionada em direção ao solo, tornando Kaoru capaz de realizar tanto golpes defensivos como ofensivos.','5.png'),(6918,19,540,1,4,'Hidari Hasso no Kamae Kamiya Kasshin Version','Kaoru deixa a espada ao lado do corpo e virada para baixo, tornando-se capaz de dar ataques em inimigos que estão em seu ponto cego.','6.png'),(6919,24,540,1,4,'Kamiya Kasshin: Back Attack','Kaoru desvia a espada do oponente e desfere um ataque em suas costas.','7.png'),(6920,26,540,1,4,'Morote Hidari Jodan Kamiya Kasshin Version','Utilizando o Morote Hidari Jodan clássico como base, Kaoru desfere um ataque direto no estômago do inimigo, fazendo ele desmaiar.','8.png'),(6921,31,540,1,4,'Kamiya Kasshin: Stumple Slash','Kaoru finge dar um passo para o lado e quando o inimigo ataca, ela se esquiva e desfere um ataque direto em sua nuca, deixando o inimigo desacordado.','9.png'),(6922,35,540,1,2,'Tsuka no Gedan: Hiza Hishigi','Kaoru desvia do corte do inimigo, ficando proximo do chão, e então avança e utiliza a Shinai para quebrar o joelho do oponente.','10.png'),(6923,2,541,1,2,'Destroyer Punch','Sanosuke desfere um soco capaz de Destruir até mesmo rochas.','1.png'),(6924,5,541,1,4,'Zanbatou: Slash','Utilizando a Zanbatou em conjunto com sua força, Sanosuke é capaz de cortar o inimigo.','2.png'),(6925,10,541,1,4,'Zanbatou: Leg Break','Se aproveitando do fato da Zanbatou não possuir fio, Sanosuke utiliza o suficiente da sua força somente para quebrar a perna do oponente.','3.png'),(6926,12,541,1,2,'Futae no Kiwami: Two Layers','Utilizando sua força e entendendo que toda matéria possui um nível de resistência, Sanosuke é capaz de destruir um objeto até que o mesmo vire pó.','4.png'),(6927,17,541,1,4,'Zanbatou: High Slash','Utilizando sua força fora do normal, Sanosuke faz um corte alto utilizando a Zanbatou.','5.png'),(6928,19,541,1,2,'Futae no Kiwami: Two 