42,1,3,'Shukuchi: One Step','Dando apenas um passo, Soujirou alcança a velocidade da luz e é capaz de matar o inimigo sem que ele sinta dor.','7.png'),(6940,26,542,1,3,'Shukuchi: Teleportation','Soujirou é capaz de se teletransportar ao atingir a velocidade da luz.','8.png'),(6941,31,542,1,4,'Shukuchi: Teleport Rampage Slash','Soujirou se teletransporta para frente do inimigo e realiza uma série de cortes impossíveis de serem acompanhados por olhos humanos.','9.png'),(6942,35,542,1,4,'Shuntensatsu','Soujirou ultrapassa a velocidade da luz e corta o inimigo sem que ele sinta dor e que o seu sangue derrame sobre sua espada.','10.png'),(6943,2,543,1,3,'Sohma de Shura','Shurato desperta o poder de Shura dentro de si e libera uma luz.','1.png'),(6944,5,543,1,2,'Golpe da Cobra','Shurato assume a pose de Kung Fu da Cobra e acerta o inimigo com vários golpes.','2.png'),(6945,10,543,1,2,'Golpe do Macaco','Shurato assume a pose de Kung Fu do Macaco e acerta golpes ao redor do oponente.','3.png'),(6946,12,543,1,2,'Golpe do Louva-deus','Shurato assume a pose de Kung Fu do Louva-deus e desfere golpes fortes no inimigo.','4.png'),(6947,17,543,1,3,'Liberação de Sohma','Shurato libera o Sohma dentro de si, criando algo silimar com vários meteoros de luz que vão para o céu e caem no inimigo.','5.png'),(6948,19,543,1,2,'Golpe do Urso','Shurato assume a pose de Kung Fu do Urso e desfere um poderoso golpe com as mãos de baixo para cima.','6.png'),(6949,24,543,1,2,'Golpe do Tigre','Shurato assume a pose de Kung Fu do Tigre e desfere uma sequência rápida de golpes mortais no inimigo.','7.png'),(6950,26,543,1,2,'Golpe do Falcão','Shurato assume a pose de Kung Fu do Falcão e salta bem alto, desferindo uma poderosa voadora.','8.png'),(6951,31,543,1,4,'Golpe de Vajra','Shurato usa seu Vajra para atacar o inimigo.','9.png'),(6952,35,543,1,3,'Explosão de Sohma','Shurato libera o Sohma dentro de si com força total, criando uma poderosa onda de energia.','10.png'),(6953,2,544,1,3,'Om Shura Sowaka','Shurato recita o Mantra de Shura e se transforma no Rei Shura, aumentando drasticamente seus poderes.','1.png'),(6954,5,544,1,4,'Golpe de Vajra','Shurato usa seu Vajra para atacar o inimigo.','2.png'),(6955,10,544,1,3,'Poder de Shura','Shurato recita o mantra Naumaki Sanmanda Bodanan Abila Unken Sowaka e dispara uma poderosa rajada de energia no formato de uma cabeça de leão.','3.png'),(6956,12,544,1,1,'Vento Cortante do Lobo Diabólico','Shurato usa o poder de Gai dentro de si e recita o mantra On Bazara Tamakukkan Yasha Han para disparar uma rajada de vento com formato de uma cabeça de lobo.','4.png'),(6957,17,544,1,3,'Formação Mandala','Shurato junta seus poderes com Hyouga, Ryuma e Leiga para criar uma mandala que dispara rajadas de energia de cada um dos Guardiões.','5.png'),(6958,19,544,1,2,'Punho Mágico de Shura','Shurato recita o mantra Naumaki Sanmanda Bodanan Abila Unken Sowaka e avança rapidamente diante do inimigo com um soco de luz.','6.png'),(6959,24,544,1,1,'Furacão do Canino Diabólico','Shurato usa o poder de Gai dentro de si e recita o mantra On Bazara Tamakukkan Yasha Han para disparar um raio de suas mãos que cria um poderoso furação destruidor.','7.png'),(6960,26,544,1,3,'Pirâmide de Luz de Shura','Shurato junta suas mãos e recita o mantra Naumaki Sanmanda Bodanan Makka Jinbara Sowaka, criando uma pirâmide de luz que purifica os inimigos.','8.png'),(6961,31,544,1,4,'Formação Mandala: A Face do Leão','Shurato junta seus poderes com Hyouga, Ryuma e Leiga para criar uma mandala que aumenta seus poderes, e em seguida cria um leão mágico que devora o inimigo.','9.png'),(6962,35,544,1,3,'Tríade Suprema de Shura','Shurato junta suas mãos e recita o mantra Naumaki Sanmanda Bodanan Makka Jinbara Sowaka, criando vários rajadas de luz que pulverizam o inimigo.','10.png'),(6963,35,563,1,1,'Tensou Juurin Bankai','.O poder de Tenso Jurin mais forte por ser usado em Bankai. A tempestade se alastra por uma área muito maior e pode sair do controle de Hitsugaya