.png'),(7504,5,599,1,2,'Gomu Gomu no Bazooka','Luffy estica seus braços para trás, esticando-os bem e depois dá um duplo soco com potência devastadora, acertando com as duas palmas da mão aberta ou com o punho fechado mesmo.','gomu-gomu-no-bazooka.png'),(7505,10,599,1,2,'Gomu Gomu no Gatling Gun','Luffy usa uma sequência enorme de socos elásticos em alta velocidade, como se fosse centenas de Gomu Gomu no Pistol seguidos, dando até a impressão de que tem vários braços.','gomu-gomu-no-gatling-gun.png'),(7506,12,599,1,2,'Gomu Gomu no Rifle','Luffy enrola seu braço como uma mola e dá um soco poderoso. ','gomu-gomu-no-rifle.png'),(7507,17,599,1,2,'Gomu Gomu no Cannon','Luffy aplica vários socos, mas nenhum acerta o adversário, que acaba por baixar a guarda e é quando Luffy ataca de verdade, com um Gomu Gomu no Bazooka.','gomu-gomu-no-cannon.png'),(7508,19,599,1,3,'Gomu Gomu no Fuusen ','Luffy absorve muito ar e começa a inflar, ficando bem gordo. Isso aumenta sua resistência a ataques, repelindo até balas de canhão.','gomu-gomu-no-fuusen.png'),(7509,24,599,1,2,'Gomu Gomu no Kazan','Luffy estica o pé para o alto com o objetivo de destruir o telhado ou acertar o inimigo que está em cima.','gomu-gomu-no-kazan.png'),(7510,26,599,1,2,'Gomu Gomu no Hanabi','Luffy pula bem alto e enrola os braços e pernas em si mesmo. Depois começa a disparar socos e chutes por todos os lados.','gomu-gomu-no-hanabi.png'),(7511,31,599,1,2,'Gomu Gomu no Storm','Luffy usa o Gomu Gomu no Fuusen e depois começa a torcer o corpo. Então ele solta o ar de seu corpo e por isso é arremessado para o lado oposto, onde começa a disparar um Gomu Gomu no Gatling Gun que tem força aumentada por causa do impulso.','gomu-gomu-no-storm.png'),(7512,35,599,1,5,'Batalha Naval','Luffy pega seus barquinhos de papel e brinca com seus oponentes.','10.png'),(7513,2,600,1,5,'Higan','Ace faz uma pose de arma com suas duas mãos e dispara vários projéteis de fogo.','Higan.png'),(7514,5,600,1,1,'Hiken','Ace transforma seus pu