i, na qual ela pode se multiplicar, criar coisas falsas e muitas outras coisas que não são reais.','mirage-tempo.png'),(7595,10,608,1,3,'Fog Tempo','Nami libera uma neblina muito densa, que é uma boa técnica para fuga ou ataque suspresa.','fog-tempo.png'),(7596,12,608,1,1,'Thunderbolt Tempo','Nami cria nuvens carregadas de energia, e com seu disparo elas começam a soltar raios por todos os lados.','thunderbolt-tempo.png'),(7597,17,608,1,1,'Cyclone Tempo','Usando o Clima Tact, Nami usa as Cool Balls com as Heat Balls e cria rajadas de vento que são capazes de arremessar o inimigo para longe.','cyclone-tempo.png'),(7598,19,608,1,3,'Cloudy Tempo','Nami libera nuvens pesadas de seu Clima Tact e elas começam a cobrir todo o local.','cloudy-tempo.png'),(7599,24,608,1,1,'Rain Tempo','Depois de usar o Cloudy Tempo, Nami faz com que as nuvens comecem a liberar chuva.','rain-tempo.png'),(7600,26,608,1,3,'Mirage Tempo: Fata Morgana','Nami cria uma miragem alterando as temperaturas em torno de si, mostrando várias cópias falsas de si mesma, dificultando pro adversário na hora de atacar.','mirage-tempo-fata-morgana.png'),(7601,31,608,1,1,'Dark Cloud Tempo','Nami cria nuvens negras carregadas com eletricidade criadas pelo Perfect Clima Tact.','dark-cloud-tempo.png'),(7602,35,608,1,4,'Golpe da Espada de Abóbora','Nami usa a espada de sua fantasia para atacar os oponentes.','10.png'),(7603,2,609,1,2,'Hissatsu Ketchup Boshi','É uma tática que Usopp usa para enganar seus inimigos. Ele usa ketchup para cobrir seu corpo, fingindo ser sangue, então seu inimigo acha que ele está muito ferido e baixa a guarda, permitindo que Usopp ataque.','hissatsu-ketchup-boshi.png'),(7604,5,609,1,5,'Hissatsu Akahebi Hoshi','Usopp dispara uma bomba que libera um rastro de fumaça vermelho.','hissatsu-akahebi-hoshi.png'),(7605,10,609,1,5,'Hissatsu Kayaku Boshi','Usopp dispara um saquinho cheio de pólvora, que depois pode ser usado para explosões.','hissatsu-kayaku-boshi.png'),(7606,12,609,1,5,'Hissatsu Na