ma de um dragão morto para assustar o inimigo.','milky-way.png'),(7682,35,618,1,1,'Tempestade de Feiticeira','Wendy sobe na sua vassoura de bruxa e cria uma ventania muito poderosa.','10.png'),(7683,2,619,1,5,'Heavenly Palm','Jellal atira da palma da mão, uma esfera de magia celeste na direção.','1.png'),(7684,5,619,1,3,'Kousoku no Hebi','Jellal faz com que uma espécie de tatuagem similar a uma cobra apareça no corpo do inimigo, restringindo seu movimento.','2.png'),(7685,10,619,1,5,'Heavenly Beams','Jellal atira diversos raios de magia celeste no inimigo.','3.png'),(7686,12,619,1,2,'Meteor','Jellal cobre seu corpo com magia celeste, permitindo que ele se mova em uma velocidade muito grande e ataque o inimigo.','4.png'),(7687,17,619,1,5,'Darkness Ray','Jellal atira um raio sombrio no inimigo.','5.png'),(7688,19,619,1,2,'Darkness Cage','Jellal cria uma esfera em sua mão e faz com que apareçam vários fantasmas nos pés do inimigo e o segurem, impedindo o movimento.','6.png'),(7689,24,619,1,5,'Ghost Fireworks','Jellal extende suas mãos e cria uma enorme quantidade de fantasmas que atacam o inimigo.','7.png'),(7690,26,619,1,3,'Jiritsu Houkai Mahoujin','Jellal cria um círculo mágico de auto-destruição em seu próprio corpo.','8.png'),(7691,31,619,1,3,'Altairis','Jellal cruza as mãos acima da sua cabeça e começa a concentrar energia num único ponto, fazendo com que uma esfera negra apareça, sugando tudo que está em volta. Logo em seguida, a esfera é lançada no inimigo.','9.png'),(7692,35,619,1,3,'Drenagem Mágica','Jellal, enquanto é um drácula, drena todo o sangue do inimigo com magia.','10.png'),(7693,2,620,1,2,'Cutting Jump','Maka usa o cabo da foice como apoio para pular em cima do inimigo ou para evitar um ataque.','Cutting-Jump.png'),(7694,5,620,1,4,'Air Blow','Maka pula na direção do inimigo e aplica um golpe com sua Foice.','Air-Blow.png'),(7695,10,620,1,4,'Buki Jiin - Hangeki','Maka deixa o inimigo atacar, e quando ele esta próximo, ela cria várias Foices ao seu red