o','Maka arremessa o inimigo para o ar, e o finaliza esmagando-o no chão com um soco no estômago tão forte que, além de destruir o corpo do inimigo, destrói o cenário ao redor.','daichi-kujo.png'),(8683,2,716,1,3,'Rasengan','Naruto concentra chakra em suas mãos, rotacionando em alta velocidade, formando uma esfera, e acerta o inimigo à uma distância curta.','rasengan.png'),(8684,5,716,1,3,'Kamehameha','Naruto concentra uma grande quantidade de Ki em suas mãos e a dispara como um canhão.','kamehameha.png'),(8685,10,716,1,3,'Oodama Rasengan','Um Rasengan maior e mais forte que o comum, feito juntamente com um Kage Bunshin.','oodama-rasengan.png'),(8686,12,716,1,3,'Instant Transmission','Naruto sente o ki de um indivíduo e se teletransportar até ele em questão de segundos.','instant-transmission.png'),(8687,17,716,1,3,'Harem no Jutsu','Naruto cria diversos clones de mulheres, geralmente nuas. Causa distração em praticamente todo mundo, e na maioria das vezes causando hemorragia nasal.','harem-no-jutsu.png'),(8688,19,716,1,2,'Kaioken Attack','Utilizando o Kaioken, Naruto avança rapidamente para atacar seu inimigo.','kaioken-attack.png'),(8689,24,716,1,1,'Fuuton Gamayu Endan','Naruto invoca Gamatatsu e Gamakichi, misturando óleo, fogo e água para disparar no inimigo.','fuuton-gamayu-endan.png'),(8690,26,716,1,3,'Super Kamehameha','Muito mais poderoso que um simples Kamehameha, utilizando muito mais Ki, mas causando um estrago muito maior.','super-kamehameha.png'),(8691,31,716,1,3,'Rasen Chou Tarengan','Utilizando o Tajuu Kage Bunshin do Jutsu, Naruto cria um Rasengan com cada um deles e pula no inimigo.','rasen-chou-tarengan.png'),(8692,35,716,1,3,'Super Genki Dama','Todos os seres vivos do planeta ajudam Naruto a coletar energia, criando uma Genki Dama muito maior e muito mais forte que uma comum, com poder até de destruir um planeta inteiro.','super-genki-dama.png'),(8693,2,717,1,3,'Lolicon Time','Araragi ativa seu instinto de lolicon e ataca com movimentos rápidos, tocando em todos os lugares.','1.png'),(8694,5,717,1,4,'Ragdoll','Araragi substui seu corpo para o de um boneco de pano, enganando o inimigo.','2.png'),(8695,10,717,1,2,'Violent Rush','Araragi possui instintos de um vampiro e em situações muito graves, perde o controle, agindo como um animal descontrolado e atacando ferozmente a causa de seus problemas.','3.png'),(8696,12,717,1,4,'Kokorowatari','Araragi consegue de Shinobu, a lendária espada demoníaca Kokorowatari, uma espada que fere apenas seres sobrenaturais.','4.png'),(8697,17,717,1,2,'Kyuuketsuki Punch','Araragi no meio de sua luta, faz um sinal e Shinobu sai de sua sombra, surpreendendo o inimigo com um gancho usando sua força de vampira.','5.png'),(8698,19,717,1,3,'Apparition Absorption','Shinobu sai da sombra de Araragi de surpresa e morde o inimigo, absorvendo seus poderes.','6.png'),(8699,24,717,1,4,'Kokorowatari Magic Trick','Araragi engole a espada demoníaca e faz com que o inimigo o ataque de proposito, se cortando caso arranque um pedaço dele.','7.png'),(8700,26,717,1,3,'Energy Drain','Araragi chama Shinobu que vive em sua sombra e ordena que ela beba seu sangue, recuperando parte de seus poderes de vampira para então, ajudá-lo na luta.','8.png'),(8701,31,717,1,3,'Full Regeneration','Araragi bebe o sangue de Shinobu para se recuperar por completo de um ferimento grave.','9.png'),(8702,35,717,1,5,'Kokorowatari Vital Lance','Araragi atira a espada demoníaca como uma lança, perfurando um ponto vital do inimigo, o incapacitando.','10.png'),(8703,2,718,1,3,'Lolicon Time','Araragi ativa seu instinto de lolicon e ataca com movimentos rápidos, tocando em todos os lugares.','1.png'),(8704,5,718,1,4,'Ragdoll','Shinobu rapidamente substitui o corpo de Araragi para o de um boneco de pano, enganando o inimigo.','2.png'),(8705,10,718,1,2,'Violent Rush','Araragi possui instintos de um vampiro e em situações muito graves, perde o controle, agindo como um animal descontrolado e atacando ferozmente a causa de seus problemas.','3.png'),(8706,12,718,1,4,'Kokorowatari','Shinobu concede à Araragi, a lendária espada demoníaca Kokorowatari, uma espada que fere apenas seres sobrenaturais.','4.png'),(8707,17,718,1,2,'Kyuuketsuki Punch','Shinobu sai da sombra de Araragi, pegando o inimigo de surpresa com um gancho usando seu poder de vampira.','5.png'),(8708,19,718,1,3,'Apparition Absorption','Shinobu sai da sombra de Araragi de surpresa e morde o inimigo, absorvendo seus poderes.','6.png'),(8709,24,718,1,4,'Kokorowatari Magic Trick','Araragi engole a espada demoníaca e faz com que o inimigo o ataque de proposito, se cortando caso arranque um pedaço dele.','7.png'),(8710,26,718,1,3,'Energy Drain','Shinobu sai da sombra de Araragi e bebe seu sangue, recuperando parte de seus poderes de vampira para então, ajudá-lo na luta.','8.png'),(8711,31,718,1,3,'Full Regeneration','Shinobu arranca um de seus braços e joga seu sangue no corpo ferido de Araragi, recuperando-o completamente de seus ferimentos.','9.png'),(8712,35,718,1,5,'Kokorowatari Vital Lance','Araragi atira a espada demoníaca como uma lança, perfurando um ponto vital do inimigo, o incapacitando.','10.png'),(8713,2,719,1,3,'Mão Fantasma','Endo reúne energia na mão direita e forma uma grande mão energética, usada para defender os ataques diretos do inimigo.','1.png'),(8714,5,719,1,3,'Mão Fantasma Dupla','Endo reúne energia nas duas mãos e forma uma mão energética muito maior do que a normal, defendendo ataques muito mais poderosos.','2.png'),(8715,10,719,1,1,'Punho de Fogo','Endo reúne energia flamejante no punho direito e desfere um soco flamejante na bola.','3.png'),(8716,12,719,1,2,'Punho Explosivo','Endo golpeia a bola múltiplas vezes terminando com um gancho que afasta a bola do gol.','4.png'),(8717,17,719,1,3,'Punho da Justiça','Endo bate fortemente o pé no chão, seguido de um giro dos quadris e então um punho é projetado à sua frente, desviando o chute adversário.','5.png'),(8718,19,719,1,3,'Mão Demoníaca','Endo usa uma das mais poderosas técnicas de goleiro descritas no Manual Secreto de Daisuke. Consiste em usar a o poder do coração na mão usada para defender, fazendo um demônio amarelo surgir e defender completamente o chute adversário.','6.png'),(8719,24,719,1,3,'Triplo Pégaso','Endo usa essa técnica em conjunto com Ichinose e Domon, onde os três correm um do lado do outro e depois cruzam os caminhos, fazendo surgir uma estranha energia na forma de pégaso no ponto central, que é onde está a bola e então, os três saltam e chutam a bola ao mesmo tempo que segue até o gol com a forma de pégaso.','7.PNG'),(8720,26,719,1,3,'Zona Mortal 2','Endo inicia a versão Raimon da técnica Death Zone, nascida do choque de individualidades dos jogadores da Raimon, onde os giros não são sincronizados como na Death Zone usada pelo Instituto Imperial, e além da junção dos pés no centro onde está a bola, os jogadores saltam mais alto e dão um chute triplo, gerando um ataque ainda mais poderoso.','8.png'),(8721,31,719,1,3,'A Mão Ômega','Endo domina o poder da mão demoníaca e com isso é capaz de usar um poder ainda maior do que ela e a própria mão fantasma. Uma mão gigante flamejante que bloqueia qualquer coisa.','9.png'),(8722,35,719,1,3,'Captura Fantasma','Endo drena a energia do seu corpo, dando origem ao demônio com capa vermelha com enorme capacidade defensiva, conseguindo bloquear qualquer ataque do inimigo.','10.png'),(8723,2,720,1,3,'Mão Fantasma','Endo reúne energia na mão direita e forma uma grande mão energética, usada para defender os ataques diretos do inimigo.','1.png'),(8724,5,720,1,3,'Mão Fantasma Dupla','Endo reúne energia nas duas mãos e forma uma mão energética muito maior do que a normal, defendendo ataques muito mais poderosos.','2.png'),(8725,10,720,1,3,'Punho da Justiça','Endo bate fortemente o pé no chão, seguido de um giro dos quadris e então um punho é projetado à sua frente, desviando o chute adversário.','3.png'),(8726,12,720,1,3,'Mão Demoníaca','Endo usa uma das mais poderosas técnicas de goleiro descritas no Manual Secreto de Daisuke. Consiste em usar a o poder do coração na mão usada para defender, fazendo um demônio amarelo surgir e defender completamente o chute adversário.','4.png'),(8727,17,720,1,1,'Relâmpago Destruidor','Endo usa essa técnica em conjunto com Kidou e Goenji onde Kidou chuta a bola para o ar enquanto Endo e Goenji continuam correndo e então, surge na bola uma atmosféra roxa e um raio cai sobre ela. Os três saltam e desferem um chute triplo na bola.','5.png'),(8728,19,720,1,5,'Golpe Megaton','Endo tenta dar uma cabeçada na bola e faz surgir um grande punho que realiza essa função.','6.png'),(8729,24,720,1,3,'Mão Dimensional','Endo concentra energia em seu punho, salta e golpeia o chão, criando uma barreira circular à sua volta, defendendo qualquer ataque do inimigo.','7.png'),(8730,26,720,1,1,'Corrente de Jato','Endo usa essa técnica em conjunto com Goenji e Toramaru onde os três correm em volta da bola, fazendo um furacão surgir para então os três à chutarem para o ar e seguir em direção ao gol.','8.png'),(8731,31,720,1,3,'Martelo da Ira','Endo concentra energia e um grande demônio aparece e desfere um poderoso soco na bola, prensando-a contra o chão.','9.png'),(8732,35,720,1,3,'A Terra','Endo inicia a técnica suprema escrita no caderno de seu avô, onde é necessário o poder da união dos 11 jogadores do time, sendo executada principalmente por Endo, Fubuki e Goenji, após receberem o poder dos outros 8 jogadores do time.','10.png'),(8733,2,721,1,1,'Furacão de Fogo','Goenji salta e gira o corpo muito rápido, fazendo fogo sair de seus pés e em seguida chuta a bola.','1.png'),(8734,5,721,1,3,'Tempestade Explosiva','Goenji invoca um demônio que cria um tornado e em seguida salta e desfere um chute com o poder do demônio.','2.png'),(8735,10,721,1,5,'Catavento de Fogo','Goenji usa essa técnica em conjunto com Kazemaru. Goenji e Kazemaru saltam, sendo que Kazemaru salta mais alto e Goenji mais baixo, desferindo, os dois ao mesmo tempo, um chute na bola, fazendo asas de fogo surgirem dela e ir direto para o gol.','3.png'),(8736,12,721,1,1,'Fogo Cruzado','Goenji usa essa técnica em conjunto com Fubuki. Os dois correm na mesma direção usando seus poderes, fogo e gelo e quando estão prestes a colidir um com o outro, as duas auras somem e ambos desferem um chute de fogo e gelo.','4.png'),(8737,17,721,1,1,'Hélice Dinamite','Goenji invoca um tornado e nele gira. Ao girar dentro dele, um fogo é criado e então ele chuta a bola, criando um parafuso explosivo.','5.png'),(8738,19,721,1,2,'Gol Relâmpago','Goenji usa essa técnica em conjunto com Kabeyama. Os dois saltam e Goenji utiliza Kabeyama como um \"trampolim\" para adquirir maior altura  e velocidade, assim finalizando com um pontapé de bicicleta.','6.png'),(8739,24,721,1,1,'Relâmpago Destruidor','Goenji usa essa técnica em conjunto com Kidou e Endo, onde Kidou chuta a bola para o ar enquanto Endo e Goenji continuam correndo e então, surge na bola uma atmosféra roxa e um raio cai sobre ela. Os três saltam e desferem um chute triplo na bola.','7.png'),(8740,26,721,1,1,'Corrente de Jato','Goenji usa essa técnica em conjunto com Endo e Toramaru onde os três correm em volta da bola, fazendo um furacão surgir para então os três à chutarem para o ar e seguir em direção ao gol.','8.png'),(8741,31,721,1,1,'Tempestade do Tigre','Goenji usa essa técnica em conjunto com Toramaru. Toramaru chuta a bola para o alto e Goenji vai e completa, gerando um poderoso chute flamejante com a fúria de um tigre.','9.png'),(8742,35,721,1,1,'Fogo Máximo','Goenji gira no ar, criando um fluxo intenso de fogo em sua perna. Em seguida chuta, fazendo a bola ficar em chamas, deixando um rastro de fogo no campo.','10.png'),(8743,2,722,1,1,'Furacão de Fogo','Goenji salta e gira o corpo muito rápido, fazendo fogo sair de seus pés e em seguida chuta a bola.','1.png'),(8744,5,722,1,3,'Tempestade Explosiva','Goenji invoca um demônio que cria um tornado e em seguida salta e desfere um chute com o poder do demônio.','2.png'),(8745,10,722,1,5,'Catavento de Fogo','Goenji usa essa técnica em conjunto com Kazemaru. Goenji e Kazemaru saltam, sendo que Kazemaru salta mais alto e Goenji mais baixo, desferindo, os dois ao mesmo tempo, um chute na bola, fazendo asas de fogo surgirem dela e ir direto para o gol.','3.png'),(8746,12,722,1,1,'Fogo Cruzado','Goenji usa essa técnica em conjunto com Fubuki. Os dois correm na mesma direção usando seus poderes, fogo e gelo e quando estão prestes a colidir um com o outro, as duas auras somem e ambos desferem um chute de fogo e gelo.','4.png'),(8747,17,722,1,1,'Hélice Dinamite','Goenji invoca um tornado e nele gira. Ao girar dentro dele, um fogo é criado e então ele chuta a bola, criando um parafuso explosivo.','5.png'),(8748,19,722,1,2,'Gol Relâmpago','Goenji usa essa técnica em conjunto com Kabeyama. Os dois saltam e Goenji utiliza Kabeyama como um \"trampolim\" para adquirir maior altura  e velocidade, assim finalizando com um pontapé de bicicleta.','6.png'),(8749,24,722,1,1,'Relâmpago Destruidor','Goenji usa essa técnica em conjunto com Kidou e Endo, onde Kidou chuta a bola para o ar enquanto Endo e Goenji continuam correndo e então, surge na bola uma atmosféra roxa e um raio cai sobre ela. Os três saltam e desferem um chute triplo na bola.','7.png'),(8750,26,722,1,1,'Tempestade do Tigre','Goenji usa essa técnica em conjunto com Toramaru. Toramaru chuta a bola para o alto e Goenji vai e completa, gerando um poderoso chute flamejante com a fúria de um tigre.','8.png'),(8751,31,722,1,1,'Fogo Máximo','Goenji gira no ar, criando um fluxo intenso de fogo em sua perna. Em seguida chuta, fazendo a bola ficar em chamas, deixando um rastro de fogo no campo.','9.png'),(8752,35,722,1,3,'A Terra','Endo inicia a técnica suprema escrita no caderno de seu avô, onde é necessário o poder da união dos 11 jogadores do time, sendo executada principalmente por Endo, Fubuki e Goenji, após receberem o poder dos outros 8 jogadores do time.','10.png'),(8753,2,723,1,3,'Bola Ilusão','Kidou bate a bola no chão, fazendo aparecer múltiplas bolas ilusórias que confundem o defensor inimigo, permitindo a passagem de Kido.','1.png'),(8754,5,723,1,3,'Autêntica Bola Ilusão','Kidou utiliza a versão final da Bola Ilusão, onde as bolas se movem mais rapidamente, confundindo o inimigo completamente.','2.png'),(8755,10,723,1,5,'Pinguim Imperial Nº 2','Kidou assobia chamando os pinguins e dando um forte chute, que então segue para dois companheiros que estão mais adiantados, e estes dão um chute duplo para completar a técnica. ','3.png'),(8756,12,723,1,5,'Duplo Boost','Kidou cruza a bola para seu companheiro que imediatamente a devolve, e Kido recebe o passe chutando diretamente para o gol.','4.png'),(8757,17,723,1,5,'Pinguim Imperial Nº 3','Kidou assobia chamando os pinguins, que rodeiam os três usuários no ar e energizam a bola e então, os três dão um chute triplo com o calcanhar. ','5.png'),(8758,19,723,1,1,'Relâmpago Destruidor','Kidou usa essa técnica em conjunto com Goenji e Endo, onde Kidou chuta a bola para o ar enquanto Endo e Goenji continuam correndo e então, surge na bola uma atmosféra roxa e um raio cai sobre ela. Os três saltam e desferem um chute triplo na bola.','6.png'),(8759,24,723,1,3,'Big Bang','Kidou usa essa técnica em conjunto com Fubuki e Hiroto. Hiroto corre com a bola enquanto Fubuki e Kido saltam. Então, Hiroto faz um voleio e dois anéis roxos aparecem ao redor da bola. Fubuki chuta para cima, direção onde está Kidou que a chute de volta ao chão com o calcanhar e então, os três chutam a bola ao mesmo tempo, fazendo com que uma enorme esfera laranja apareça em volta da bola, seguindo em direção ao gol.','7.png'),(8760,26,723,1,1,'Área Assassina','Kidou usa essa técnica em conjunto com Fudo. Os dois correm em direção opostas, saltam e cada um chute para uma direção ao mesmo tempo, então a bola cria um furacão.','8.png'),(8761,31,723,1,3,'Zona Mortal','Kidou e mais dois jogadores saltam e giram