guins, que rodeiam os três usuários no ar e energizam a bola e então, os três dão um chute triplo com o calcanhar. ','5.png'),(8778,19,725,1,1,'Relâmpago Destruidor','Kidou usa essa técnica em conjunto com Goenji e Endo, onde Kidou chuta a bola para o ar enquanto Endo e Goenji continuam correndo e então, surge na bola uma atmosféra roxa e um raio cai sobre ela. Os três saltam e desferem um chute triplo na bola.','6.png'),(8779,24,725,1,3,'Big Bang','Kidou usa essa técnica em conjunto com Fubuki e Hiroto. Hiroto corre com a bola enquanto Fubuki e Kido saltam. Então, Hiroto faz um voleio e dois anéis roxos aparecem ao redor da bola. Fubuki chuta para cima, direção onde está Kidou que a chute de volta ao chão com o calcanhar e então, os três chutam a bola ao mesmo tempo, fazendo com que uma enorme esfera laranja apareça em volta da bola, seguindo em direção ao gol.','7.png'),(8780,26,725,1,1,'Área Assassina','Kidou usa essa técnica em conjunto com Fudo. Os dois correm em direção opostas, saltam e cada um chute para uma direção ao mesmo tempo, então a bola cria um furacão.','8.png'),(8781,31,725,1,3,'Zona Mortal','Kidou e mais dois jogadores saltam e giram ao redor da bola, criando um triângulo energético que energiza a bola, terminando com os três se juntando no centro ainda girando e impulsionando a bola até o gol.','9.png'),(8782,35,725,1,3,'Zona Mortal 2','Kidou inicia a versão Raimon da técnica Death Zone, nascida do choque de individualidades dos jogadores da Raimon, onde os giros não são sincronizados como na Death Zone usada pelo Instituto Imperial, e além da junção dos pés no centro onde está a bola, os jogadores saltam mais alto e dão um chute triplo, gerando um ataque ainda mais poderoso.','10.png'),(8783,2,726,1,3,'Defesa Múltipla','Usando sua velocidade ampliada pelo Meteorito Alien, Kazemaru cria dois clones de si mesmo que junto do original, roubam a bola do adversário com precisão, reunindo-se após a execução.','1.png'),(8784,5,726,1,5,'Chute em Forma de Banana','Usada apenas em cobranças de escanteio, Kazemaru chuta a bola direto para a área e ela faz uma grande curva e indo no ângulo do gol.','2.png'),(8785,10,726,1,3,'Desenho Rápido','Usando sua velocidade, Kazemaru realiza um drible veloz, passando pelo adversário em uma fração de segundo.','3.png'),(8786,12,726,1,2,'Deslize Veloz','Kazemaru corre rapidamente para frente do jogador com a posse da bola e então, rouba a bola e desliza para se afastar dele.','4.png'),(8787,17,726,1,5,'Catavento de Fogo','Kazemaru usa essa técnica em conjunto com Goenji. Goenji e Kazemaru saltam, sendo que Kazemaru salta mais alto e Goenji mais baixo, desferindo, os dois ao mesmo tempo, um chute na bola, fazendo asas de fogo surgirem dela e ir direto para o gol.','5.png'),(8788,19,726,1,5,'Triplo Boost','Uma técnica básica onde 3 chutes em linha são desferidos na bola por 3 pessoas, 1 chute cada um. Kazemaru e mais dois jogadores de seu time iniciam está técnica e Kazemaru desfere o chute final, indo direto para o gol.','6.png'),(8789,24,726,1,1,'Gol Tornado','Kazemaru usa essa técnica em conjunto com Kabeyama. Kabeyama e Kazemaru saltam e então realizam um giro, onde Kabeyama impulsiona Kazemaru usando seus pés e uma ventania é gerada no impulso, finalizando com uma bicicleta de Kazemaru com todo o poder de vento concentrado.','7.png'),(8790,26,726,1,1,'O Furacão','Kazemaru usa essa técnica em conjunto com Fubuki. Kazemaru corre em direção ao campo adversário envolvido pelo poder do vento e Fubuki estando mais adiantado, concentra poder na bola, englobando-a em gelo, para então Kazemaru saltar e dar um poderoso chute, combinando vento e gelo, gerando um chute extremamente veloz.','8.png'),(8791,31,726,1,1,'Dança do Deus de Vento','Usando sua grande velocidade, Kazemaru gira ao redor do adversário criando um furacão, conduzindo a bola dentro dele e lançando o adversário pelos ares devido a força do vento.','9.png'),(8792,35,726,1,3,'Fênix Escura','Técnica mais poderosa dos Imperado