 chute que junta o poder congelante com o dragão lendário de Someoka.','4.png'),(8817,17,729,1,1,'Fogo Cruzado','Fubuki usa essa técnica em conjunto com Goenji. Os dois correm na mesma direção usando seus poderes, fogo e gelo e quando estão prestes a colidir um com o outro, as duas auras somem e ambos desferem um chute de fogo e gelo.','5.png'),(8818,19,729,1,4,'Lobo Lendário','Fubuki pula com a bola e dá um chute meio que raspando a bola e em seguida, um lobo aparece atrás de Fubuki, uivando ferozmente e impulsiona a bola até o gol.','6.png'),(8819,24,729,1,1,'Besta Trovão','Fubuki usa essa técnica em conjunto com Hijikata. Enquanto Fubuki avança, Hijikata chuta a bola carregando-a com poder elemental do trovão, para em seguida, Fubuki complementar com seu poder Lobo Lendário, formando um poderoso chute que dá a impressão de ser um lobo negro envolto em raios. ','7.png'),(8820,26,729,1,1,'O Furacão','Fubuki usa essa técnica em conjunto com Kazemaru. Kazemaru corre em direção ao campo adversário envolvido pelo poder do vento e Fubuki estando mais adiantado, concentra poder na bola, englobando-a em gelo, para então Kazemaru saltar e dar um poderoso chute, combinando vento e gelo, gerando um chute extremamente veloz.','8.png'),(8821,31,729,1,3,'O Nascimento','Rodeados por energias opostas, Hiroto e Fubuki dão um salto giratório formando uma espécie de cadeia de DNA com as duas energias, em seguida dando um chute duplo de poder esmagador.','9.png'),(8822,35,729,1,1,'Vendaval Eterno','Fubuki suspende a bola no ar, reunindo grande energia congelante e envolvendo-a em uma grossa camada de gelo para depois dar alguns giros e chutar com intensa força.','10.png'),(8823,2,730,1,1,'Chão de Gelo','Usando grande velocidade, Fubuki cria uma camada de gelo sobre o solo que avança contra o oponente, congelando-o momentaneamente.','1.png'),(8824,5,730,1,1,'Anjo da Neve','Fubuki cria ventos congelantes movendo suas pernas rapidamente, congelando até dois atacantes do time inimigo enq