,1,1,'Tidal Wave','Asuna corta o ar e cria um maremoto que quebra a defesa do inimigo.','Tidal-Wave.png'),(8890,26,736,1,4,'Star Splash','Asuna desfere um combo de oito golpes no inimigo, finalizando com uma forte punhalada no peito do inimigo.','Star-Splash.png'),(8891,31,736,1,3,'Holy Nova','Asuna desfere uma sequência de golpes, finalizando com um toque usando a ponta de sua espada para criar um poderoso pilar de luz ao redor do inimigo.','Holy-Nova.png'),(8892,35,736,1,2,'Fúria Achocolatada','Asuna avança rapidamente diante do inimigo distraido e desfere 11 golpes numa velocidade surpreendente.','10.png'),(8893,2,737,1,3,'Fairy Flight','Leafa libera suas asas e usa para lutar e escapar do inimigo.','Fairy-Flight.png'),(8894,5,737,1,5,'Wind Needles','Leafa dispara vinte agulhas mágicas do atributo Vento para perfurar o inimigo.','Wind-Needles.png'),(8895,10,737,1,5,'Vacuum Blades','Leafa dispara cinco bumerangues afiados e teleguiados do atributo Vento no inimigo.','Vacuum-Blades.png'),(8896,12,737,1,1,'Concealment','Leafa realiza um encantamento do atributo Vento, na qual ela cria uma parede ilusória para se esconder ou confundir o inimigo.','Concealment.png'),(8897,17,737,1,3,'Shining Step','Leafa dança no ar, liberando diversos globos de luz que paralizam seu inimigo.','Shining-Step.png'),(8898,19,737,1,3,'Fairy Star','Leafa, enquanto voa, dispara diversos raios de energia similares à estrelas caindo.','Fairy-Star.png'),(8899,24,737,1,1,'Typhoon Pain','Leafa utiliza a magia do atributo Vento para criar um gigantesco tufão ao redor do inimigo.','Typhoon-Pain.png'),(8900,26,737,1,4,'Obliterate Slash','Leafa utiliza sua espada com o atributo Vento para cortar vários inimigos em uma velocidade surpreendente.','Obliterate-Slash.png'),(8901,31,737,1,2,'Meteor Crash','Leafa voa rapidamente para frente ou para trás do inimigo e o acerta com um poderoso golpe na cabeça.','Meteor-Crash.png'),(8902,35,737,1,3,'Magia de Páscoa','Leafa, usando encantamento secreto, cria uma tempestade de chocolate que engloba o campo de batalha.','10.png'),(8903,2,738,1,2,'Cat Jump','Sinon usa seus reflexos de gato para esquivar facilmente de golpes inimigos e acertá-lo com diversas arranhadas.','Cat-Jump.png'),(8904,5,738,1,5,'Precise Arrow','Sinon mira em um ponto específico do alvo e dispara uma flecha exatamente no local.','Precise-Arrow.png'),(8905,10,738,1,5,'Blizzard Shot','Sinon encanta sua flecha com gelo e dispara no alvo e o congela.','Blizzard-Shot.png'),(8906,12,738,1,3,'Magic Arrow','Sinon encanta sua flecha com magia e dispara diretamente num ponto vital do oponente.','Magic-Arrow.png'),(8907,17,738,1,5,'Pulling Arrow','Sinon dispara uma flecha que se transforma em uma cola que gruda no alvo, transformando seu rastro em uma corda para ser puxada.','Pulling-Arrow.png'),(8908,19,738,1,1,'Frozen Heart','Sinon avança rapidamente para trás do inimigo e dispara uma flecha encantada com gelo diretamente no coração do alvo, congelando-o e criando uma estalagmite.','Frozen-Heart.png'),(8909,24,738,1,2,'Tempest Kick','Sinon se move rapidamente diante do alvo e e desfere uma poderosa sequência de chutes, finalizando com um pisão no rosto do alvo.','Tempest-Kick.png'),(8910,26,738,1,5,'Shattering Arrow','Sinon dispara uma poderosa flecha capaz de perfurar e destruir qualquer coisa.','Shattering-Arrow.png'),(8911,31,738,1,3,'Starfall','Sinon dispara uma flecha que corta os céus e, ao perfurar o inimigo, explode em uma chuva de estrelas.','Starfall.png'),(8912,35,738,1,5,'Caça ao Coelho','Sinon dispara uma flecha encantada para perseguir seus alvos e finalizá-los.','10.png'),(8913,2,739,1,4,'Dagger Dash','Silica avança rapidamente diante do inimigo com sua adaga e o perfura.','Dagger-Dash.png'),(8914,5,739,1,4,'Twin Slash','Silica salta e executa dois cortes, podendo acertar dois inimigos ao mesmo tempo.','Twin-Slash.png'),(8915,10,739,1,4,'Rising Strike','Silica corre para baixo do alvo e salta, usando sua adaga para cortar o inimigo de baixo para 