io e acerta um golpe poderoso no chão, criando um estrondo e uma onda de raio.','Thunder-Clap.png'),(8930,26,740,1,4,'Spinning Blow','Lizbeth acerta um golpe giratório no inimigo, arremessando-o muito longe.','Spinning-Blow.png'),(8931,31,740,1,1,'Thunder Gate','Lizbeth acerta sua maça eletrizada no inimigo com tanta força que invoca um trovão dos céus e acerta o inimigo.','Thunder-Gate.png'),(8932,35,740,1,5,'Bombas de Chocolate','Lizbeth cria diversas bombas com formato de ovos de páscoa e as arremessam nos inimigos, criando uma tempestade de explosões.','10.png'),(8933,2,741,1,1,'Tenryuu no Houkou','Wendy cospe uma grande quantidade de vento pela boca, simulando um rugido de dragão.','tenryuu-no-houkou.png'),(8934,5,741,1,3,'Troia','Wendy consegue anular efeitos na saúde de um aliado ou a de si própria.','troia.png'),(8935,10,741,1,3,'Tenryuu no Chiyu','Wendy consegue curar ferimentos.','tenryuu-no-chiyu.png'),(8936,12,741,1,2,'Tenryuu no Saiga','Wendy, com suas mãos cobertas de vento cortante, golpeia o adversário como se fossem garras.','tenryuu-no-saiga.png'),(8937,17,741,1,3,'Vernier','Wendy consegue aumentar sua velocidade de movimento drasticamente.','vernier.png'),(8938,19,741,1,2,'Tenryuu no Kagizume','Wendy concentra vento cortante em seus pés e os dispara através de chutes.','tenryuu-no-kagizume.png'),(8939,24,741,1,3,'Arms X Armor','Wendy consegue aumentar a força de ataque e defesa de seus ataques ou do inimigo, fazendo-o perder o controle e errar o golpe.','arms.png'),(8940,26,741,1,2,'Tenryuu no Yokugeki','Wendy corre em direção ao inimigo e o agarra com suas mãos com ventos cortantes, arremessando-o longe.','tenryuu-no-yokugeki.png'),(8941,31,741,1,3,'Milky Way','Wendy consegue materealizar a alma de um dragão morto para assustar o inimigo.','milky-way.png'),(8942,35,741,1,5,'Ventos de Páscoa','Wendy cria uma rajada de vento, fazendo voar vários ovos de páscoa no inimigo, ferindo-o por todos os lados.','10.png'),(8943,2,742,1,2,'Martial Arts Assault','Akame se move rapidamente e desfere poderosos chutes e socos nos pontos vitais do inimigo.','1.png'),(8944,5,742,1,1,'Gust Kick','Akame chuta o ar e faz com que uma rajada de vento jogue o inimigo para longe.','2.png'),(8945,10,742,1,4,'Kiriichimonji: Permanent Wounds','Akame possui uma Shingu, um armamento próximo à um armamento imperial, mas com menos poder. Kiriichimonji é uma espada onde todas as feridas feitas por ela, nunca se curam.','3.png'),(8946,12,742,1,4,'Crescent Blade','Akame desfere um corte muito rápido, deixando um rastro de luz parecido com uma lua crescente.','4.png'),(8947,17,742,1,4,'Sonic Blade','Akame se move muito rápido, cortando o inimigo sem que ele perceba.','5.png'),(8948,19,742,1,4,'Eliminate!','Akame desfere um corte vertical no inimigo, cortando-o em dois.','6.png'),(8949,24,742,1,3,'Trump Card','Akame usa seu trunfo, se cortando com a espada Murasame e injetando o veneno em si mesma. Símbolos vermelhos aparecem em seu corpo e o branco dos olhos se tornam negros e sua velocidade e força aumentam insanamente. Esse trunfo só pode ser usado se o usuário tomar total responsabilidade pelas vidas que ele tomou.','7.png'),(8950,26,742,1,4,'Scarlet Blade','Akame se movimenta em uma velocidade extremamente alta, surpreendendo seus inimigos e os cortando em pedaços em meio uma gigantesca lua de sangue.','8.png'),(8951,31,742,1,4,'Phantom Murasame','Akame usa seu trunfo e se movimenta numa velocidade extremamente alta, fazendo com que o inimigo perca a noção e crie uma ilusão onde Akame está atacando e imediatamente tenta contra-atacar o nada. Aproveitando a brecha do inimigo, Akame ataca por cima, cortando-o em dois.','9.png'),(8952,35,742,1,3,'One-Cut Killer: Murasame','Akame desfere um golpe usando sua arma imperial Murasame. Um simples corte dessa espada injeta um veneno letal, sem antídoto, que mata o inimigo em poucos segundos.','10.png'),(8953,2,743,1,2,'Martial Arts Assault','Akame se move rapidamente e desfere poderosos chutes e soc