 Wave','Gohan libera todo o seu ki de uma só vez, criando uma explosão que devasta tudo.','6.png'),(9249,24,772,1,5,'Makankousappou','Gohan dispara um poderoso raio com seus dedos que podem atravessar facilmente qualquer coisa.','7.png'),(9250,26,772,1,3,'Hyper Masenko','Gohan concentra energia em uma só mão e lança sua técnica Masenko com um poder muito maior do que o normal.','8.png'),(9251,31,772,1,3,'Super Kamehameha','Muito mais poderoso que um simples Kamehameha, utilizando muito mais Ki, mas causando um estrago muito maior.','9.png'),(9252,35,772,1,2,'Fierce Combination','Gohan joga o inimigo no ar e desfere uma sequência de chutes e socos e o joga de volta para o chão e por último, lança um poderoso kamehameha enquanto o inimigo está no chão.','10.png'),(9253,2,773,1,2,'Disarm Punisher','Grande Saiyaman usa os dois dedos para roubar o fuzil do inimigo e lhe dar uma bela coronhada.','1.png'),(9254,5,773,1,3,'Masenko','Grande Saiyaman junta suas mãos acima de sua cabeça, e dispara um poderoso raio de energia.','2.png'),(9255,10,773,1,3,'Justice Kamehameha','Grande Saiyaman concentra uma grande quantidade de Ki em suas mãos e a dispara como um canhão.','3.png'),(9256,12,773,1,2,'Justice Kick','Grande Saiyaman avança para cima do inimigo e gira seu corpo, acertando um chute giratório muito poderoso.','4.png'),(9257,17,773,1,1,'Electric Kamehameha','Grande Saiyaman concentra uma grande quantidade de Ki e eletricidade em suas mãos e a dispara como um canhão dando uma descarga elétrica no inimigo.','5.png'),(9258,19,773,1,5,'Makankousappou','Grande Saiyaman dispara um poderoso raio com seus dedos que podem atravessar facilmente qualquer coisa.','6.png'),(9259,24,773,1,3,'Ultimate Masenko','O Masenko de Gohan na sua versão mais poderosa, soltando um gigantesco raio de energia dourada.','7.png'),(9260,26,773,1,3,'Super Kamehameha','Muito mais poderoso que um simples Kamehameha, utilizando muito mais Ki, mas causando um estrago muito maior.','8.png'),(9261,31,773,1,2,