ço e ao mesmo tempo rouba o calor do braço do inimigo, congelando-o instantaneamente.','5.png'),(9318,19,779,1,3,'Za Warudo, Toki yo Tomare!','Dio usa a habilidade especial de sua stand para parar o tempo em uma região por cinco segundos.','6.png'),(9319,24,779,1,5,'Checkmate-da!','Dio para o tempo próximo de seu inimigo, saca incontáveis facas de suas vestimentas e as lança contra ele. Pelo estar parado, as facas ficam flutuando ao redor do inimigo e assim que Dio faz o tempo correr novamente, todas as facas o acertarão com toda certeza.','7.png'),(9320,26,779,1,1,'Vaporization Freezing Technique Enhanced','Dio se defende de um golpe do inimigo e usa a técnica de congelamento. Desta vez mais poderosa, congelando todo o corpo do inimigo e o destruindo em seguida.','8.png'),(9321,31,779,1,3,'Joestar Blood Power-up','Dio suga o sangue de Joseph Joestar para obter total sincronia com o corpo roubado de Jonathan Joestar e ser capaz de usar seu poder ao máximo.','9.png'),(9322,35,779,1,4,'Road Roller-da!','Dio após absorver o sangue de Joseph, obtém o máximo de seus poderes, podendo parar o tempo por exatos nove segundos. Tempo suficiente para ele encontrar um rolo compressor e jogar em cima do inimigo e para finalizar, aplicar incontáveis socos em cima do veículo usando sua stand.','10.png'),(9323,2,780,1,2,'Hamon Overdrive','Zeppeli aplica um golpe de karatê com hamon concentrado, transferindo hamon para o corpo do inimigo através do ponto em que foi golpeado.','1.png'),(9324,5,780,1,1,'Hamon Water Walk','Zeppeli ao colocar as mãos sobre a água de um rio, é capaz de transferir uma pequena quantidade de hamon que o permite andar sobre ela.','2.png'),(9325,10,780,1,2,'Zoom Punch','Zeppeli usa o hamon para suprimir a dor em seu braço e então, suas juntas se separam e seu punho estica, aumentando o alcance de seu soco.','3.png'),(9326,12,780,1,2,'Sendo Wave Kick','Zeppeli concentra hamon em sua perna e desfere uma joelhada no inimigo.','4.png'),(9327,17,780,1,5,'Hamon Cutter','Zeppeli bebe vinho e o mantém em sua boca para que ele possa transferir hamon para o liquido. Em seguida, Zeppeli cospe o liquido na forma de shurikens. O Hamon inserido no liquido o torna tão afiado e denso que é capaz de cortar até o mais resistente objeto.','5.png'),(9328,19,780,1,3,'Hamon Maximum Charge','Zeppeli se afasta do inimigo para que ele possa se concentrar em controlar sua respiração e então usar todo o seu poder.','6.png'),(9329,24,780,1,3,'Life Magnetism Overdrive','Zeppeli usa o pequeno pulso magnético em seu corpo em conjunto com o hamon, amplificando esse pulso magnético. Em seguida, Zeppeli toca em folhas de árvores jogadas no chão e transfere esse pulso magnético à elas, as transformando em um imã gigante.','7.png'),(9330,26,780,1,2,'Sunlight Yellow Overdrive','Zeppeli toca o braço do inimigo e transfere uma enorme quantidade de hamon, o fazendo se desintegrar.','8.png'),(9331,31,780,1,2,'Tornado Overdrive','Zeppeli salta e aponta seus pés para a cara do inimigo. Concentrando energia na sua metade de baixo, Zeppeli faz um movimento giratório, simulando um tornado que vai na direção do inimigo.','9.png'),(9332,35,780,1,2,'Deep Pass Overdrive','Zeppeli a beira da morte, transfere todo seu hamon para seu aprendiz, o fortalecendo o suficiente para derrotar seu inimigo.','10.png'),(9333,2,781,1,3,'Hamon Hair Attack','Joseph arranca um maço de cabelo de uma pessoa próxima e insere hamon nele, os deixando super resistentes para criar uma barreira de hamon muito poderosa.','1.png'),(9334,5,781,1,4,'Clacker Volley','Joseph usa o brinquedo americano Clacker com hamon inserido para atacar o inimigo.','2.png'),(9335,10,781,1,2,'Rebuff Overdrive','Joseph concentra hamon em seus dois cotovelos e então acerta uma cotovelada dupla no inimigo.','3.png'),(9336,12,781,1,5,'Thompson Machine Gun','Joseph esconde debaixo de seu casaco, uma metralhadora Thompson e quando o inimigo baixa a guarda, à puxa e descarrega todas as balas do pente nele.','4.png'),(9337,17,781,1,2,'Sunlight Yellow Overdrive','Joseph toca o braço do inimigo e transfere uma enorme quantidade de hamon, o fazendo se desintegrar.','5.png'),(9338,19,781,1,5,'Clacker Boomerang','Joseph joga o brinquedo clacker na direção do inimigo, errando de propósito para que ele baixe a guarda. O brinquedo tinha hamon inserido e Joseph faz com que ele volte como um bumerangue e pegue o inimigo por trás.','6.png'),(9339,24,781,1,3,'Joestar\'s Secret Technique: Run Away!','Joseph como último recurso, usa a técnica secreta dos Joestar, dar no pé. Adquirindo tempo para pensar em alguma estratégia enquanto corre.','7.png'),(9340,26,781,1,1,'Firestorm','Joseph coloca granadas nas vestimentas do inimigo sem que ele perceba, saindo de perto e puxando o pino das granadas com um fio enrolado nelas.','8.png'),(9341,31,781,1,3,'Hamon String Overdrive','Joseph usa linhas de lã para emboscar o inimigo. Linhas de lã são grandes condutores de hamon e Joseph as usa para passar uma enorme quantidade de hamon por todo o corpo do inimigo.','9.png'),(9342,35,781,1,5,'Iron Bowgun','Joseph atira um balaço usando uma besta grande, fazendo o balaço rebater pelas paredes do lugar e acerte o coração do inimigo pelas costas.','10.png'),(9343,2,782,1,3,'Psychic Photography','Joseph pode usar sua stand para criar fotografias psiquicas que mostram o local em que o inimigo se esconde, tudo isso a custo de uma câmera.','1.png'),(9344,5,782,1,4,'Clacker Volley','Joseph usa o brinquedo americano Clacker com hamon inserido para atacar o inimigo.','2.png'),(9345,10,782,1,2,'Rebuff Overdrive','Joseph concentra hamon em seus dois cotovelos e então acerta uma cotovelada dupla no inimigo.','3.png'),(9346,12,782,1,5,'Hermit Purple Grab','Joseph usa as vinhas de sua stand para se salvar de projéteis inimigos, os agarrando em pleno ar.','4.png'),(9347,17,782,1,2,'Hermit Purple Overdrive','Joseph faz com que as vinhas de sua stand se enrolem no inimigo, possibilitando a transmissão de hamon.','5.png'),(9348,19,78