igo e finaliza com um Emerald Splash com todo poder.','10.png'),(9403,2,788,1,2,'Red Bind','Avdol usa sua stand para lançar duas chamas que se enrolam no inimigo e o prendem.','1.png'),(9404,5,788,1,2,'Hell Flames','Avdol da um jeito de se aproximar do inimigo e o toca no ombro, fazendo seu corpo pegar fogo.','2.png'),(9405,10,788,1,5,'Napalm Bomb','Avdol faz com que sua stand atire bolas de fogo pela boca.','3.png'),(9406,12,788,1,3,'Life Detector','Avdol faz com que sua stand crie uma espécie de candelábro de fogo. Este candelábro pode detectar a presença do inimigo nas redondezas.','4.png'),(9407,17,788,1,1,'Crossfire Hurricane','Avdol faz com que sua stand atire pela boca, uma chama na forma de uma cruz ansata, capaz de incinerar o inimigo por completo.','5.png'),(9408,19,788,1,2,'Purple Bind','Avdol usa chamas roxas, mais poderosas que as normais e faz com que sua stand lance duas chamas que se enrolam no inimigo e o prendem com muito mais força.','6.png'),(9409,24,788,1,5,'Purple Bomb','Avdol faz com que sua stand atire bolas de fogo roxas pela boca, muito mais destrutivas.','7.png'),(9410,26,788,1,1,'Purple Crossfire Hurricane','Avdol usa a sua técnica Crossfire Hurricane com as chamas de coloração roxa, a deixando muito mais poderosa do que antes.','8.png'),(9411,31,788,1,5,'Crossfire Hurricane Special','Avdol pode manipular as chamas a seu bel-prazer, usa sua técnica Crossfire Hurricane com as chamas roxas e ainda a separa em pedaços menores, diminuindo as chances do inimigo escapar.','9.png'),(9412,35,788,1,1,'Shokunetsu no Ankh','Avdol faz com que sua stand atire chamas contra o chão, abrindo um buraco para que ele controle as chamas e pegue o inimigo desprevenido por baixo com um Crossfire Hurricane usando chamas roxas.','10.png'),(9413,2,789,1,4,'Direct Hit','Polnareff avança com sua stand e desfere um golpe de espada diretamente no peito do inimigo.','1.png'),(9414,5,789,1,1,'Liquid Surprise','Polnareff se passa por um aliado e distrai o inimigo, lhe o