ua espada para direcionar a luz do sol e cegar seu oponente temporariamente.','1.png'),(9514,5,798,1,4,'Horizontal Cut','Hijikata surpreende o adversario com um corte rapido na horizontal que causa grande dano.','2.png'),(9515,10,798,1,2,'Direct Blow','Hijikata realiza um golpe direto na parte direita do adversario, quebrando suas costelas e diminuindo sua capacidade de luta.','3.png'),(9516,12,798,1,4,'Double Cut','Hijikata aumenta a velocidade do seu corte e realiza dois ataques de uma só vez deixando o oponente a beira da morte.','4.png'),(9517,17,798,1,4,'Silent Murder','Hijikata se move silenciosamente para as costas do inimigo e realiza um golpe rápido e silencioso que o mata na hora.','5.png'),(9518,19,798,1,4,'Reverse Slash','Hijikata fica de cabeça para baixo e realiza um corte invertido diretamente no ombro do adversario o deixando incapaz de lutar.','6.png'),(9519,24,798,1,4,'Impact Attack: Launch','Hijikata fica em uma certa distância do inimigo para pegar impulso e então realizar um golpe perfurante de baixo para cima que joga o adversario para longe.','7.png'),(9520,26,798,1,4,'Bloody Flash','Hijikata realiza um corte rápido e preciso que corta uma arteria do inimigo, causando hemorragia e o levando a morte.','8.png'),(9521,31,798,1,4,'Glimmer End','Hijikata utiliza todas suas forças para desferir um corte extremamente rápido, invisível a olho nú, deixando um rastro de luz. ','9.png'),(9522,35,798,1,4,'Instant Kill','Hijikata se afasta do inimigo e usa toda sua concentração e força para utilizar um corte perfurante diretamente no coração do inimigo, causando morte instantânea e sem chance de reação.','10.png'),(9523,2,799,1,3,'Intimidating Look','Shinpachi faz um olhar intimidador que faz com que o inimigo fique paralisado e sem reação.','1.png'),(9524,5,799,1,4,'Baka Advance','Shinpachi avança igual um idiota e faz com que o inimigo fique surpreso, abrindo assim, uma brecha para que ele possa atacar.','2.png'),(9525,10,799,1,2,'Shinpachi Right Jab','S