ar alguma tragédia, em outras palavras, evitar anormalidades na linha do tempo e isso é um processo involuntário.','5.png'),(9538,19,800,1,1,'Stun Gun','Satoru monta uma arma imobilizadora com uma câmera fotográfica descartável e a usa para imobilizar o inimigo.','6.png'),(9539,24,800,1,3,'Butterfly Effect','Quando o fenômeno Revival ocorre, Satoru tem a livre escolha de interferir ou não interferir naquela linha do tempo. Ao causar mudanças mínimas na linha temporal em que ele foi tirado, um novo futuro é escrito e mudanças que podem ou não, ser muito significantes, ocorrem.','7.png'),(9540,26,800,1,2,'Flame Tackle','Satoru se joga no meio de chamas, sai rapidamente e faz uma investida contra o inimigo.','8.png'),(9541,31,800,1,4,'Shinigami','Satoru decide interferir negativamente no fluxo temporal, assassinando seu inimigo com uma faca antes dele pensar em fazer algo.','9.png'),(9542,35,800,1,3,'Time Ruin','Satoru interfere no fluxo temporal de tal maneira que acaba causando a destruição de seu futuro conhecido, chegando em um futuro onde a raça humana foi completamente extinta.','10.png'),(9543,2,801,1,5,'Paper Plane','Satoru enquanto está escondido, faz um avião de papel e o atira no ar, criando uma distração para fugir do inimigo.','1.png'),(9544,5,801,1,3,'Ambush','Satoru descobre os planos do inimigo e arma uma emboscada para ele.','2.png'),(9545,10,801,1,5,'Death Threat','Satoru escreve \"Vou te Matar\" em um papel e o usa para embrulhar uma pedra. Em seguida, a joga no local em que o inimigo reside, o deixando aflito devido a mensagem no papel.','3.png'),(9546,12,801,1,2,'Blood Eyes','Satoru sente uma ira incessável e seus olhos ficam vermelhos e então, se move rapidamente por de trás do inimigo, o empurrando com tamanha força capaz de matá-lo na queda.','4.png'),(9547,17,801,1,3,'Revival','Satoru possui um poder misterioso que ele mesmo chama de Revival. Permite a ele que volte no tempo para evitar alguma tragédia, em outras palavras, evitar anormalidades 