ar.','6.png'),(9569,24,803,1,2,'Intergalactical Fist','Chitoge desfere um soco especial que não pode ser bloqueado, sendo capaz de jogar o inimigo para fora do planeta.','7.png'),(9570,26,803,1,5,'Beehive Gang','Chitoge é a herdeira da gangue Beehive, muito conhecida no Japão. Ao se deparar com o inimigo, Chitoge assobia e todos os membros de sua Gangue aparecem armados com armas de fogo para ajudá-la.','8.png'),(9571,31,803,1,1,'Hellfire Fist','Chitoge envolve seu punho em chamas e aplica um soco no ar, fazendo com que as chamas cheguem até o inimigo e o incinerem.','9.png'),(9572,35,803,1,4,'Madam Flower','A mãe de Chitoge é uma pessoa assustadora, tanto que até Chitoge tem medo dela. Quando Chitoge se encontra em apuros, sua mãe aparece para salvá-la e usa o inimigo para testar todo o seu conhecimento sobre tortura.','10.png'),(9573,2,804,1,1,'Psychotic Break','Hachiman surta ao ouvir algo que não gosta vindo de seu inimigo e então começa a gritar feito louco até ensurdecê-lo.','1.png'),(9574,5,804,1,4,'Nervous Breakdown','Hachiman pensa que trabalho é perder. Quando ele é obrigado a trabalhar enquanto outros relaxam, ele tem um ataque de fúria e ataca com o objeto mais próximo, qualquer pessoa nas redondezas.','2.png'),(9575,10,804,1,3,'Growl','Hachiman tenta intimidar o inimigo fazendo cara feia e rosnando como um animal raivoso.','3.png'),(9576,12,804,1,1,'Eulen Sylphid','Hachiman usa uma raquete de tênis para lançar algum objeto no inimigo e aproveita o vento do local para enganá-lo.','4.png'),(9577,17,804,1,2,'Hikki Team','Hachiman coloca a mão no ombro de um de seus colegas e o convence a ajudá-lo a atacar o inimigo.','5.png'),(9578,19,804,1,3,'Stealth Hikki','Hachiman depois de anos de experiência em ser solitário, desenvolveu uma técnica onde sua presença é apagada completamente, possibilitando ataques furtivos.','6.png'),(9579,24,804,1,1,'Eighth Combustion','Hachiman quando era mais jovem, possuía a síndrome da oitava série. Uma síndrome onde a pessoa foge da realidade e pensa estar em um mundo de fantasia onde poderes existem. Hachiman se autoproclamava Deus das Chamas e seu golpe mais poderoso era a \"Oitava Combustão\", onde ele conseguia queimar qualquer coisa em oito segundos.','7.png'),(9580,26,804,1,3,'Perfect Analysis','Ao longo da sua vida de solitario, Hachiman desenvolveu a sua maior característica, seus \"olhos podres\" que são capazes de ver através da bondade e simpatia dos \"normalfags\", mostrando as suas verdadeiras intenções e desejos.','8.png'),(9581,31,804,1,5,'Meteor Strike','Hachiman usa uma raquete de tênis e usa o lado da raquete para bater em algum objeto que sirva como projétil, o lançando para bem alto e cair exatamente onde o inimigo está.','9.png'),(9582,35,804,1,3,'Genuine Analysis','Hachiman analisa seu inimigo completamente e decide usar a verdade como arma, derrubando a máscara do oponente e o deixando abalado psicológicamente.','10.png'),(9583,2,805,1,2,'Sharp Finger','Chitoge usa a ponta do dedo para machucar o rosto do inimigo.','1.png'),(9584,5,805,1,5,'Class Destroyer','Chitoge, como um navio Destroyer, é capaz de derrotar diversos inimigos com seus poderosos canhões.','2.png'),(9585,10,805,1,2,'Gorilla Hook','Chitoge é apelidada de Garota Gorila por Raku devido sua força sobre-humana. Ao ficar nervosa, Chitoge desfere um poderoso gancho, jogando o inimigo para longe.','3.png'),(9586,12,805,1,5,'12.7cm Twin Gun Mount','Chitoge manda seus Rensouhou cercarem e atirarem no inimigo com as metralhadoras.','4.png'),(9587,17,805,1,3,'Chitoge Yellow Special Beam','Chitoge aponta sua mão na direção do inimigo e lança um raio amarelo que acerta em cheio o rosto dele.','5.png'),(9588,19,805,1,5,'61cm Quadruple Torpedo Mount','Chitoge atira quatro torpedos de suas costas para explodir seus inimigos.','6.png'),(9589,24,805,1,2,'Intergalactical Fist','Chitoge desfere um soco especial que não pode ser bloqueado, sendo capaz de jogar o inimigo para fora do planeta.','7.png'),(9590,26,805,1,5,'