INSERT INTO `graduation_descriptions` VALUES (1,1,1,1,'Ninja Estudante','Você está aprendendo as técnicas básicas de um ninja, para um dia receber sua bandana e começar a vida ninja.'),(2,2,1,1,'Genin','Seu primeiro dia depois da academia ninja, hoje você vai receber sua bandana e graduar-se com um ninja da aldeia. Com esta graduação é possível explorar o que esta além do portão da Vila, combater inimigos, fazer aliados, executar diferentes tipos de missões, aprender golpes basicos e ajudar a proteger sua vila. Não se esqueça de continuar o seu treinamento para assim alcançar a próxima graduação. '),(3,3,1,1,'Chuunin','Ninja graduado e com elevado nível de confiança na Vila, possui grande conhecimento na arte ninja e possui habilidades como controlar o primeiro elemento, fazer missões mais arriscadas Rank C, pode participar de equipes e organizações e participar dos torneios ninjas.'),(4,4,1,1,'Jounin','Ninja com grande nível de conhecimento sobre a arte ninja e batalhas, possui diversas especialidades como controlar o segundo elemento, fazer missões mais perigosas de nível Rank B, pode ser responsável por uma Organização e pode também participar de diversos torneios entre jounins.'),(5,5,1,1,'Sannin','São ninjas extraordinários, ninjas capazes de usar uma quantidade muito grande de jutsus e levar uma batalha há durar muito tempo. Podem aprender a última habilidade de clã e invocação, participar de torneios, liderar equipes e organizações a invadirem e guerrear contra outras Vilas, é o único capaz de realizar missões de nível S e os mais próximos de se tornarem Kages.'),(6,6,1,1,'Herói','É o ninja mais forte da Vila, seus conhecimentos e poder não se comparam a nenhuma outra graduação. Para se tornar um Kage o ninja precisa passar por todas as graduações e ainda assim se tornar o melhor entre os melhores. Podem fazer todos os tipos de missões, tem o maior número de habilidades Ninjutsu, Taijutsu, Genjutsu treinadas. Realiza missões S ou SS que são as mais arriscadas e defendem a Vila com todas as forças e caso necessário com a própria Vida.'),(13,1,1,2,'Aprendiz Espiritual','Seu primeiro dia depois da academia espiritual, na qual você aprendeu habilidades físicas e espirituais capazes de te ajudar em suas batalhas.'),(14,2,1,2,'Konsou','Reconhecido como membro da organização de seu mundo de origem.'),(15,3,1,2,'Membro','Conhecedor de diversas magias de Arte Destrutiva, Kidou, baseado em Reiatsu.'),(16,4,1,2,'Usuário do Zankensoki','Após um treinamento intensivo, é capaz de lecionar tais fundamentos de batalhas na Academia.'),(17,5,1,2,'Tenente','Um dos níveis mais elevados dentro do Gotei 13. Auxilia seu Capitão e comanda o esquadrão em sua ausência ou ordem.'),(23,6,1,2,'Capitão','Capitão de um dos poderosos Esquadrões, o Gotei 13. Cada esquadrão tem uma especialização e cabe ao Capitão dominar essa especialização para que o Supremo Comandante saiba quem enviar em determinadas situações. Além de possuir uma Bankai, Capitães são conhecidos por sua força e inteligência em combate.'),(25,1,1,3,'Lutador','Um aspirante a Campeão, que treinou e ainda treina duro para combater seus oponentes'),(27,2,1,3,'Guerreiro','Após mostrar sua capacidade, um Lutador vira um Guerreiro e enfrenta diversos oponentes poderosos.'),(29,3,1,3,'Campeão','O Campeão é aquele que já venceu diversos torneios de artes marciais e por ter obtido varias vitórias mesmo fora dos torneios.'),(31,4,1,3,'Protetor','Após mostrar suas habilidades de Campeão, é designado como o Protetor.'),(33,5,1,3,'Guardião','Nomeado Guardião após ter batalhado inúmeras vezes como Protetor.'),(35,6,1,3,'Guerreiro Z','O grupo que se formou espontaneamente para defender o planeta, os Guerreiros Z reunem os guerreiros mais poderosos do planeta e conta com diversas raças que trabalham em conjunto para um bem maior.'),(37,1,1,4,'Recruta','Se torna um recruta para treinar suas habilidades no mar.'),(39,2,1,4,'Marujo','Torna-se parte de uma tripulação e começa a enfrentar os mais diversos inimigos.'),(41,3,1,4,'Pirata','A brisa do mar já passa pelo seu rosto e seus poderes fluem mais naturalmente.'),(43,4,1,4,'Capitão','Você foi reconhecido por toda tripulação e o antigo capitão do seu navio, e dessa vez você que comanda o seu próprio navio.'),(45,5,1,4,'Comandante','Sua incrível capacidade de comandar tropas e seu poder imenso fez com que você se tornasse um poderoso Comandante.'),(47,6,1,4,'Rei dos Piratas','O Rei dos Piratas é o homem (ou mulher) mais poderoso dos mares. É temido pelo mundo todo pelo seu poder devastador. O Rei dos Piratas é a pessoa com mais liberdade no mundo todo.'),(49,1,1,5,'Aprendiz de Mago','Cria afinidade com a magia e aprende a controlá-la aos poucos.'),(51,2,1,5,'Mago','Tendo um controle completo de sua magia, você já foi reconhecido como um Mago de verdade.'),(53,3,1,5,'Mago Experiente','Você tem um grande controle dos seus poderes e é reconhecido pelos oponentes mais poderosos.'),(55,4,1,5,'Mago Classe-A','Um dos magos mais poderosos que existem, capazes de enfrentar hordas de inimigos de uma vez.'),(57,5,1,5,'Mago Classe-S','São os magos de elite, considerados os magos mais poderosos de uma guilda. São capazes de fazer as missões mais difíceis e ainda voltar com vida (por pouco). Os Magos Classe-S sabem balancear seu coração e cérebro, maximizando seus poderes.'),(59,6,1,5,'Mago Santo','São os magos mais poderosos que existem. Seu poder é tão imenso, que são conhecidos no mundo todo. Controlam perfeitamente o fluxo de mana dentro de si, tendo um balanceamento entre seu corpo e mente e lhes permitindo usar as mais poderosas magias.'),(61,1,1,6,'Aspirante a Cavaleiro','Desenvolve habilidades de luta e o desejo de lutar por sua deusa.'),(63,2,1,6,'Principiante no Cosmo','Todo ser humano possui Cosmo, e o Principiante entende os conceitos básicos de uso do Cosmo para aumentar suas habilidades.'),(65,3,1,6,'Guerreiro Sagrado','Além de proteger sua deusa, protege também o que sua deusa quer proteger.'),(67,4,1,6,'Cavaleiro do Milagre','Consegue realizar coisas impossíveis elevando seu Cosmo a um nível inimaginável.'),(69,5,1,6,'Transcendente do Cosmo','Capaz de elevar seu Cosmo ao mais amplo nível, capaz de andar e ter consciencia nos lugares onde somente os deuses caminham.'),(71,6,1,6,'Guardião Celestial','Fiel protetor da sua Deusa, um experiente cavaleiro que já passou por diversas lutas, para proteger sua deusa e seus valores. É capaz de elevar o Cosmo ao seu limite, quebrando a barreira do imaginável e derrotando os inimigos mais poderosos.'),(73,1,1,7,'Detetive Espiritual','Pode ver o Mundo Espiritual e usar ferramentas espirituais.'),(75,2,1,7,'Classe D','Segunda classe mais fraca. Não são muito inteligentes, mas sua força é acima de humanos comuns.'),(77,3,1,7,'Classe C','É a força mais comum entre os demônios. Ainda não são muito fortes, mas são mais fortes que as classes anteriores.'),(79,4,1,7,'Classe B','Classe onde sua força começa a desenvolver muito rapidamente. São extremamente mais fortes que as classes anteriores e podem passar livremente por barreiras espirituais.'),(81,5,1,7,'Classe A','É uma classe com uma força excepcional, podendo ser comparado aos soldados dos Três Reis Demônios. Podem livremente passar por barreiras espirituais e derrotar facilidade qualquer outra classe, menos a Classe S.'),(83,6,1,7,'Classe S','A Classe S é a classe mais forte que existe, podendo devastar uma área gigantesca em apenas um piscar de olhos. Somente um Classe S pode derrotar quinhentos Classe A sem nenhum esforço.'),(85,1,1,8,'Hunter Amador','São pessoas que se oferecem para trabalhar sem ter uma licença Hunter oficial.'),(87,2,1,8,'Hunter Licenciado','São pessoas que passaram no Exame Hunter e se tornaram Hunters de verdade, mas ainda não sabem usar o Nen adequadamente.'),(89,3,1,8,'Hunter Profissional','São Hunters que passaram no Exame Hunter e aprenderam a usar o Nen.'),(91,4,1,8,'Hunter de 1 Estrela','São Hunters que possuem um grande controle de Nen e que deram uma grande contribuição para a sociedade. Também é conhecido como Single Hunter.'),(93,5,1,8,'Hunter de 2 Estrelas','São Hunters que possuem um enorme controle de Nen e que deram uma grande contribuição para a sociedade em diversas áreas. Também é conhecido como Double Hunter.'),(95,6,1,8,'Hunter de 3 Estrelas','São Hunters que possuem um controle perfeito de Nen e que deram uma grande contribuição para a sociedade global, ou fez uma descoberta histórica. Também é conhecido como Triple Hunter.'),(97,1,1,9,'Jogador Casual','São pessoas que acabaram de entrar no mundo online, mas ainda não estão muito interessadas. Jogam apenas para passar o tempo, e não se importam de perder, contanto que se divirtam.'),(99,2,1,9,'Jogador Iniciante','É o jogador que decide que quer continuar jogando, e começa a estudar mais a fundo os sistemas do jogo, aprendendo a manusear diferentes armas.'),(101,3,1,9,'Jogador Intermediário','É o jogador que já se acostumou ao jogo, porém ainda tem muito o que aprender sobre o mundo online.'),(103,4,1,9,'Jogador Experiente','É o jogador que possui grande habilidade no jogo e sabe usar algumas magias e armas. Conhece grande parte do território e são responsáveis por ajudar os jogadores iniciantes.'),(105,5,1,9,'Jogador Profissional','É o jogadore que conhece o jogo inteiro e sabe usar a maioria das armas e magias disponíveis.'),(107,6,1,9,'Jogador de Elite','Jogadores de Elite são aqueles que alcançaram o nível mais alto do jogo e são considerados os mais fortes e temíveis jogadores. Sabem lutar usando qualquer tipo de arma ou magia, podendo se adaptar à qualquer situação.'),(109,1,1,10,'Garota Colegial','São pessoas que ainda são estudantes do colegial, e ainda desconhecem o poder mágico.'),(111,2,1,10,'Guerreira Mágica','É a garota que acabou de ganhar seus poderes mágicos e ainda está conhecendo sobre o mundo e os acessórios mágicos.'),(113,3,1,10,'Bela Guardiã','A garota aprende a dominar seus novos poderes e se torna a Guardiã deste mundo.'),(115,4,1,10,'Guerreira do Amor e da Justiça','Se torna uma das Guerreiras Mágicas mais poderosas que existem, espalhando o amor pelo mundo e purificando todo o mal.'),(117,5,1,10,'Princesa Celestial','A guerreira se torna tão poderosa que é reconhecida como a Princesa de seu planeta protetor.'),(119,6,1,10,'Rainha Celestial','A Princesa libera todo seu poder e se torna a Rainha do seu planeta, tendo até mesmo o poder de invocar seu castelo e seus cavaleiros para protegê-la.'),(121,1,1,11,'Aprendiz de Alquimia','Um iniciado nas artes de manipulação e alteração da matéria.'),(123,2,1,11,'Estudante de Alquimia','Já conhece os principios básicos de compreensão, destruição e reestruturação e consegue aplicá-los bem ao seu dia-a-dia como alquimista'),(125,3,1,11,'Alquimista','Já domina a transmutação e pode entrar em combates mais perigosos.'),(127,4,1,11,'Alquimista Combatente','Um alquimista treinado para combate, antes ou depois de seus conhecimentos alquimicos, introduz a alquimia para o combate.'),(129,5,1,11,'Alquimista do Estado','Um Alquimista do Estado, é um Major do exército, tem acesso a diversas pesquisas e aqruivos secretos do governo de Amestria.'),(131,6,1,11,'Mestre Alquimista','Um Alquimista que já viu muita coisa na vida, conhecedor de diversos círculos e runas, capaz ainda de ter conhecido o Portão da Verdade. Um mito talvez.'),(133,1,1,12,'Mafioso','Descobre que é descendente de uma família mafiosa.'),(135,2,1,12,'Subordinado','Se torna oficialmente membro de uma família mafiosa e passa a servir o seu Chefe.'),(137,3,1,12,'Usuário da Chama','Recebe um Anel das Chamas e passa a controlar seus poderes em combate.'),(139,4,1,12,'Guardião da Máfia','Se torna um Guardião oficial do Chefe da Máfia, protegendo-o com sua vida. Seus poderes das Chamas estão muito mais poderosos.'),(141,5,1,12,'Mão-Direita da Máfia','Se torna tão poderoso que você é escolhido para se tornar a Mão-Direita do Chefe da Máfia, e o segundo no comando de toda a família.'),(143,6,1,12,'Chefe da Máfia','Seus poderes são inigualáveis à qualquer membro da sua família. Você possui uma Chama rara e ninguém é capaz de vencê-lo.'),(145,1,1,29,'Sobrevivente','Um sobrevivente do ataque dos titãs à humanidade.'),(147,2,1,29,'Militar em Treinamento','Entra no exército e aprende a usar seu 3DMG, descobrindo como é seu estilo de combate.'),(149,3,1,29,'Guarda Estacionária','Com um bom domínio do 3DMG na região urbana, você se torna capaz de proteger a muralha de ataques de titãs pequenos.'),(151,4,1,29,'Policial Militar','Suas habilidades de combate são reconhecidas e você é designado para proteger diretamente o Rei, conseguindo enfrentar titãs ainda maiores.'),(153,5,1,29,'Explorador','Você usa o emblema das Asas da Liberdade e é designado para sair das muralhas e explorar o mundo em busca de esperança, sendo capaz de lutar em florestas.'),(155,6,1,29,'Salvador da Humanidade','Você vira uma lenda do combate usando o 3DMG e combate corpo-a-corpo, sendo capaz de derrotar absolutamente qualquer titã em qualquer lugar, seja dentro da cidade, da floresta ou até mesmo em campo aberto.'),(157,1,1,999,'Estrela em Ascensão','Você é um iniciante nesse novo mundo de batalhas e precisa aprender o básico dos combates.'),(159,2,1,999,'Estrela','Agora você já é um lutador de verdade em busca de reconhecimento, enfrentando batalhas reais contra os mais diversos oponentes.'),(161,3,1,999,'Estrela Famosa','Você passa a ser reconhecido e com isso sua confiança aumenta e suas habilidades se tornam surpreendentes.'),(163,4,1,999,'Estrela Sonhadora','A fama já não basta para você e seus sonhos ficam maiores, melhorando cada vez mais suas habilidades.'),(165,5,1,999,'Super Estrela','Você se torna uma Super Estrela e é reconhecido no seu mundo inteiro devido às suas habilidades em combate.'),(167,6,1,999,'All-Star','Você chega no auge do seu poder e se torna um All-Star, um dos lutadores mais poderosos de todos os universos, idolatrado pelas pequenas Estrelas e respeitado pelos outros lutadores de seu nível.'),(169,1,1,30,'Humano','Ainda um simples humano, sem poderes especiais.'),(171,2,1,30,'Ghoul','Você se torna um Ghoul, uma criatura carnívora que devora humanos, mas ainda possui a mesma aparência física e inteligência que um humano comum.'),(173,3,1,30,'Meio Kakuja','Após se tornar um canibal e devorar outros Ghouls, você começa a evoluir sua armadura Kagune e perder a aparência humana.'),(175,4,1,30,'Kakuja','Assume a forma completa de um Kakuja, obtendo um poder imenso e perdendo completamente sua forma humana.'),(177,5,1,30,'Ghoul de Um Olho Artificial','Você é artificialmente um híbrido de humano e ghoul, sendo muito mais poderoso que um ghoul comum e desenvolvendo suas habilidades rapidamente.'),(179,6,1,30,'Ghoul de Um Olho Puro','Sendo filho de um ghoul masculino e uma humana feminina, você é um Ghoul de Um Olho Puro, sendo a espécie mais poderosa que existe.'),(181,1,1,31,'Aprendiz da Shibusen','Você acabou de se matricular na Escola de Artesãos e Armas da Shibusen, a partir de Agora você aprenderá o básico para manter o equilíbrio em Death City.'),(183,2,1,31,'Estudante da Shibusen','Após várias aulas você começa sua jornada para caçar ovos de Kishin, que são almas impuras corrompidas pelo mau e desejam mais poder, geralmente devorando almas boas. Agora você irá receber missões para coletar essas almas corrompidas para evitar que um verdadeiro Kishin nasça.'),(185,3,1,31,'Matador de Bruxas','Após coletar 99 ovos de Kishin, você deve conseguir uma alma de Bruxa para tornar sua Arma em uma Death Scythe. Mas bruxas são seres extremamente poderosos, nunca serão derrotadas facilmente , você terá que usar tudo o que você aprendeu para derrotá-las, mas lembre-se que se o Artesão e sua Arma não estiverem em completa harmonia, estarão fadados a perder.'),(187,4,1,31,'Mestre das Armas','Quando você coletar os 99 ovos de Kishin e a alma de uma Bruxa, sua arma se tornará uma Death Scythe, uma arma com poderes únicos que o próprio shinigami em pessoa irá usá-la, você será reconhecido por todos por ter conseguido algo tão grandioso.'),(189,5,1,31,'Líder da Shibusen','A partir do momento que você contribui com atos importantes para a escola, o próprio Shinigami irá lhe dar o cargo de líder quando ele precisar ficar ausente. É um cargo de grande importância que poucos são selecionados para o fazer, isso demonstra a confiança que todos sentem com você e com suas habilidades.'),(191,6,1,31,'Senhor Shinigami','Você se torna capaz de assumir o poder de toda a Shibusen, mas lembre-se que é o cargo mais importante pois toda Death City está em suas mãos, guie seus alunos para se tornarem grandes artesões e armas e continue a manter o equilibrio em Death City.'),(193,1,1,32,'Praticante de Kenjutsu','Você é um aluno de um Dojo em Tokyo ainda dando seus primeiros passos na arte do Kenjutsu.'),(195,2,1,32,'Mestre de Kenjutsu','Agora reconhecido como um Mestre na arte do Kenjutsu, você tem seu proprio dojo e alunos que vão se tornar grandes samurais um dia.'),(197,3,1,32,'Membro do Shinsengumi','Agora membro do Shinsengumi, um grupo sob comando direto do Xogunato e responsável por cuidar da segurança e ordem durante o Bakufu.'),(199,4,1,32,'Capitão da 1ª Divisão','Após muitas batalhas você se tornou capitão da 1ª Divisão, uma das poderosas do Shinsengumi.'),(201,5,1,32,'Sub-Comandante do Shinsengumi','Após muitas conquistas, você agora é o Sub-Comandante. Um dos mais poderosos e importantes de todo Shinsengumi.'),(203,6,1,32,'Comandante do Shinsengumi','Por suas Conquistas em Batalha você se tornou o Comandante de toda Shinsengumi e foi reconhecido como o mais forte, se tornando o maior na hierarquia do grupo.'),(205,1,1,16,'Humano','Ainda um simples humano, sem conhecimento mágico.'),(207,2,1,16,'Demônio de Classe Baixa','Reencarnado como um demônio, ganha a capacidade de fazer contratos e usar magia.'),(209,3,1,16,'Demônio de Classe Média-Inferior','Você está subindo aos poucos na hierarquia dos demônios e agora pode usar magias de nível médio-inferior.'),(211,4,1,16,'Demônio de Classe Média-Superior','Você ficou mais forte através de treinamentos e agora é capaz de usar magias de nível médio-superior.'),(213,5,1,16,'Demônio de Classe Alta','Agora como demônio de classe alta, você é reconhecido na hierarquia dos demônios e pode participar de reuniões que decidem o futuro do mundo dos demônios e participar de Rating Games.'),(215,6,1,16,'Rei Demônio','O Rank mais alto da hierarquia dos demônios e que pertence apenas ao demônio mais poderoso, aquele que irá comandar todo o inferno.'),(217,1,1,33,'Cavaleiro','Um simples cavaleiro sem poder algum.'),(219,2,1,33,'Aprendiz de Cavaleiro Sagrado','Você se tornou um aprendiz de cavaleiro sagrado e está começando a despertar poderes.'),(221,3,1,33,'Cavaleiro Sagrado','Após despertar e aprimorar seus poderes, você se torna parte da mais forte ordem de cavaleiros do reino.'),(223,4,1,33,'Cavaleiro Sagrado da Nova Geração','Você já participou de muitas batalhas e percebeu que seu poder não é suficiente, então aceita o sangue do demônio vermelho, despertando um poder totalmente novo e inimaginável.'),(225,5,1,33,'Cardeal','Agora você se tornou um dos mais poderosos e reconhecidos Cavaleiros Sagrados, estando abaixo apenas dos Grandes Cavaleiros Sagrados, recebendo o título de Cardeal.'),(227,6,1,33,'Grande Cavaleiro Sagrado','Depois de anos de treinamento e ter passado por incontáveis batalhas, você se tornou o mais poderoso de todos os cavaleiros e o responsável por proteger o reino de toda e qualquer ameaça.'),(229,1,1,35,'Civil','Um simples habitante de sua cidade.'),(231,2,1,35,'Heroi Sem Classificação','Desperta a vontade de lutar pelo bem, porém ainda não fez o teste da Associação dos Herois.'),(233,3,1,35,'Heroi Classe-C','Após realizar o teste e tirar uma nota não muito boa, você é classificado como um Classe-C, ajudando em pequenos trabalhos semanais.'),(235,4,1,35,'Heroi Classe-B','Após ter suas habilidades reconhecidas, você avança para a próxima classificação, não precisando realizar tarefas semanais e enfrentando perigos maiores.'),(237,5,1,35,'Heroi Classe-A','Você se tornou muito famoso e suas habilidades cresceram de forma surpreendente, garantido seu lugar na Classe-A.'),(239,6,1,35,'Heroi Classe-S','Você é reconhecido no mundo todo devido à seus enormes atos heroicos e seu poder absurdo, sendo chamado para enfrentar ameaças de nível Dragão e Deus.'),(241,1,1,36,'Jogador de Base','Decidir em qual posição do futebol atuar começa aqui, teste psicológicos e físicos serão essenciais para determinar qual é sua vocação e é um pontapé inicial para o sonho de ser reconhecido mundialmente.'),(243,2,1,36,'Jogador Amador','Você é um amante de futebol e deseja se tornar um grande jogador no futuro e para isso, você deverá treinar muito.'),(245,3,1,36,'Prodígio do Futebol','Você possui um talento fora do comum, mas ainda é cedo para dizer que treinou o bastante. Agora é a hora de desenvolver suas próprias habilidades e para isso, deve trilhar um caminho difícil, cheio de inimigos fortes e treinamentos pesados.'),(247,4,1,36,'Jogador Profissional','Você amadureceu e se tornou um profissional, conquistou as pessoas à sua volta, mostrando sua persistência e a ambição do seu sonho de se tornar um grande jogador.'),(249,5,1,36,'Capitão do Time','Após se firmar no clube profissional, usando sua expêriencia adquirida com o tempo e seu forte senso de liderança, você foi escolhido como o capitão do time, ganhando o novo trabalho de guiar todos os seus companheiros em campo.'),(251,6,1,36,'Jogador da Seleção','Após muito treinamento e esforço nessa sua longa jornada, você conseguiu se tornar um grande jogador, sendo reconhecido por todos de sua nação por suas habilidades e sua capacidade de criar novas jogadas com a equipe, entrando para a seleção do País.'),(253,1,1,37,'Aspirante à Soldado','Você se alistou no exercito e agora recebe treinamento para se tornar um soldado oficial do exército imperial.'),(255,2,1,37,'Soldado do Exército Imperial','Você passou em todos os testes para se tornar um Soldado e agora deve servir fielmente ao Império.'),(257,3,1,37,'General do Exército Imperial','Devido as suas proezas como soldado, você subiu na hierarquia do Império e agora é um General respeitado.'),(259,4,1,37,'Renegado do Império','Você conseguiu enxergar o lado negro da capital e decidiu deixá-la e se juntar ao Exercito Revolucionário, se tornando um desertor.'),(261,5,1,37,'Assassino Revolucionário','Você passou por incontáveis testes para conseguir um armamento imperial e agora pode começar as atividades contra o Império, se tornando um assassino da revolução.'),(263,6,1,37,'Líder Revolucionário','Você sobreviveu a inúmeros combates contra capital. Viu companheiros caírem perante o inimigo e nunca perdeu o foco da batalha. O Exercito Revolucionário precisa de um Líder. Um Líder Apto e que não teme o poder do Império, e você possui essas capacidades.'),(265,1,1,38,'Humano Comum','Você é apenas um simples humano que desbrava o mundo atrás de artefatos antigos.'),(267,2,1,38,'Aprendiz do Hamon','Durante uma de suas viagens, você acaba encontrando pessoas que usam um poder estranho chamado Hamon e decide se tornar um aprendiz desta técnica.'),(269,3,1,38,'Mestre do Hamon','Você treinou durante anos o uso do hamon enquanto viajava pelo mundo, sendo considerado um Mestre na área, podendo usar a técnica de respiração do Hamon mesmo estando dormindo.'),(271,4,1,38,'Vampiro','Você estava preocupado com a sua idade e o Hamon não podia segurar sua juventude por muito tempo. Procurou e usou a máscara de pedra para que ela o transformasse em um vampiro e adquirisse a vida eterna.'),(273,5,1,38,'Vampiro Ancião','Você vive há centenas de anos e obteve todo tipo de conhecimento sobre o mundo, sendo considerado o ser mais inteligente do mundo.'),(275,6,1,38,'Ser Supremo','Você usou todo o seu conhecimento para construir uma máscara de pedra compatível com uma pedra vermelha rara que podia amplificar a luz do sol. Usou a máscara com a pedra encaixada na testa, o transformando no Ser Supremo do universo.'),(289,1,1,39,'Joui','Você é um jovem samurai ainda inexperiente que se uniu com seus companheiros para expulsar os Amantos durante a Guerra de Joui.'),(291,2,1,39,'Madao','Após o fim da guerra e a proibição do uso de armas, você se torna um vagabundo que vaga pelo mundo sem destino.'),(293,3,1,39,'Membro do Shinsengumi','Você finalmente achou seu lugar no mundo e entra para as forças do Shinsengumi, ganhando o direito de usar uma espada.'),(295,4,1,39,'Vice-Capitão','Após anos dentro do Shinsengumi, sua força finalmente é reconhecida, se tornando o Vice-Capitão, sendo considerado o segundo mais poderoso do grupo.'),(297,5,1,39,'Capitão','Após uma missão que resultou na morte do capitão, os superiores reconhecem que você é o mais apto dentre todos os outros, o nomeando o novo Capitão do Shinsengumi.'),(299,6,1,39,'Deva','Anos se passaram desde sua entrada no Shinsengumi e após se desligar do grupo, você acaba se tornando um dos 4 Devas e assume o dever de manter a ordem e a paz no distrito Kabuki.'),(301,1,1,40,'Mamodo Solitário','Você é apenas um mamodo solitário que ainda não encontrou seu guardião.'),(302,2,1,40,'Dupla Mamodo','Durante um bom tempo, você vagou pelo mundo atrás de seu guardião, até que finalmente o encontrou! Agora seu poder pode ser usado ao máximo.'),(303,3,1,40,'Mamodo Experiente','Você e seu guardião treinaram duro, enfrentaram diversos inimigos, sendo reconhecidos facilmente pelos mamodos restantes da grande guerra.'),(304,4,1,40,'Mamodo e Guardião Inseparáveis','Você já enfrentou dezenas de mamodos e possui vários poderes mamodos desbloqueados, seu coração e o de seu guardião estão conectados e por isso seu poder está muito maior do que antes.'),(305,5,1,40,'Super Mamodo','Você e seu guardião adquiriram um poder fenomenal por meio das grandes batalhas e agora você é um dos finalistas!'),(306,6,1,40,'Rei Mamodo','Você e seu guardião superaram todos os obstáculos e venceram todos os mamodos da grande guerra, se tornando o rei mamodo!');
