INSERT INTO `guides` VALUES (1,1,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/5641fFoAiio\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Passo 1 - Página de Criar Conta</b>\nNo menu da esquerda, clique no link \"<a href=\"http://animeallstarsgame.com.br/index.php/users/join\">Crie sua conta</a>\".\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/1.jpg\"/></div>\n\n<b class=\"laranja\">Passo 2 - Preenchendo os Dados</b>\nPreencha todos os dados corretamente:\n\n•Nome: Digite seu nome corretamente para evitar problemas em promoções.\n•Email: Digite um email <b>válido</b> e confime no outro campo.\n•Senha: Digite sua senha e <b>jamais</b> compartilhe ela com alguém. Confirme novamente no campo da direita.\n•País: Escolha seu país.\n•Sexo: Escolha seu sexo.\n\nConcorde com todos os Termos e em seguida digite o Código de Segurança com letras minúsculas.\nPara completar, clique em \"Completar meu cadastro\".\n<div align=\"center\"><a href=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/2.jpg\" target=\"_blank\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/2.jpg\" width=\"560\"/></a></div>\n\n<b class=\"laranja\">Passo 3 - Ativando a Conta</b>\nSeu cadastro foi completo, porém você precisa ativar sua conta através de seu email antes de poder logar.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/3.jpg\"/></div>\n\n<b class=\"laranja\">Passo 4 - Ativando a Conta no Email</b>\nEntre no seu email cadastrado e abra o email do Anime All-Stars Game.\nVocê tem a opção de clicar no link para ativar, ou caso não funcione, copie o código e cole na página do passo anterior.\n<div align=\"center\"><a href=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/4.jpg\" target=\"_blank\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/4.jpg\" width=\"560\"/></a></div>\n\n<b class=\"laranja\">Passo 5 - Pronto!</b>\nSeu sua conta já foi confirmada e agora basta logar no jogo e começar sua aventura!\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Conta/5.jpg\"/></div>'),(2,2,'Em construção.'),(3,3,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/TK8vkou9vUw\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Guia de Personagens</b>\nSe quiser saber mais detalhadamente sobre cada personagem do jogo, basta visitar o \"<a href=\"http://animeallstarsgame.com.br/index.php/guides/character\">Guia de Personagens</a>\".\nLá é possível ver os Temas, Habilidades, Especialidades e Golpes Únicos de cada personagem do jogo, inclusive os que estão bloqueados.\n\n<b class=\"laranja\">Passo 1 - Página de Criação</b>\nPara ir para a página de Criação, basta clicar em \"<a href=\"http://animeallstarsgame.com.br/index.php/characters/create\">Criar Personagem</a>\" no menu da esquerda ou no menu Personagem, se estiver logado em algum.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Char/1.png\"/></div>\n\n<b class=\"laranja\">Passo 2 - Escolha um Anime</b>\nExistem diversos animes no jogo, cada um com seus personagens. Basta escolher qual você quer clicando nele.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Char/2.jpg\"/></div>\n\n<b class=\"laranja\">Passo 3 - Escolha um Personagem</b>\nExistem diversos personagens no jogo, e caso você já tenha se decidido, basta clicar no personagem desejado.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Char/3.jpg\"/></div>\n\n<b class=\"laranja\">Passo 4 - Nome do Personagem</b>\nDigite o nome que você quer dar para seu personagem, mas atenção, só serão aceitos nomes entre 6 e 14 caracteres e <b>NÃO</b> use caracteres especiais, como !@#$%¨&*()_.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Char/4.jpg\"/></div>\n\n<b class=\"laranja\">Passo 5 - Facção</b>\nPor último, escolha se seu personagem será um Heroi ou um Vilão. Essa escolha pode alterar algumas coisas no seu jogo futuramente.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Criando-Char/5.jpg\"/></div>'),(4,4,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kU_7mRyoAN8\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Level do Personagem e da Conta</b>\nExistem dois tipos de Level no jogo: o Level do Personagem (Barra azul - esquerda) e o Level da Conta (Barra vermelha - direita).\nO level do personagem é único de cada personagem que você possui, e ao evoluir sua Stamina aumenta, mais missões são liberadas, você ganha o direito de se graduar e com isso consegue melhores equipamentos.\nO level da conta é compartilhado entre todos os personagens da conta, e ao evoluir você libera novos Talentos, ganha um ponto livre de Treinamento de Atributos e novas opções de presentes da Lista de Amigos são liberadas.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Evoluindo/1.jpg\"/></div>\n\n<b class=\"laranja\">Ganhando Experiência</b>\nO jogo possui diversos lugares que te dão experiência no personagem ou diretamente na conta. Você consegue experiência em batalhas, missões e até mesmo conquistas, basta ficar de olho nas recompensas de cada módulo. A experiência ganha em batalha é para o personagem, porém 10% da experiência da Batalha NPC vai para a conta, e 20% da experiência da Batalha PvP vai para a conta.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Evoluindo/2.jpg\"/></div>\n\n<b class=\"laranja\">Evoluindo</b>\nQuando você completar a experiência do personagem do Level 1 para o 2, você precisará clicar no botão \"Ir para o próximo nível\". Feito isso, do Level 2 para o 3 e assim por diante já será automático. O level da conta já passa automaticamente desde o Level 1.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Evoluindo/3.png\"/></div>'),(5,5,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YdcX3ou_YbM\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Entrando na Batalha NPC</b>\nUma batalha contra NPC é uma batalha contra um personagem controlado pelo computador, então são mais rápidas por ele não precisar pensar. Eles não usam habilidades ou especialidades, mas tome cuidado que ele pode usar o mesmo golpe duas ou mais vezes seguidas.\nPara entrar numa Batalha NPC, vá no menu Batalhas > <a href=\"http://animeallstarsgame.com.br/index.php/battle_npcs\">Batalha NPC</a>.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaNPC/2.jpg\"/></div>\n\n<b class=\"laranja\">Ícones de Batalha</b>\nAo lado de cada jogador existem alguns ícones com informações sobre cada um:\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaNPC/1.png\"/></div>\n\n<b class=\"laranja\">Habilidades e Especialidades</b>\nAo usar uma Habilidade ou Especialidade, você <b>NÃO</b> passa o turno, podendo executar um golpe ou pular o turno junto. A única habilidade que passa o turno é a que tem o efeito de copiar o último golpe do oponente, pois você estará usando um golpe.\nTambém é possível usar uma Habilidade ou Especialidade quando você está Atordoado.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaNPC/3.jpg\"/></div>\n\n<b class=\"laranja\">Mana e Vida</b>\nTodos os jogadores possuem 20 de Mana (barrinha azul) e 1000 de Vida (barrinha vermelha). \nO jogador só perde a batalha quando a Vida chegar a <b>ZERO</b>.\nA mana é recuperada em 2 pontos por turno, ou seja, se você estiver com 20 de mana e usar um golpe de 10 de mana, você ficará com 12 de mana no próximo turno. Controle sua mana que você controlará a partida!\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaNPC/4.jpg\"/></div>\n\n<b class=\"laranja\">Ícones no Log</b>\nExistem algumas ações que podem ser causadas ao usar um golpe:\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaNPC/5.png\"/></div>\n\n<b class=\"laranja\">Finalizando a Batalha</b>\nAo terminar a partida, você recebe experiência para o personagem, experiência para a conta e dinheiro. Se você venceu a batalha, tem chance de conseguir coisas a mais, como equipamento, mascote, fragmento das almas e página do grimório.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaNPC/6.jpg\"/></div>'),(6,6,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/aOw1-1u50Fg\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Requerimentos</b>\nPara fazer uma Missão de Tempo, primeiramente você precisa estar Level 5 e na segunda graduação do jogo. Feito isso, vá na página de \"<a href=\"http://animeallstarsgame.com.br/index.php/quests/time\">Missões de Tempo</a>\" e as primeiras missões serão liberadas.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesTempo/1.png\"/></div>\n\n<b class=\"laranja\">Duração</b>\nCada missão possui uma duração. Ao aceitar, seu personagem não terá acesso à diversos menus e você terá que esperar o tempo descrito até completar a missão e poder voltar a usar o seu personagem normalmente.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesTempo/2.png\"/></div>\n\n<b class=\"laranja\">Recompensas</b>\nAs missões possuem diferentes recompensas, como apenas Experiência e Dinheiro, um equipamento aleatório, um mascote aleatório ou um mascote específico.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesTempo/3.jpg\"/></div>\n\n<b class=\"laranja\">Tempo de Espera</b>\nQuando aceitar a missão, você irá para essa tela de espera, e terá acesso à poucos menus, então aconselhamos que deixe a missão para quando precisar sair do computador. Você também poderá cancelar a missão quando quiser, porém o tempo será perdido e você terá que começar tudo de novo caso queira fazer a missão mais tarde. Após o termino da missão, basta clicar para Finalizar e você receberá as recompensas descritas anteriormente.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesTempo/4.jpg\"/></div>'),(7,7,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/pBtPhhBRr4E\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Requerimentos</b>\nPara fazer uma Missão PvP, primeiramente você precisa estar Level 5 e na segunda graduação do jogo. Feito isso, vá na página de \"<a href=\"http://animeallstarsgame.com.br/index.php/quests/pvp\">Missões PvP</a>\" e a primeira missão será liberada.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesTempo/1.png\"/></div>\n\n<b class=\"laranja\">Objetivo</b>\nMissões PvP possuem requerimentos diferentes para serem completadas. Você precisa eliminar jogadores inimigos de uma forma diferente, como sem usar Modificadores, Habilidades, Especialidades, e jogadores do mesmo nível do personagem ou abaixo. Mesmo que você cumpra o requerimento mas não vença a batalha, não fará progressão na missão.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesPVP/1.jpg\"/></div>'),(8,8,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/IUxm8ZTNSCk\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Limite de Missões</b>\nVocê recebe uma missão diária sempre que der 00h. Você pode receber até 4 missões, e depois disso terá que completar alguma missão para dar espaço para receber mais uma no próximo dia.\nPara conferir suas missões, vá na página de \"<a href=\"http://animeallstarsgame.com.br/index.php/quests/daily\">Missões Diárias</a>\".\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesDiarias/1.jpg\"/></div>\n\n<b class=\"laranja\">Trocar de Missão</b>\nA primeira troca de missão é grátis, porém cada vez que você trocar, o preço aumentará. A primeira vez é de graça, depois algumas vezes por moedas e depois apenas por Estrelas VIP.\nO valor de troca da missão é compartilhado entre todas as missões, portanto se você trocar uma missão, o valor de todas será alterado.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesDiarias/2.png\"/></div>\n\n<b class=\"laranja\">Dificuldades e Recompensas</b>\nExistem três dificuldades das missões diárias: Fácil (verde), Médio (amarelo) e Difícil (vermelho). Quanto maior a dificuldade, mais detalhada é a missão, porém maior é a recompensa.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesDiarias/3.jpg\"/></div>\n\n<b class=\"laranja\">Completando a Missão</b>\nMesmo que você complete todos os requerimentos da missão, ela não completará sozinha, por isso você precisa voltar nesta página e clicar em \"Receber Recompensas\". Você consegue completar mais de uma missão de uma vez dessa forma.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/MissoesDiarias/4.jpg\"/></div>'),(9,9,'Em construção.'),(10,10,'Em construção.'),(11,11,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/pBtPhhBRr4E\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Entrando na Batalha PVP</b>\nUma batalha PVP é contra outro jogador, onde a recompensa é maior e a chance de encontrar itens no final da batalha também é maior.\nPara entrar numa Batalha PVP, vá no menu Batalhas > <a href=\"http://animeallstarsgame.com.br/index.php/battle_pvps\">Batalha PVP</a>.\nClique para Entrar na Fila e aguarde encontrar um oponente.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaPVP/1.jpg\"/></div>\n\n<b class=\"laranja\">Saindo da Fila</b>\nCaso você desista de procurar um oponente na Fila PVP, basta colocar o mouse em cima do ícone laranja e clicar em \'Sair da Fila\'.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaPVP/2.jpg\"/></div>\n\n<b class=\"laranja\">Tempo de Ação e Inatividade</b>\nEm uma batalha PVP, você tem 1:30 minutos para usar um golpe ou passar o turno. Caso você não faça nada durante esse 1:30, você irá perder a batalha por inatividade.\nQuando é sua vez, o tempo fica vermelho. Quando é do oponente, o tempo fica verde.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/BatalhaPVP/3.png\"/></div>'),(12,12,'Em construção.'),(13,13,'Em construção.'),(14,14,'Em construção.'),(15,15,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/SDffwM3Z6Kw\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Requerimentos</b>\nAo ir na página de \"<a href=\"http://animeallstarsgame.com.br/index.php/graduations/index\">Graduações</a>\", você poderá notar que existem 6 Graduações, sendo que a primeira você já vem graduado. Cada uma possui um requerimento a ser completado antes de poder se graduar.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Graduando/1.png\"/></div>\n\n<b class=\"laranja\">Graduando</b>\nPara graduar, basta completar todos os requerimentos e clicar no botão \"Graduar\". A cada graduação, você irá dropar novos equipamentos que tem chance de serem melhores do que da graduação anterior.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Graduando/2.png\"/></div>'),(16,16,'<b class=\"laranja\">Conseguindo um Equipamento</b>\nVocê pode conseguir um equipamento através de vitórias em batalhas, missões e outros lugares. Feito isso, vá na página de \"<a href=\"http://animeallstarsgame.com.br/index.php/equipments\">Equipamentos</a>\" para conferir os equipamentos que você conseguiu, que estarão representados por um ícone de \"Novo\".\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Equipamentos/1.jpg\"/></div>\n\n<b class=\"laranja\">Raridades e Força</b>\nUm equipamento possui três raridades: Comum (branco) > Raro (azul) > Lendário (laranja). Quanto maior a raridade, mais e melhores atributos. Também existem equipamentos com \"Propriedade Extra\", que virão com mais bônus que normalmente viria.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Equipamentos/2.png\"/></div>\n\n<b class=\"laranja\">Opções do Equipamento</b>\nClicando com o botão esquerdo em cima de um equipamento, você tem a opção de equipar, vender por moedas ou destruir por fragmentos.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Equipamentos/3.jpg\"/></div>\n\n<b class=\"laranja\">Aprimoramento de Equipamento</b>\nClicando com o botão direita em cima de um equipamento, você tem a opção de aprimorar ele com Areia Estelar ou com Sangue de Deus. Ambos itens são dropados apenas em Batalhas PVP.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Equipamentos/4.jpg\"/></div>'),(17,17,'Em construção.'),(18,18,'Em construção.'),(19,19,'Em construção.'),(20,20,'Em construção.'),(21,21,'Em construção.'),(22,22,'Em construção.'),(23,23,'Em construção.'),(24,24,'Em construção.'),(25,25,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/UFF6-Iusg3Y\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Atributos do Personagem</b>\nCada personagem possui 8 atributos que influenciam seus valores em combate:\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/IniciandoJogo/1.png\"/></div>\n\n<b class=\"laranja\">Habilidades e Especialidades</b>\nDecidir sua \"<a href=\"http://animeallstarsgame.com.br/index.php/techniques/abilities_and_specialities\">Habilidade e sua Especialidade</a>\" antes da batalha é muito importante, pois elas podem ser a chave para a vitória. Cada personagem possui 5 habilidades e 3 especialidades, e você pode conferir cada um no \"<a href=\"http://animeallstarsgame.com.br/index.php/guides/character\">Guia de Personagens</a>\".\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/IniciandoJogo/2.jpg\"/></div>\n\n<b class=\"laranja\">Escolhendo os Golpes</b>\nDecidir seus \"<a href=\"http://animeallstarsgame.com.br/index.php/techniques/index\">Golpes</a>\" antes da batalha também é necessário, porém você vai descobrindo o seu jeito de jogar com o tempo. Só podem ser escolhidos 10 golpes para você levar para a batalha, e caso não queira ficar decidindo isso logo que entra no jogo, já deixamos registrados 10 golpes para você.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Golpes/2.jpg\"/></div>\n\n<b class=\"laranja\">Treinando Atributos</b>\nOs pontos de atributos são difíceis de conseguir, pois você só consegue quando evolui sua conta. Cada um precisa de uma certa quantidade de pontos para encher um ponto completo:\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/IniciandoJogo/3.jpg\"/></div>\n\n'),(26,26,'Em construção.'),(27,27,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/_fyc_fqFknA\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Golpes Equipados</b>\nVocê pode escolher apenas 10 golpes que poderão ser usados em combate. Esses golpes estão localizados na lista \"Golpes Equipados\".\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Golpes/2.jpg\"/></div>\n\n<b class=\"laranja\">Trocando os Golpes Equipados</b>\nPara trocar um golpe equipado, basta você clicar no golpe desejado da lista inferior, segurar e arrastar em cima de algum golpe da lista superior.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Golpes/1.png\"/></div>\n\n<b class=\"laranja\">Valores para Combate</b>\nCada golpe possui alguns valores. Aqui está a explicação para cada um deles:\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Golpes/3.png\"/></div>\n\n<b class=\"laranja\">Vantagens dos Tipos</b>\nExistem 6 tipos de golpes: Neutro, Corpo-a-corpo, Mágico, Atirador, Guerreiro e Elemental. Todos possuem vantagens contra outro tipo, com exceção do Neutro, que não possui nenhuma vantagem ou desvantagem. Ao usar um golpe com vantagem, você irá causar +50% do dano do seu golpe no inimigo. A seguir você pode conferir o ciclo:\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Golpes/4.png\"/></div>\n\n<b class=\"laranja\">Golpes Bloqueados</b>\nAlguns golpes estarão bloqueados no início do jogo, e serão representados com um ícone de cadeado. Existem golpes para serem desbloqueados no Modo Aventura e no Grimório Proibido. Os golpes liberados pelo Grimório são únicos de cada personagem seu, porém os golpes liberados pelo Modo Aventura servem para todos seus personagens da conta, bastando apenas entrar no personagem que completou o Modo Aventura e em seguida no personagem que você quer ter o golpe desbloqueado.\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Golpes/5.png\"/></div>'),(28,28,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/WojZK7xNeY4\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Tipos de Efeitos</b>\nExistem 4 efeitos que podem ser executados através de golpes específicos, habilidades e especialidades. São eles:\n\n<div align=\"center\"><a href=\"http://animeallstarsgame.com.br/assets/images/guides/Efeitos/1.png\" target=\"_blank\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Efeitos/1.png\" width=\"650\"/></a></div>\n\n<b class=\"laranja\">Habilidades e Especialidades</b>\nExistem algumas habilidades e especialidades que envolvem os efeitos. A Habilidade de adicionar o efeito no inimigo, a Especialidade de dobrar a chance do efeito soltar ao usar um golpe e a Especialidade de remover o efeito do seu personagem.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Efeitos/2.png\"/></div>'),(29,29,'Em construção.'),(30,30,'Em construção.'),(31,31,'Em construção.'),(32,32,'Em construção.'),(33,33,'Em construção.'),(34,34,'Em construção.'),(35,35,'Em construção.'),(36,36,'Em construção.'),(37,37,'Em construção.'),(38,38,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/NoHYJTh1ieU\" frameborder=\"0\" allowfullscreen></iframe></div>\n\n<b class=\"laranja\">Escolhendo um T´titulo</b>\nUma batalha PVP é contra outro jogador, onde a recompensa é maior e a chance de encontrar itens no final da batalha também é maior.\nPara entrar numa Batalha PVP, vá no menu Batalhas > <a href=\"http://animeallstarsgame.com.br/index.php/battle_pvps\">Batalha PVP</a>.\nClique para Entrar na Fila e aguarde encontrar um oponente.\n\n<div align=\"center\"><img src=\"http://animeallstarsgame.com.br/assets/images/guides/Titulos/1.jpg\"/></div>\n\n<b class=\"laranja\">Conseguindo um Título</b>\nExistem vários lugares do site nos quais é possível conseguir um título, e entre eles estão: <a href=\"http://animeallstarsgame.com.br/index.php/achievements/index\">Conquistas</a>, <a href=\"http://animeallstarsgame.com.br/index.php/history_mode/index\">Modo Aventura</a>, <a href=\"http://animeallstarsgame.com.br/index.php/challenges\">Arena do Céu</a>, <a href=\"http://animeallstarsgame.com.br/index.php/organizations/treasure\">Troca de Tesouros</a> e entre outras coisas.'),(39,39,'Em construção.'),(40,40,'Em construção.'),(41,41,'Em construção.'),(42,42,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/qthjcTlElB0\" frameborder=\"0\" allowfullscreen></iframe></iframe></div>'),(43,43,'<div align=\"center\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/CjXpT0RP2ys\" frameborder=\"0\" allowfullscreen></iframe></div>'),(44,44,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/GJQRHS5A3t4\" frameborder=\"0\" allowfullscreen></iframe>'),(45,45,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/oCdFKp-C0-Q\" frameborder=\"0\" allowfullscreen></iframe>'),(46,46,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/UgkH2-74kpI\" frameborder=\"0\" allowfullscreen></iframe>');
/*!40000 ALTER TABLE `guides` ENABLE KEYS */;
