--
-- Table structure for table `hall_of_fames`
--

DROP TABLE IF EXISTS `hall_of_fames`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `hall_of_fames` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `round` varchar(200) COLLATE utf8_unicode_ci DEFAULT '0',
  `user_id` int(11) DEFAULT '0',
  `player_id` int(11) DEFAULT '0',
  `level` int(11) DEFAULT '0',
  `account_level` int(11) DEFAULT '0',
  `faction_id` int(11) NOT NULL DEFAULT '0',
  `anime_id` int(11) DEFAULT '0',
  `character_id` int(11) NOT NULL DEFAULT '0',
  `character_theme_id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `draws_npc` int(11) NOT NULL DEFAULT '0',
  `draws_pvp` int(11) NOT NULL DEFAULT '0',
  `wins_npc` int(11) NOT NULL DEFAULT '0',
  `wins_pvp` int(11) NOT NULL DEFAULT '0',
  `losses_npc` int(11) NOT NULL DEFAULT '0',
  `losses_pvp` int(11) NOT NULL DEFAULT '0',
  `time_total` int(11) NOT NULL DEFAULT '0',
  `pvp_total` int(11) NOT NULL DEFAULT '0',
  `daily_total` int(11) DEFAULT '0',
  `pet_total` int(11) DEFAULT '0',
  `combat_total` int(11) NOT NULL DEFAULT '0',
  `score` int(11) DEFAULT '0',
  `position_anime` int(11) DEFAULT '0',
