INSERT INTO `history_mode_group_descriptions` VALUES (1,1,1,'Naruto','Complete 6 sagas e ganhe as recompensas:<br /><br />\n<span class=\"laranja\">Títulos:</span> Um Ninja de Verdade, Herói da Ponte Naruto, Poder Amaldiçoado, Acabando com o Ódio, A Nova Sombra do Fogo e Laços Inquebráveis<br />\n<span class=\"laranja\">Personagens:</span> Zabuza Momochi e Tsunade Senju<br />\n<span class=\"laranja\">Temas:</span> Zabuza - Mercenário, Sasuke - Selo Amaldiçoado, Gaara - Chakra do Ichibi e Naruto - Chakra da Kyuubi<br />\n<span class=\"laranja\">Mascotes:</span> Katsuyu'),(2,1,2,'Bleach - Soul Society','Complete 3 sagas e ganhe as recompensas:<br /><br />\n<span class=\"laranja\">Títulos:</span> Um Novo Shinigami, Grite Meu Nome! e Conspiração da Soul Society<br />\n<span class=\"laranja\">Personagens:</span> Kisuke Urahara e Yoruichi Shihouin<br />\n<span class=\"laranja\">Temas:</span> Rukia - Estudante de Karakura e Hollow Ichigo<br />\n<span class=\"laranja\">Item:</span> Equipamento Aleatório<br />\n<span class=\"laranja\">Golpe:</span> Passo Relâmpago<br />'),(3,1,3,'Dragon Ball','Complete 7 sagas e ganhe as recompensas:<br /><br />\n<span class=\"laranja\">Títulos:</span> Caçador de Esferas, Estudante Kame, Soldado Red Ribbon, Um Desejo à Shenlong, Nascido para Lutar, Rei Demônio e Nasce uma Lenda<br />\n<span class=\"laranja\">Personagens:</span> Tao Pai Pai e Yajirobe<br />\n<span class=\"laranja\">Temas:</span> Goku - Estudante Kame, Kuririn - Estudante Kame, Jackie Chun e Piccolo - Grande Namekusei<br />\n<span class=\"laranja\">Mascotes:</span> Nuvem Voadora, Robô Pirata e Mestre Karin<br />\n<span class=\"laranja\">Item:</span> Equipamento Aleatório<br />\n<span class=\"laranja\">Golpe:</span> Golpe da Tartaruga Serena<br />'),(4,1,4,'CDZ - Doze Casas','Complete 6 sagas e ganhe as recompensas:<br /><br />\n<span class=\"laranja\">Títulos:</span> Cavaleiro de Bronze, Cavaleiro Negro, Cavaleiro Fantasma, Cavaleiro de Prata, Cavaleiro de Ouro e Cavaleiro do Santuário<br />\n<span class=\"laranja\">Personagens:</span> Marin de Águia e Shina de Cobra<br />\n<span class=\"laranja\">Temas:</span> Fênix Negro, Seiya de Sagitário e Saga - Possuído pelo Mal<br />\n<span class=\"laranja\">Item:</span> 6 Equipamentos Aleatórios<br />\n<span class=\"laranja\">Golpe:</span> Benção da Deusa da Guerra<br />'),(5,1,5,'One Piece - East Blue','Complete 6 sagas e ganhe as recompensas:<br /><br />\n<span class=\"laranja\">Títulos:</span> Explorador dos Mares, Capitão da Tripulação, Desbravador de Novos Mares, A Miss Criminosa, Desafiador de Gigantes e Milagre das Cerejeiras<br />\n<span class=\"laranja\">Personagens:</span> Buggy, Kuro, Smoker e Vivi Nefertari<br />\n<span class=\"laranja\">Mascote:</span> Mohmoo e Lapahns<br />\n<span class=\"laranja\">Item:</span> 3 Equipamentos Aleatórios e 10 Atum Elefante<br />'),(6,1,6,'Katekyou Hitman Reborn!','Complete 8 sagas e ganhe as recompensas:<br /><br />\n<span class=\"laranja\">Títulos:</span> Novo Chefe da Máfia, Aquele que Retornou do Inferno, O Verdadeiro Sucessor da Vongola, Viajante da Fronteira do Futuro, Herói do Passado e do Futuro, Vencedor do Desafio dos Arcobalenos, Competidor da Choice e Criador de um Novo Futuro<br />\n<span class=\"laranja\">Personagens:</span> Lancia, Flan e Daisy<br />\n<span class=\"laranja\">Mascote:</span> Enzo, Fantasma, Colulu & Widget e Keiman<br />\n<span class=\"laranja\">Item:</span> 4 Equipamentos Aleatórios, 10 Pão de Gyoza e 10 Pílula Shinu Ki<br />\n<span class=\"laranja\">Golpe:</span> Chamas da Determinação<br />\n\n');
