/*!40000 ALTER TABLE `history_mode_subgroup_descriptions` DISABLE KEYS */;
INSERT INTO `history_mode_subgroup_descriptions` VALUES (1,1,1,'Introdução','Naruto era uma criança que teve um demônio, chamado Bijuu, selado dentro dele logo em seu nascimento. Não levava muito jeito para ser um ninja, mas seu sonho era se tornar o Hokage e ser reconhecido por todos, e então se junta ao Time 7.'),(2,1,2,'O Substituto','Ichigo tinha a habilidade de ver espíritos, e um dia uma menina de kimono preto apareceu em sua casa e o transformou em um Shinigami, um espírito guerreiro que luta contra as almas negativas chamadas Hollows.'),(3,1,3,'País das Ondas','Desesperado por uma missão de verdade, o Time 7 recebe uma missão de escolta, mas são surpreendidos por um assassino de rank alto, e lutam para sobreviver.'),(4,1,4,'Exame Chuunin','O Time 7 decide se juntar ao Exame Chuunin para ir para a próxima graduação, mas Orochimaru, um Sannin Lendário fugitivo, invadiu o Exame e mordeu o Sasuke, deixando-o com a marca do Selo Amaldiçoado.'),(5,1,5,'Invasão de Konoha','Com tudo pronto, Orochimaru começa sua invasão e o Terceiro Hokage dá sua vida para selar o Orochimaru, mas erra e sela apenas seus braços. Enquanto isso Gaara perde o controle e se transforma em Shukaku.'),(6,1,6,'Busca pela Tsunade','Com a morte do Terceiro Hokage, Jiraiya sugere que Tsunade, outra Sannin Lendária, se torne a Quinta, e os três Sannins travam uma grande batalha, e Tsunade finalmente aceita se tornar a nova Hokage.'),(7,1,7,'Resgate de Sasuke','Sasuke, em busca de poder, vai atrás de Orochimaru, mas Naruto tenta impedir e ambos travam uma poderosa batalha no Vale do Fim, onde Naruto perde e Sasuke abandona Konoha.'),(8,1,8,'Soul Society: A Entrada','Rukia é levada para a Soul Society para ser executada, mas Ichigo e os outros correm para salvá-la e se deparam com vários Shinigamis poderosos, os Capitães.'),(9,1,9,'Soul Society: O Resgate','Yoruichi salva Ichigo de Byakuya e o ajuda em seu treinamento até desespertar sua Bankai. Quando Ichigo derrota Byakuya, Aizen se revela um traidor e começa uma conspiração na Soul Society, fugindo junto com Gin e Tousen.'),(10,1,10,'O Imperador Pilaf','Goku conhece Bulma e outros amigos, que estão em busca das Esferas do Dragão, invocando o dragão Shenlong que é capaz de realizar qualquer desejo, mas o maligno Pilaf também está atrás das esferas.'),(11,1,11,'21° Torneio de Artes Marciais','Goku conhece Kuririn e ambos se tornam aprendizes do Mestre Kame, e entram no 21° Torneio de Artes Marciais como parte de seu treinamento, e são surpreendidos pelo poderoso Jackie Chun.'),(12,1,12,'Exército Red Ribbon','Goku está atrás da Esfera de 4 Estrelas mas cruza com a organização militar maligna chamada Red Ribbon. Goku perde para Tao Pai Pai e vai treinar com o Mestre Karin para depois ter sua revache.'),(13,1,13,'A Vidente Vovó Uranai','Goku busca ajuda a vidente Vovó Uranai para achar a última Esfera do Dragão, e precisa passar por um teste antes, enfrentando no final seu avô adotivo Gohan.'),(14,1,14,'22° Torneio de Artes Marciais','Goku conhece Tenshinhan e Chaos, que participam juntos do 22° Torneio de Artes Marciais. Jackie Chun revela ser o Mestre Kame disfarçado, e após uma dura batalha, Goku perde para Tenshinhan nas finais.'),(15,1,15,'Rei Demônio - Piccolo Daimaoh','Piccolo Daimaoh, o Rei do Inferno, acaba matando vários amigos de Goku e desejando à Shenlong sua juventude novamente, aumentando drasticamente seus poderes. Goku consegue vencê-lo, mas antes de morrer ele cospe um ovo no qual nasce Piccolo Jr.'),(16,1,16,'O Surgimento de Piccolo Jr.','Goku consegue reviver seus amigos com a ajuda de Shenlong e passa três anos treinando com o Kami-sama. Ao participar do 23° Torneio de Artes Marciais, Goku enfrenta Piccolo Jr e vence a batalha final.'),(17,1,17,'Guerra Galática','Seiya luta para conseguir a Armadura de Sagitário e depois vai para a Guerra Galática, onde os Cavaleiros de Bronze lutam para ganhar a Armadura de Sagitário.'),(18,1,18,'Cavaleiros Negros','Ikki interrompe a Guerra Galática e rouba a Armadura de Sagitário, e cavaleiros com armaduras negras comandados por Ikki fogem com pedaços da armadura.'),(19,1,19,'Forças Ocultas no Santuário','Cavaleiros estão agindo estranhamente e atacam Saori, mas são impedidos pelos Cavaleiros de Bronze.'),(20,1,20,'Os Cavaleiros de Prata','Os Cavaleiros de Prata são ordenados pelo Mestre do Santuário à derrotar os Cavaleiros de Bronze e Saori, mas são detidos por Seiya e seus amigos.'),(21,1,21,'Introdução dos Cavaleiros de Ouro','Aioria, um Cavaleiro de Ouro, aparece para derrotar Saori, mas descobre que ela é a verdadeira Atena e o Mestre do Santuário é seu inimigo.'),(22,1,22,'A Batalha das Doze Casas','Ao chegar no Santuário para ver o Mestre, Saori é acertada no coração e os Cavaleiros de Bronze têm apenas 12 horas para derrotar o Mestre e salvá-la.'),(23,1,23,'Início de East Blue','Monkey D. Luffy, capitão dos Piratas Chapéu de Palha, enfrenta a tripulação do Palhaço Buggy, que possui a Bara Bara no Mi.'),(24,1,24,'East Blue','Depois de derrotar Buggy e sua Tripulação, Luffy, Zoro e Nami continuam sua aventura, desembarcando em Vila Syrup onde conhecem Usopp, O Mentiroso.'),(25,1,25,'Fim de East Blue','Após derrotar Don Krieg e convidar Sanji para sua Tripulação, eles partem para Vila Cocoyashi, a procura de Nami que supostamente traiu eles e fazia parte da tripulação de Arlong.'),(26,1,26,'Chegada à Grand Line','A Tripulação finalmente cruza a Montanha Reversa e chega na Grand Line, porém se deparam com uma imensa baleia que bloqueia seu caminho.'),(27,1,27,'Little Garden','Ao se envolver com uma golpe de Estado de uma facção chamada Baroque Works, liderada por Crocodile, eles param em uma ilha de Gigantes onde se encontram com o Mr. 3.'),(28,1,28,'Ilha de Drum','Ao zarpar de Little Garden, a Tripulação descobre que Nami está doente e sua única chance e parar em uma ilha de Gelo que não há médicos, a não ser por uma velha Curandeira e uma Rena falante.'),(29,1,29,'Dias Normais','Sawada Tsunayoshi, também conhecido como Bom em Nada Tsuna, é um garoto que fracassa em tudo, que descobre ser o décimo chefe de uma das mais poderosas máfias atráves de bebê mafioso chamado Reborn, que tem como prioridade treiná-lo para ser o décimo chefe dos Vongola, junto a seus amigos.'),(30,1,30,'Kokuyo','A gangue da escola Kokuyo está atacando todos os alunos da escola Namimori, e Tsuna e seus amigos tem o dever de parar essa briga acabando com um fugitivo da prisão chamado de Rokudo Mukuro e seus subordinados.'),(31,1,31,'Varia','Após receber sete meio anéis de um garoto chamdo Basil, Tsuna e seus amigos se tornam alvo de uma das mais poderosas organizações de assassinato que faz parte da Vongola liderada por Xanxus, que é supostamente filho do Nono Vongola, e começa uma disputa entre guardiões pela sucessão da Vongola.'),(32,1,32,'Futuro (Parte 1)','Após ser levado dez anos para o futuro pela Jyuunen Bazooka, Tsuna descobre que seu eu do futuro está morto e que sua família está sendo perseguida pela Millefiore a maior máfia da epóca, e que para voltar para o passado com seus guardiões e preciso deter um homem chamado Irie Shoichi que e a mente por trás de seu envio ao futuro.'),(33,1,33,'Futuro (Parte 2)','Começa a infiltração na base da Millefiore e vários inimigos começam a aparecer, Tsuna tem como alvo deter Irie Shoichi que a chave para voltar para o passado mas ao chegar lá ele descobre algo que muda completamente seu alvo principal.'),(34,1,34,'Desafio dos Arcobalenos','Todos os guardiões são mandado de volta ao passado para conseguir os selos dos arcobalenos para poderem usar sua arma box, porém, Verde quebra o pacto dos arcobalenos causando uma batalha entre os guardiões e arcobalenos contra Verde. '),(35,1,35,'Choice','Afim de derrotar Byakuran, Tsuna e seus guardiões entram em um jogo chamado Choice em que o vencedor leva o Trinisette, mas ao descobrir a verdade por trás de Byakuran e Uni, o sentido da batalha muda totalmente.'),(36,1,36,'Batalha Decisiva no Futuro','Após serem transportados para fora do Choice, Tsuna e seus guardiões tem o dever de proteger Uni e derrotar Byakuran, para isso começa uma batalha definitiva entre todos os membros da Vongola e da Varia contra a Millefiore.');
