INSERT INTO `item_descriptions` VALUES (1,1,1,5,1,'Shuriken','Arremessa uma shuriken no inimigo.','shuriken.png'),(2,1,3,0,1,'Reflexos Ninja','O ninja tem a capacidade de pensar rápido e executar ações de uma forma rápida e eficiente.','reflexos-ninja.png'),(3,1,4,4,1,'Kunai','Arremessa uma kunai no inimigo ou usa em combate corpo a corpo.','kunai.png'),(4,1,7,2,1,'Rasteira','Desfere uma rápida rasteira no inimigo.','rasteira.png'),(5,1,6,5,1,'Defender com a Shuriken','Arremessa shurikens para se defender de golpes a longa distância.','defender-shuriken.png'),(6,1,8,3,1,'Múltiplas Shurikens','Arremessa múltiplas shurikens em alta velocidade.','multiplas-shurikens.png'),(7,1,9,0,1,'Concentração de Chakra','Torna-se capaz de concentrar chakra em seus pés para andar sobre a água.','concentracao-chakra.png'),(8,1,11,1,1,'Henge no Jutsu','Um jutsu que copia uma pessoa, animal ou objeto, usado para distrair o inimigo.','henge-no-jutsu.png'),(9,1,14,2,1,'Joelhada','Desfere uma joelhada no estômago do inimigo.','joelhada.png'),(10,1,13,4,1,'Defender com a Kunai','Utiliza uma kunai para bloquear golpes.','defender-kunai.png'),(11,1,15,3,1,'Palmas de Chakra','Concentra chakra nas mãos para golpear o inimigo.','chakura-no-mesu.png'),(12,1,16,0,1,'Determinação Ninja','Um ninja faz de tudo quando encontra-se em uma situação de risco.','determinacao-ninja.png'),(13,1,18,5,1,'Kunai Explosiva','Arremessa uma kunai com papel explosivo preso, explodindo ao entrar em contato com alguma coisa.','kunai-explosiva.png'),(14,1,21,4,1,'Shurikenjutsu','Maestria na utilização de shurikens e kunais no combate corpo-a-corpo ou à longa distância.','shurikenjustu.png'),(15,1,20,2,1,'Bloqueio Corporal','Utiliza o próprio corpo para se defender de golpes pesados.','bloqueio-corporal.png'),(16,1,22,1,1,'Kakuremino no Jutsu','Ninjutsu básico onde o ninja se camufla com uma capa, se confundindo com alguma parede ou pedra para pegar o inimigo de surpresa.','kakuremino-no-jutsu.png'),(17,1,23,0,1,'Domínio de Chakra','Adquire o controle total do chakra, podendo subir em qualquer lugar.','dominio-chakra.png'),(18,1,25,1,1,'Chakra Ofensivo','Concentra chakra nas mãos para bloquear algum golpe do inimigo e contra-atacar imediatamente.','chakra-defensivo.png'),(19,1,28,2,1,'Cabeçada','Desfere uma poderosa cabeçada no inimigo.','cabeçada.png'),(20,1,27,3,1,'Shunshin no Jutsu','Utiliza o vento e as folhas como uma camuflagem para aparecer ou desaparecer de um lugar.','konoha-shunshin-no-jutsu.png'),(21,1,29,4,1,'Kenjutsu','Maestria na utilização de lâminas para combate corpo-a-corpo.','kenjutsu.png'),(22,1,30,0,1,'Liberação de Chakra','Expande e libera chakra por todo seu corpo, fortalecendo suas energias.','liberacao-chakra.png'),(23,1,32,5,1,'Fuuma Shuriken','Também conhecida como Shuriken de Vento Demoníaca, é uma shuriken gigante usada em grande velocidade para cortar facilmente o inimigo.','fuuma-shuriken.png'),(24,1,33,3,1,'Narakumi no Jutsu','Prende o inimigo em uma ilusão causada pelo vento, fazendo-o acreditar que está imobilizado e abaixando sua defesa para um ataque fatal.','narakumi.png'),(25,1,34,1,1,'Kawarimi no Jutsu','Jutsu que substitui seu corpo por um tronco, enquanto você aparece em outro lugar.','kawarimi-no-jutsu.png'),(26,0,46,0,1,'Tigela de Arroz','Tigela cheia de arroz.','tigela-arroz.png'),(27,0,47,0,1,'Carne','Carne bem temperada.','carne-porco.png'),(28,0,48,0,1,'Ramen Comum','Macarrão com carne de porco, ovo, naruto e legumes.','ramen-comum.png'),(29,0,49,0,1,'Bolinho de Manju','Bolinho de doce de feijão japonês.','manju.png'),(30,0,50,0,1,'Takoyaki','Bolinho de massa recheado com pedaços cortados ou um polvo pequeno inteiro, raspas de tempura, gengibre picado e cebolinha.','takoyaki.png'),(31,0,51,0,1,'Sanduíche','Um sanduíche feito com pão, queijo, maionese e alface.','sanduiche.png'),(32,0,52,0,1,'Onigiri','Um bolinho feito de arroz com uma faixa de alga.','arroz.png'),(33,0,53,0,1,'Tamagoyaki','Omelete enrolada, formando diversos bolinhos retangulares, que podem ser recheados.','tamagoyaki.png'),(34,0,54,0,1,'Bento','Um potinho preparado com vários tipos de comidas.','bento.png'),(35,0,55,0,1,'Salada','Prato de salada e maionese com diversos temperos.','salada.png'),(36,0,56,0,1,'Churrasco','Diversos tipos de carnes feitos na churrasqueira.','churrasco.png'),(37,0,57,0,1,'Dango Caramelizado','Bolinho feito com farinha de arroz e com caramelo por cima.','dango-caramelizado.png'),(38,0,58,0,1,'Sushi','Diversos tipos de peixe cru, arroz e legumes.','sushi.png'),(39,0,59,0,1,'Carne Gigante','Um pedaço de carne gigantesco, muito maior que qualquer ser humano.','carne-gigante.png'),(40,0,60,0,1,'Ramen Completo','Macarrão reforçado com carne de diversos tipos, ovo, naruto e legumes variados.','ramen-completo.png'),(91,2,1,1,1,'Soco Aéreo','Desfere um poderoso soco após saltar e suar o corpo como impulso na queda.','soco-aereo.png'),(92,2,3,0,1,'Caminho do Kendo','Usa os estilos de artes marciais mais conhecidos.','caminho-kendo.png'),(93,2,4,3,1,'Hadou #1 - Shou','Empurra o alvo para longe do usuário.','shou.png'),(94,2,7,4,1,'Investida com Espada','Ataque com a Espada, efetuado quando está em movimento.','investida-espada.png'),(95,2,6,4,1,'Lâminas Defensivas','Uma ilusão de diversas espadas é criada para defender-se de ataques','laminas-defensivas.png'),(96,2,8,5,1,'Bala de Energia','Atira projéteis de energia espiritual que explodem ao colidir em algo.','evasao.png'),(97,2,9,0,1,'Posição Firme','Concentra sua energia ficando em posição de batalha.','posicao-firme.png'),(98,2,11,2,1,'Agarrão Aéreo','Segura o oponente com toda a força, pula e gira fazendo o oponente perder a noção de onde esta e assim arremessando o oponente ao chão.','agarrao-aereo.png'),(99,2,14,3,1,'Punho Espiritual','Usando sua energia espiritual o usuário desfere.','punho-espiritual.png'),(100,2,13,5,1,'Bakudou #8 - Seki','Cria um pequeno escudo que bloqueia e paraliza um ataque.','seki.png'),(101,2,15,2,1,'Ataque Feroz','Utiliza a espada para desferir diversos golpes contra o oponente.','ataque-feroz.png'),(102,2,16,0,1,'Golpe Reforçado','Aumenta a resistência nos golpes.','golpe-reforcado.png'),(103,2,18,1,1,'Deslocamento de Ar','Aplica um soco no ar cheio de energia espiritual, com este soco é possível deslocar o oponente e joga-lo contra a parede.','deslocamento-ar.png'),(104,2,21,4,1,'Corte Reverso','Inverte a posição da linha de corte da espada, deferindo um golpe em direção ao oponente.','corte-reverso.png'),(105,2,20,1,1,'Bakudou #37 - Tsuriboshi','Defende contra o oponente fora do alcance de visão do mesmo.','lamina-oculta.png'),(106,2,22,5,1,'Impacto Triplo','Atinge o oponente com 3 sucessivos golpes à longo alcance, com o último arremeçando-o para o chão.','impacto-triplo.png'),(107,2,23,0,1,'Shunpou','Concentra enegia espiritual nos pés, permitindo se mover muito rápido.','shunpou.png'),(108,2,25,4,1,'Corte Cruzado','Desfere 2 golpes formando um X de luz, devido a velocidade da lâmina.','corte-cruzado.png'),(109,2,28,5,1,'Lâmina Oculta','Cria lâminas mágicas que são disparadas em oponentes num raio de 1km de distância.','lamina-oculta.png'),(110,2,27,2,1,'Evasão com Shunpou','Com muita habilidade você consegue escapar dos ataques inimigos.','evasao-shunpou.png'),(111,2,29,2,1,'Impacto Fulminante','Desfere um golpe de cima para baixo em direção ao inimigo, dependendo da área de acerto, o dano é terrível.','impacto-fulminante.png'),(112,2,30,0,1,'Concentração Espiritual','Concentra-se o máximo que pode para reunir uma quantidade grande de poder espiritual.','concentracao-espiritual.png'),(113,2,32,1,1,'Hadou #4 - Byakurai','Lança um raio branco, com a intenção de perfurar o oponente.','byakurai.png'),(114,2,33,3,1,'Combustão Mágica','Faz com que o corpo do inimigo seja queimado de dentro pra fora através de sua energia espiritual.','bloqueio-corporal.png'),(115,2,34,3,1,'Bakudou #39 - Enkosen','Cria um escudo giratório de energia espiritual condensada, para deter ataques.','enkosen.png'),(116,0,112,0,1,'Soco','Dá um soco básico no inimigo.','soco.png'),(117,0,113,0,1,'Defender com as Mãos','Posiciona-se com as mãos à frente do rosto, reduzindo o ataque recebido.','defender-maos.png'),(118,3,1,2,1,'Punho Bêbado','Aplica um cascudo seguido de um chute no oponente.','punho-bebado.png'),(119,3,3,0,1,'Explosão Furiosa','Aplica um poderoso chute no rosto do oponente.','explosao-furiosa.png'),(120,3,4,5,1,'Presença de Ki','É capaz de sentir a presença dos outros através do Ki e impedir golpes.','presenca-ki.png'),(121,3,7,4,1,'Ímpeto','Aumentando sua raiva, você aguenta batalhar mais.','impeto.png'),(122,3,6,2,1,'Bloqueio Resistente','Com a ajuda do seu Ki, você é capaz de receber golpes e absorver o impacto sem sofrer dano.','bloqueio-resistente.png'),(123,3,8,1,1,'Golpe Sônico','Aplica diversos golpes de varias direções, é a habilidade de se mover tão rápido e silenciosamente, que a imagem do usuário permanece no local. ','golpe-sonico.png'),(124,3,9,0,1,'Explosão de Ki','Uma Explosão de Ki capaz de causar ferimentos graves em seu oponente.','explosao-ki.png'),(125,3,11,3,1,'Raio de Ki','Lança um pequeno feixe de ki.','raio-ki.png'),(126,3,14,1,1,'Chute Dinamite','Aplica um poderoso chute no inimigo que tenta atacar pelas costas.','chute-dinamite.png'),(127,3,13,3,1,'Aura de Ki','Libera o Ki ao seu redor, formando uma aura.','aura-ki.png'),(128,3,15,4,1,'Flexibilidade Corporal','Torna-se capaz de receber danos, mas continuar fixo no lugar.','flexibilidade-corporal.png'),(129,3,16,0,1,'Explosão de Stamina','Uma Explosão de Ki capaz de causar ferimentos graves em seu oponente.','explosao-stamina.png'),(130,3,18,3,1,'Canhão Kiai','Dispara diversas bolas de energia contra o inimigo.','canhao-kiai.png'),(131,3,21,2,1,'Soco Martelo','Utiliza as duas mãos para aplicar um forte golpe como se fosse um martelo no oponente.','soco-martelo.png'),(132,3,20,1,1,'Barreira de Ki','Concentrando seu Ki para que surgir uma Barreira poderosa de Ki para sua proteção.','barreira-ki.png'),(133,3,22,5,1,'Convergência de Energia','Converge sua energia, maximizando seu Ki.','convergencia-energia.png'),(134,3,23,0,1,'Poder Adormecido','Desperta um poder adormecido dentro de você.','poder-adormecido.png'),(135,3,25,2,1,'Soco Explosão','Golpe físico com ki centralizado nesse golpe e quando acerta o inimigo.','soco-explosao.png'),(136,3,28,4,1,'Espírito de Luta','Você aguça seus sentidos e preve os golpes dos inimigos.','espirito-luta.png'),(137,3,27,4,1,'Zanzoken','Atingi-se uma velocidade muito alta que o adversário acredita ver diversos clones.','zanzoken.png'),(138,3,29,1,1,'Canhão Kiai Carregada','O usuário aplica um gancho no estômago do inimigo seguido por um golpe no queixo e diversos feixes de energia acertam o oponente.','canhao-kiai-carregado.png'),(139,3,30,0,1,'Velocidade Sônica','Com uma Explosão de Ki você consegue atingir uma Velocidade surpreendente e seus ataques ficam mais poderosos.','velocidade-sonica.png'),(140,3,32,5,1,'Raio de Energia','Dispara um feixe de energia contínuo contra o inimigo.','raio-energia.png'),(141,3,33,3,1,'Destruição Terrestre','Libera todo seu poder de forma física, capaz de destruir montanhas e enfurecer os mares.','destruicao-terrestre.png'),(142,3,34,5,1,'Taiyoken','Uma enorme Explosão de Ki Radiante que ofusca a visão do seu oponente.','taiyoken.png'),(143,6,1,2,1,'Voadora','Correndo bem rápido, o cavaleiro dá uma voadora potente no adversário, acertando seu peitoral.','voadora.png'),(144,6,3,0,1,'Força Ampliada','Com ajuda de sua Cosmo Energia o jogador amplia sua Força deixando seus ataques físicos mais poderosos.','forca-ampliada.png'),(145,6,4,3,1,'Joelhada Cósmica','Concentra sua Cosmo-Energia em seu joelho e ataca diretamente o espírito cósmico do oponente.','joelhada.png'),(146,6,7,5,1,'Movimento Rápido','Movendo-se na velocidade do som, o cavaleiro atravessa o oponente utilizando algum objeto, e logo em seguida se vira e arremessa nas costas do seu oponente.','movimento-rapido.png'),(