e se pegar em algum órgão, na mesma hora o mesmo para de funcionar. Caso acertar no coração, é uma morte instantânea.','soco-esmagador.png'),(162,6,27,3,1,'Barreira de Cosmo','Cria uma Barreira Cósmica que ajuda a absorver o dano recebido.','barreira-cosmo.png'),(163,6,29,1,1,'Queima de Cosmo','Queima seu cosmo, intensificando sua resistência em batalha e fazendo com que seus golpes queimem o inimigo por dentro.','queima-cosmo.png'),(164,6,30,0,1,'Sentido de um Deus','Sentido que deixa qualquer acontecimento possível.','sentido-deus.png'),(165,6,32,4,1,'Investida Cósmica','Avança rapidamente para o inimigo, utilizando sua armadura e seu cosmo como arma.','bloqueio-corporal.png'),(166,6,33,3,1,'Benção Divina','Sua fé torna-se tão forte que poderes dos próprios deuses fortalecem seu golpe e acabam com o mal.','bencao-divina.png'),(167,6,34,1,1,'Cosmo Ilimitado','Eleva seu cosmo ao máximo, sendo capaz de parar os golpes inimigos apenas se concentrando.','cosmo-ilimitado.png'),(168,4,1,5,1,'Compressor de Ar','Pega qualquer objeto próximo e o lança com tanta força que o mesmo cria um vácuo ao seu redor e puxa o alvo em sua direção.','bloquear-mao.png'),(169,4,3,0,1,'Agilidade Controlada','Você ajusta sua velocidade para acompanhar os movimentos inimigos.','agilidade-controlada.png'),(170,4,4,4,1,'Lâmina Surpresa','Utiliza alguma lâmina próxima para atacar o inimigo de surpresa.','lamina-defensiva.png'),(171,4,7,3,1,'Reversão Estomacal','Dá um soco na área do estômago do adversário, torcendo seus órgãos.','reversao-estomacal.png'),(172,5,1,1,1,'Golpe Aéreo','Pula e acerta o inimigo enquanto os dois estão no alto.','golpe-aereo.png'),(173,5,3,0,1,'Poder da Amizade','Confiando nos seus amigos, você é capaz de qualquer coisa em batalha sem se preocupar com o pior.','poder-amizade.png'),(174,5,4,4,1,'Golpe Duplo','Desfere dois golpes rápidos no inimigo.','golpe-duplo.png'),(175,5,7,2,1,'Bofetada','Aparentemente é um simples tapa no inimigo, porém faz o inimigo voar, de tão fo