ogo.png'),(1298,11,3,0,1,'Troca Equivalente','A regra básica e fundamental da Alquimia.','troca-equivalente.png'),(1299,11,4,4,1,'Transmutar Espada','Usando uma origem com ferro, o alquimista é capaz de criar uma espada.','transmutar-espada.png'),(1300,11,6,4,1,'Fortalecimento de Carbono','Carbono está presente em muitas coisas e uma delas é o corpo humano, usando o disponível, cria uma rpoteção endurecida.','fortalecimento-de-carbono.png'),(1301,11,7,2,1,'Chute Alto','Um chute alto, na altura da cabeça do inimigo.','chute-alto.png'),(1302,11,8,1,1,'Fragmento de Transmutação','Restos de uma transmutação que podem ser arremeçados.','fragmento-de-transmutacao.png'),(1303,11,9,0,1,'Especialização Alquimica','Mesmo conhecendo o campo básico da alquimia, alguns alquimistas podem escolher um ramo e se especializar nele.','especializacao-alquimica.png'),(1304,11,11,1,1,'Manipular Elementos','Os elementos estão presentes em toda matéria e conhecer a composição básica das coisas, faz com que o alquimista manipule exatamente o que quer e precisa.','manipular-elementos.png'),(1305,11,13,5,1,'Transmutar Pilares','Pilares criados a partir do solo do local, com diversas finalidades.','transmutar-pilares.png'),(1306,11,14,2,1,'Exposição Alquimica','Enfraquece a ligação dos elementos e da estrutura molecular.','exposicao-alquimica.png'),(1307,11,15,5,1,'Transmutação de Projetil','Cria e dispara projeteis de materiais disponiveis no local da batalha.','transmutar-projetil.png'),(1308,11,16,0,1,'Círculo de Transmutação Pronto','Tatuagens, luvas, qualquer objeto que já contem um círculo, evitando a perca de tempo principalmente em combate.','circulo-de-transmutacao-pronto.png'),(1309,11,18,4,1,'Manipular Arma Transmutada','Aparentemente, armas transmutadas são mais fáceis e praticas de se alterar estrutura e composição, afinal, o próprio alquimista a fez daquela maneira.','manipular-arma-transmutada.png'),(1310,11,20,2,1,'Esquiva','O simples e efetivo ato de percerber o perigo e se mover rapidamente para evitar danos.','esquiva.png'),(1311,11,21,3,1,'Modificar Terreno','Utiliza o próprio corpo para se defender de golpes pesados.','modificar-terreno.png'),(1312,11,22,3,1,'Reestruturação Alquimica','Para anular e cancelar defesas, refaz a composição do que quer que esteja sendo usado como defesa.','reestruturacao-alquimica.png'),(1313,11,23,0,1,'Pulso do Dragão','O conhecimento de detectar Chi, positivo ou negativo.','pulso-do-dragao.png'),(1314,11,25,2,1,'Arte Marcial de Xing','Xing é um país conhecido pela sua arte marcial, que tem treinos rigidos e determinados.','arte-marcial-de-xing.png'),(1315,11,27,1,1,'Barreira Elemental','Ergue uma barreira que mantém energia usada na transmutação.','barreira-elemental.png'),(1316,11,28,1,1,'Direcionamento de Elemento','Agita qualquer elemento e o manipula como desejar, como criando formas ou forçando o avanço com água por exemplo.','direcionamento-elemental.png'),(1317,11,29,3,1,'Decomposição Alquimica','Separa os elementos do alvo, literalmente espalhando sua estrutura.','decomposicao-alquimica.png'),(1318,11,30,0,1,'Pedra Filosofal','Criada a partir de almas humanas, se torna um poderoso amplificador na alquimia.','pedra-filosofal.png'),(1319,11,32,4,1,'Armas Brancas de Xing','Xing é um império conhecido pela perícia na produão e uso de armas brancas e lâminas exóticas.','armas-brancas-de-xing.png'),(1320,11,33,5,1,'Transmutação a Distância','A Alkahestria dos paises orientais como Xing, é capaz de transmutar a distância com circulo de entrada e saida de energia.','transmutacao-a-distancia.png'),(1321,11,34,3,1,'Barreira de Concreto','Ergue uma espessa barreira com concreto do local.','barreira-de-concreto.png'),(1322,11,447,0,1,'Golpe da Tartaruga Serena','Você se move calmamente, mas lendo todos os movimentos do inimigo, atacando-o bem rápido e com o acerto garantido.','tartaruga-serena.png'),(1324,11,36,0,1,'Passo Relâmpago','Você se move em uma velocidade surpreendente, deixando um rastro de raio para trás, e acerta o inimigo no estômago, arremessando-o com a força do impulso.','PassoRelampago.png'),(1325,12,1,2,1,'Tapa na Cara','Desfere um rápido, mas fraco, tapa na cara do oponente.','Tapa-na-Cara.png'),(1326,12,3,0,1,'Último Desejo','Desperta o seu último desejo e te concede poderes incríveis por um tempo limitado.','Ultimo-Desejo.png'),(1327,12,4,4,1,'Golpe na Cabeça','Utiliza alguma ferramenta para golpear a cabeça do oponente.','Golpe-na-Cabeca.png'),(1328,12,6,5,1,'Armadura Caseira','Junta várias roupas comuns para criar uma armadura que pode resistir à explosões.','Armadura-de-Bloqueio-Caseira.png'),(1329,12,7,1,1,'Desfibrilador','Eletrocuta o inimigo usando um desfibrilador.','Desfibrilador.png'),(1330,12,8,5,1,'Tiro na Cabeça','Usa alguma arma de fogo para dar um rápido tiro diretamente na cabeça do oponente.','Tiro-na-Cabeca.png'),(1331,12,9,0,1,'Lupa de Personalidade','Usa uma lupa capaz de ver tudo sobre seu inimigo, te dando vantagem em combate.','Lupa-de-Personalidade.png'),(1332,12,11,3,1,'Jump Dangan','Atira um projétil mágico nas pernas do inimigo, fazendo-o pular muito alto ou impedir que ele consiga pular.','Jump-Dangan.png'),(1333,12,13,1,1,'Absorção de Chamas','Absorve um certo dano das Chamas que você normalmente levaria.','Absorcao-de-Chamas.png'),(1334,12,14,4,1,'Tacada de Baseball','Usa um taco de baseball para acertar o oponente.','Tacada-de-Baseball.png'),(1335,12,15,2,1,'Chute Enterrada','Desfere um chute de cima para baixo, enterrando o inimigo no chão.','Chute-Enterrada.png'),(1336,12,16,0,1,'Alvo na Mira','Trava o alvo na sua mira, aumentando suas chances de um tiro certeiro.','Alvo-na-Mira.png'),(1337,12,18,3,1,'Iron Stomach Dangan','Atira um projétil mágico no estômago do inimigo, permitindo-o comer de tudo ou impedindo que ele coma qualquer coisa.','Iron-Stomach-Dangan.png'),(1338,12,20,2,1,'Movimento Rápido','Se move rapidamente e consegue segurar o inimigo antes dele atacar.','Movimento-Rapido.png'),(1339,12,21,1,1,'Relâmpago Carmesim','Dispara um relâmpago avermelhado no inimigo.','Relampago-Carmesim.png'),(1340,12,22,5,1,'Armadilha de Granada','Cria uma armadilha feita de granadas, que explodem caso o fio seja tocado.','Armadilha-de-Granada.png'),(1341,12,23,0,1,'Auto-controle','Controla seus sentimentos para não afetar seu desempenho em combate.','Auto-controle.png'),(1342,12,25,2,1,'Torção de Braço','Agarra o braço do inimigo e o torce até que o inimigo se renda.','Torcao-de-Braco.png'),(1343,12,27,3,1,'Cancelamento de Força','Defende usando algum objeto, anulando totalmente a força usada pelo oponente.','Cancelamento-de-Forca.png'),(1344,12,28,4,1,'Golpe de Kendo','Utilizando uma espada de Kendo, acerta com toda força na cabeça do oponente.','Golpe-de-Kendo.png'),(1345,12,29,1,1,'Tempestade de Raios','Cria uma tempestade de raios, eletrocutando tudo em um grande alcance.','Tempestade-de-Raios.png'),(1346,12,30,0,1,'Chamas da Vontade','Desperta uma Chama usando o anel de sua família, lhe concedendo grandes poderes.','Chamas-da-Vontade.png'),(1347,12,32,3,1,'Shinu Gidan','Atira um projétil mágico na cabeça do inimigo, lhe dando poderes para realizar seus arrependimentos ou simplesmente matando-o.','Shinu-Gidan.png'),(1348,12,33,5,1,'Explosão Localizada','Redireciona toda a explosão para um único ponto específico, tendo um grande poder de ataque.','Explosao-Localizada.png'),(1349,12,34,4,1,'Bloqueio de Kendo','Usa uma espada de Kendo para bloquear até os golpes mais poderosos.','Bloqueio-de-Kendo.png'),(1350,12,447,0,1,'Golpe da Tartaruga Serena','Você se move calmamente, mas lendo todos os movimentos do inimigo, atacando-o bem rápido e com o acerto garantido.','tartaruga-serena.png'),(1351,12,36,0,1,'Passo Relâmpago','Você se move em uma velocidade surpreendente, deixando um rastro de raio para trás, e acerta o inimigo no estômago, arremessando-o com a força do impulso.','PassoRelampago.png'),(1352,12,451,0,1,'Bester','Recupera 1 da sua mana a cada 4 turnos','451.png'),(1353,12,45