sos.','Quebrar-Ossos.png'),(2566,29,20,5,1,'Manobra Aérea','Usa o 3DMG para desviar do inimigo enquanto está no ar.','Manobra-Aerea.png'),(2567,29,21,1,1,'Tempestade Catastrófica','Cria uma poderosa ventania capaz de derrubar construções e fazer pessoas comuns voarem.','Tempestade-Catastrofica.png'),(2568,29,22,4,1,'Espada Dupla','Utiliza as duas espadas ao mesmo tempo para arrancar um pedaço do corpo do alvo.','Espada-Dupla.png'),(2569,29,23,0,1,'Comando de Formação','Comanda os soldados a entrarem em formação de ataque ou de defesa.','Comando-de-Formacao.png'),(2570,29,25,5,1,'Disparo de Canhão','Dispara um poderoso tiro de canhão.','Disparo-Canhao.png'),(2571,29,27,1,1,'Manobra Tripla','Usa o 3DMG para se mover em alta velocidade e dar três voltas no alvo.','Manobra-Tripla.png'),(2572,29,28,1,1,'Lança-chamas','Usa canhões para disparar um poderoso lança-chamas capaz de cremar o inimigo.','Lanca-Chamas.png'),(2573,29,29,4,1,'Exército da Sobrevivência','Chama o Esquadrão de Sobrevivência para cortar o corpo inteiro do alvo sem parar.','Exercito-Sobrevivencia.png'),(2574,29,30,0,1,'Vendeta','Um desejo de vingança flui em você e te fortalece.','Vendeta.png'),(2575,29,32,3,1,'Trovão Dourado','Solta um trovão com uma cor dourada capaz de destruir construções apenas com a força de impacto.','Trovao-Dourado.png'),(2576,29,33,2,1,'Cavalaria da Liberdade','Chama a cavalaria do Esquadrão de Sobrevivência, que atropelam o alvo sem parar.','Cavalaria-Liberdade.png'),(2577,29,34,3,1,'Manobra Ilusória','Usando o 3DMG você se movimenta criando várias cópias de você, confundindo o inimigo.','Manobra-Ilusoria.png'),(2578,29,447,0,1,'Golpe da Tartaruga Serena','Você se move calmamente, mas lendo todos os movimentos do inimigo, atacando-o bem rápido e com o acerto garantido.','tartaruga-serena.png'),(2579,29,36,0,1,'Passo Relâmpago','Você se move em uma velocidade surpreendente, deixando um rastro de raio para trás, e acerta o inimigo no estômago, arremessando-o com a força do impulso.','PassoRelampago.png'),(2580,29,1327,3,1,'Drenagem Sanguínea','Usa magia para drenar aos poucos o sangue do inimigo, causando mais dano se existir algum ferimento aberto.','1327.png'),(2581,29,1328,1,1,'Clarão Ofuscante','Aproveita a confusão cerebral do inimigo para criar um clarão e cegá-lo, criando uma abertura para atacar.','1328.png'),(2582,29,1329,5,1,'Cristais do Zero Absoluto','Dispara diversos cristais que explodem ao tocar no inimigo, congelando seu sangue ou despedaçando-o caso já estiver congelado.','1329.png'),(2583,29,1330,2,1,'Desfiguramento Facial','Desfere uma poderosa voadora no rosto do inimigo, danificando seu crânio. Funciona melhor caso o alvo não puder se mover.','1330.png'),(2584,29,1331,3,1,'Campo de Força','Cria uma barreira mágica capaz de te proteger de golpes podersos, possuindo uma resistência extra contra ataques comuns.','1331.png'),(2585,29,1332,2,1,'Pulso Gravitacional','Altera a gravidade ao seu redor e enfraquece qualquer golpe inimigo, podendo parar com as mãos até mesmo os golpes mais fortes.','1332.png'),(2586,29,1333,0,1,'Fúria Demoníaca','No seu último suspiro de vida, desperta toda a fúria guardada dentro de si, ampliando seu poder de ataque de forma desumana.','1333.png'),(2587,29,1334,0,1,'Medo Racional','Percebe que apenas atacar pode resultar na sua morte, e racionalmente assume uma pose defensiva.','1334.png'),(2588,29,1335,2,1,'Golpe da Nuvem Vermelha','Avança rapidamente diante do inimigo, desferindo um chute no estômago e criando uma marca de nuvem em seu corpo. Esse golpe é capaz de atravessar golpes elementais e reduzir o dano recebido.','1335.png'),(2589,29,1336,3,1,'Esferas Radiantes','Cria diversas esferas de poder mágico que perseguem o inimigo. O impacto reduz a força dos golpes corpo-a-corpo do inimigo.','1336.png'),(2590,29,1337,5,1,'Canhão de Pedra','Cria um gigantesco canhão feito de pedra capaz de contra-atacar um golpe mágico, reduzindo o dano recebido por você.','1337.png'),(2591,29,1338,1,1,'Toque Eletrizante','Conduz eletricidade na palma de suas mãos, diminuindo o dano recebido por golpes de guerreiros e eletrocutando-o através da arma.','1338.png'),(2592,29,1339,4,1,'Corte Temporal','Corta o tempo e espaço para atacar o inimigo, capaz de cortar até flechas ou balas.','1339.png'),(2593,29,1340,5,1,'Hemorragia Interna','Acerta o ferimento do inimigo à distância e abre mais o ferimento e danificando os órgãos internos, causando mais sangramento.','1340.png'),(2594,29,1341,0,1,'Descarga Elétrica','Cria uma barreira ao seu redor que conduz eletricidade e te protege de golpes críticos.','1341.png'),(2595,29,1342,0,1,'Alma Gêmea','Realiza ataques com a potência de duas pessoas juntas, podendo perfurar qualquer defesa.','1342.png'),(2596,29,1343,4,1,'Desmembramento','Corta o braço ou alguma parte do inimigo de forma precisa, tornando-se quase impossível de se parar o sangramento.','1343.png'),(2597,29,1344,1,1,'Estrondo Glacial','Cria uma poderosa tempestade que congela o ar e aos poucos o corpo do inimigo, em seguida cria um poderoso estrondo que estoura o gelo e causa um grande dano no inimigo.','1344.png'),(2598,29,1345,2,1,'Desnorteamento','Executa um poderoso gancho no oponente capaz de danificar o cérebro e causar uma breve desorientação do inimigo.','1345.png'),(2599,29,1346,3,1,'Tríade Dourada','Cria uma parede triangular mágica que avança diante do inimigo, tendo a chance de anular sua fraqueza contra o golpe dele.','1346.png'),(2600,19,1451,0,1,'Sukamon e Chuumon',NULL,'1451.png'),(2601,19,1452,0,1,'Sukamon e Chuumon',NULL,'1451.png'),(2602,19,1453,0,1,'Sukamon e Chuumon',NULL,'1451.png'),(2603,19,1454,0,1,'Mega Sukamon e Mega Chuumon',NULL,'1451.png'),(2604,19,1455,0,1,'Elecmon',NULL,'1455.png'),(2605,19,1456,0,1,'Elecmon',NULL,'1455.png'),(2606,19,1457,0,1,'Elecmon',NULL,'1455.png'),(2607,19,1458,0,1,'Mega Elecmon',NULL,'1455.png'),(2608,19,1459,0,1,'PicoDevimon',NULL,'1459.png'),(2609,19,1460,0,1,'PicoDevimon',NULL,'1459.png'),(2610,19,1461,0,1,'PicoD