lto e chuta o inimigo de cima para baixo.','Chute-Espacial.png'),(2887,999,16,0,1,'Show Musical','Um show musical para incentivar a batalha.','Show-Musical.png'),(2888,999,18,4,1,'Estocada Brutal','Usa sua espada para perfurar o inimigo de forma brutal e ferí-lo gravemente.','Estocada-Brutal.png'),(2889,999,20,3,1,'Barreira Mágica','Cria uma barreira feita de magia para te proteger de ataques inimigos.','Barreira-Magica.png'),(2890,999,21,5,1,'Flechas Aeronáuticas','Dispara flechas que se transformam em pequenos aviões, que voam sob o inimigo e disparam vários tiros.','Flechas-Aeronauticas.png'),(2891,999,22,3,1,'Globo de Energia Focalizada','Concentra sua energia em um único ponto, criando um enorme globo de energia que é arremessado no inimigo.','Globo-Energia.png'),(2892,999,23,0,1,'Armadura Carmesin','Usa a lendária Armadura Carmesin para amplificar seus poderes defensivos.','Armadura-Carmesin.png'),(2893,999,25,2,1,'Impacto Aniquilador','Desfere um poderoso soco no inimigo capaz de criar ondas de choque.','Impacto-Aniquilador.png'),(2894,999,27,4,1,'Escudo Refletor','Usa um escudo capaz de bloquear e refletir os golpes inimigos.','Escudo-Refletor.png'),(2895,999,28,1,1,'Terremoto Elétrico','Bate suas mãos no chão e cria um terremoto que solta trovões do chão.','Terremoto-Eletrico.png'),(2896,999,29,4,1,'Destruição Crâniana','Usa um bastão cheio de espinhos para explodir a cabeça do inimigo.','Destruicao-Craniana.png'),(2897,999,30,0,1,'Desejo de Matar','Sente um desejo profundo de matar seu inimigos.','Desejo-Matar.png'),(2898,999,32,5,1,'Canhão de Partículas','Usa um canhão gigante para disparar um poderoso raio de partículas.','Canhao-Atirador.png'),(2899,999,33,3,1,'Incentivo de Morte','A magia transborda de seu corpo e pelo simples fato de pedir pro inimigo morrer, ele resolve se matar.','Incentivo-Morte.png'),(2900,999,34,1,1,'Muralha de Fogo','Cria uma imensa muralha feita de chamas capaz de bloquear golpes mágicos e afastar golpes físicos.','Muralha-Fogo.png'),(2901,999,447,0,1,'Golpe da Tartaruga Serena','Você se move calmamente, mas lendo todos os movimentos do inimigo, atacando-o bem rápido e com o acerto garantido.','tartaruga-serena.png'),(2902,999,36,0,1,'Passo Relâmpago','Você se move em uma velocidade surpreendente, deixando um rastro de raio para trás, e acerta o inimigo no estômago, arremessando-o com a força do impulso.','PassoRelampago.png'),(2903,999,1327,3,1,'Drenagem Sanguínea','Usa magia para drenar aos poucos o sangue do inimigo, causando mais dano se existir algum ferimento aberto.','1327.png'),(2904,999,1328,1,1,'Clarão Ofuscante','Aproveita a confusão cerebral do inimigo para criar um clarão e cegá-lo, criando uma abertura para atacar.','1328.png'),(2905,999,1329,5,1,'Cristais do Zero Absoluto','Dispara diversos cristais que explodem ao tocar no inimigo, congelando seu sangue ou despedaçando-o caso já estiver congelado.','1329.png'),(2906,999,1330,2,1,'Desfiguramento Facial','Desfere uma poderosa voadora no rosto do inimigo, danificando seu crânio. Funciona melhor caso o alvo não puder se mover.','1330.png'),(2907,999,1331,3,1,'Campo de Força','Cria uma barreira mágica capaz de te proteger de golpes podersos, possuindo uma resistência extra contra ataques comuns.','1331.png'),(2908,999,1332,2,1,'Pulso Gravitacional','Altera a gravidade ao seu redor e enfraquece qualquer golpe inimigo, podendo parar com as mãos até mesmo os golpes mais fortes.','1332.png'),(2909,999,1333,0,1,'Fúria Demoníaca','No seu último suspiro de vida, desperta toda a fúria guardada dentro de si, ampliando seu poder de ataque de forma desumana.','1333.png'),(2910,999,1334,0,1,'Medo Racional','Percebe que apenas atacar pode resultar na sua morte, e racionalmente assume uma pose defensiva.','1334.png'),(2911,999,1335,2,1,'Golpe da Nuvem Vermelha','Avança rapidamente diante do inimigo, desferindo um chute no estômago e criando uma marca de nuvem em seu corpo. Esse golpe é capaz de atravessar golpes elementais e reduzir o dano recebido.','1335.png'),(2912,999,1336,3,1,'Esferas Radiantes','Cria diversas esferas de poder mágico que perseguem o inimigo. O impacto reduz a força dos golpes corpo-a-corpo do inimigo.','1336.png'),(2913,999,1337,5,1,'Canhão de Pedra','Cria um gigantesco canhão feito de pedra capaz de contra-atacar um golpe mágico, reduzindo o dano recebido por você.','1337.png'),(2914,999,1338,1,1,'Toque Eletrizante','Conduz eletricidade na palma de suas mãos, diminuindo o dano recebido por golpes de guerreiros e eletrocutando-o através da arma.','1338.png'),(2915,999,1339,4,1,'Corte Temporal','Corta o tempo e espaço para atacar o inimigo, capaz de cortar até flechas ou balas.','1339.png'),(2916,999,1340,5,1,'Hemorragia Interna','Acerta o ferimento do inimigo à distância e abre mais o ferimento e danificando os órgãos internos, causando mais sangramento.','1340.png'),(2917,999,1341,0,1,'Descarga Elétrica','Cria uma barreira ao seu redor que conduz eletricidade e te protege de golpes críticos.','1341.png'),(2918,999,1342,0,1,'Alma Gêmea','Realiza ataques com a potência de duas pessoas juntas, podendo perfurar qualquer defesa.','1342.png'),(2919,999,1343,4,1,'Desmembramento','Corta o braço ou alguma parte do inimigo de forma precisa, tornando-se quase impossível de se parar o sangramento.','1343.png'),(2920,999,1344,1,1,'Estrondo Glacial','Cria uma poderosa tempestade que congela o ar e aos poucos o corpo do inimigo, em seguida cria um poderoso estrondo que estoura o gelo e causa um grande dano no inimigo.','1344.png'),(2921,999,1345,2,1,'Desnorteamento','Executa um poderoso gancho no oponente capaz de danificar o cérebro e causar uma breve desorientação do inimigo.','1345.png'),(2922,999,1346,3,1,'Tríade Dourada','Cria uma parede triangular mágica que avança diante do inimigo, tendo a chance de anular sua fraqueza contra o golpe dele.','1346.png'),(2923,999,1714,0,1,'Benção da Deusa da Guerra','Uma energia dourada envolve seu corpo e, além de te proteger de golpes inimigos, cura seus ferimentos.','1714.png'),(2924,0,1715,0,1,'Sem Talentos','Lute por 5 batalhas com os Talentos dos dois jogadores desligados. Essa Vantagem pode ser ligada e desligada. <br><b><span class=\"cinza\">Essa Vantagem é acumulativa.</span></b>','1715.png'),(2925,999,1716,0,1,'Estrela de Dinheiro',NULL,'1716.png'),(2926,999,1717,0,1,'Estrela de Item',NULL,'1717.png'),(2927,0,1718,0,1,'Troca de Estrelas por Moedas','Troque 2 Estrelas por 2000 Moedas.','1718.png'),(2928,0,1719,0,1,'Areia Estelar','Um poderoso reagente capaz de adicionar um novo atributo aleatório para um equipamento.<br />\n<b class=\"laranja\">Para usar: Vá em Personagem > Equipamentos e clique com o botão direito no equipamento desejado.</b>','areia.png'),(2929,0,1720,0,1,'Sangue de Deus','Um poderoso reagente capaz de adicionar dois novos atributos aleatórios para um equipamento.<br />\n<b class=\"laranja\">Para usar: Vá em Personagem > Equipamentos e clique com o botão direito no equipamento desejado.</b>','sangue.png'),(2930,0,1721,0,1,'Pergaminho','Esses Pergaminhos são localizados no Mapa do Anime Naruto e juntando eles você conseguirá recompensas exclusivas dentro de determinados Mapas do Anime Naruto.','sangue.png'),(2931,1,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2932,2,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2933,3,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2934,6,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2935,4,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2936,5,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2937,7,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2938,8,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(2939,9,1722,0,1,'Morte Súbita','Acaba com a vida de