ado','Disfere um golpe quando o inimigo está com a guarda baixa.','Ataque-Inesperado.png'),(3112,31,3,0,1,'Almas Puras','Almas puras são almas que ainda não foram corrompidas e não se tornaram ovos de Kishin.','Almas-Puras.png'),(3113,31,4,2,1,'Punhos Ágeis','Usando a energia da alma, é aplicado um rápido e poderoso golpe com a mão.','Punhos-Ageis.png'),(3114,31,6,1,1,'Esquiva Rápida','Desvia rapidamente de golpes a curta distância.','Esquiva-Rapida.png'),(3115,31,7,1,1,'Concentração Máxima','O Artesão e a Arma se concentram ao máximo para criarem uma Ressonância perfeita.','Concentracao-Maxima.png'),(3116,31,8,5,1,'Tiro Certeiro','Aplica Vários Tiros de Energia na direção do inimigo.','Tiro-Certeiro.png'),(3117,31,9,0,1,'Amizade Verdadeira','Mesmo não sendo parceiros iniciais de combate nada impede sua amizade, e juntos fazem uma grande equipe.','Amizade-Verdadeira.png'),(3118,31,11,3,1,'Controle de Alma','Um feitiço é lançado na Alma do inimigo, podendo obrigá-lo a fazer o que você quiser.','Controle-Alma.png'),(3119,31,13,2,1,'Bloqueio Simples','Bloqueia golpes próximos com uma defesa consistente.','Bloqueio-Simples.png'),(3120,31,14,4,1,'Corte Diagonal','Aplica um golpe poderoso com sua arma, cortando profundamente quem entrar na sua frente.','Corte-Diagonal.png'),(3121,31,15,1,1,'Coragem','Todos os Seus medos são deixados de lado. Com isso nada o impede de lutar até o fim.','Coragem.png'),(3122,31,16,0,1,'Companheirismo','Armas e Artesãos precisam de harmonia para lutar, mas há momentos de fraqueza difíceis de superar. Mas seu parceiro vai sempre estar pronto para te ajudar no que for preciso.','Companheirismo.png'),(3123,31,18,5,1,'Gun Blast','Aplica um poderoso tiro de energia espiritual na barriga do oponente.','Gun-Blast.png'),(3124,31,20,4,1,'Defesa Armada','Usa sua própria arma para parar o ataque inimigo, possibilitando um contra ataque.','Defesa-Armada.png'),(3125,31,21,2,1,'Golpe Profundo','Disfere um ataque cortante na barriga do inimigo. ','Golpe-Pro