uínea','Usa magia para drenar aos poucos o sangue do inimigo, causando mais dano se existir algum ferimento aberto.','1327.png'),(3139,31,1328,1,1,'Clarão Ofuscante','Aproveita a confusão cerebral do inimigo para criar um clarão e cegá-lo, criando uma abertura para atacar.','1328.png'),(3140,31,1329,5,1,'Cristais do Zero Absoluto','Dispara diversos cristais que explodem ao tocar no inimigo, congelando seu sangue ou despedaçando-o caso já estiver congelado.','1329.png'),(3141,31,1330,2,1,'Desfiguramento Facial','Desfere uma poderosa voadora no rosto do inimigo, danificando seu crânio. Funciona melhor caso o alvo não puder se mover.','1330.png'),(3142,31,1331,3,1,'Campo de Força','Cria uma barreira mágica capaz de te proteger de golpes podersos, possuindo uma resistência extra contra ataques comuns.','1331.png'),(3143,31,1332,2,1,'Pulso Gravitacional','Altera a gravidade ao seu redor e enfraquece qualquer golpe inimigo, podendo parar com as mãos até mesmo os golpes mais fortes.','1332.png'),(3144,31,1333,0,1,'Fúria Demoníaca','No seu último suspiro de vida, desperta toda a fúria guardada dentro de si, ampliando seu poder de ataque de forma desumana.','1333.png'),(3145,31,1334,0,1,'Medo Racional','Percebe que apenas atacar pode resultar na sua morte, e racionalmente assume uma pose defensiva.','1334.png'),(3146,31,1335,2,1,'Golpe da Nuvem Vermelha','Avança rapidamente diante do inimigo, desferindo um chute no estômago e criando uma marca de nuvem em seu corpo. Esse golpe é capaz de atravessar golpes elementais e reduzir o dano recebido.','1335.png'),(3147,31,1336,3,1,'Esferas Radiantes','Cria diversas esferas de poder mágico que perseguem o inimigo. O impacto reduz a força dos golpes corpo-a-corpo do inimigo.','1336.png'),(3148,31,1337,5,1,'Canhão de Pedra','Cria um gigantesco canhão feito de pedra capaz de contra-atacar um golpe mágico, reduzindo o dano recebido por você.','1337.png'),(3149,31,1338,1,1,'Toque Eletrizante','Conduz eletricidade na palma de suas mãos, di