de','Agindo de forma estranha, é capaz de cometer loucuras, como assassinato.','17.png'),(3180,30,25,4,1,'Corte Profundo','Utiliza uma espada para fazer um corte profundo no oponente.','18.png'),(3181,30,27,2,1,'Barreira Corporal','Utiliza-se a força do próprio corpo para absorver e reduzir o dano recebido.','19.png'),(3182,30,28,1,1,'Moto Explosiva','Coloca explosivos em uma moto e a joga contra o inimigo.','20.png'),(3183,30,29,2,1,'Chute Reverso','Gira o corpo e desfere um poderoso chute invertido no inimigo.','21.png'),(3184,30,30,0,1,'Poder Incontrolável','Perde o controle de seus poderes, liberando toda sua força oculta.','22.png'),(3185,30,32,4,1,'Retaliação','Utiliza algum objeto afiado ou as próprias mãos para cortar o inimigo em pedaços.','23.png'),(3186,30,33,3,1,'Destruição Mental','Utiliza-se de métodos psicológicos para enlouquecer e destruir a mente do oponente.','24.png'),(3187,30,34,1,1,'Proteção de Fogo','Cria uma aura de fogo que o protege contra qualquer golpe.','25.png'),(3188,30,447,0,1,'Golpe da Tartaruga Serena','Você se move calmamente, mas lendo todos os movimentos do inimigo, atacando-o bem rápido e com o acerto garantido.','tartaruga-serena.png'),(3189,30,36,0,1,'Passo Relâmpago','Você se move em uma velocidade surpreendente, deixando um rastro de raio para trás, e acerta o inimigo no estômago, arremessando-o com a força do impulso.','PassoRelampago.png'),(3190,30,1327,3,1,'Drenagem Sanguínea','Usa magia para drenar aos poucos o sangue do inimigo, causando mais dano se existir algum ferimento aberto.','1327.png'),(3191,30,1328,1,1,'Clarão Ofuscante','Aproveita a confusão cerebral do inimigo para criar um clarão e cegá-lo, criando uma abertura para atacar.','1328.png'),(3192,30,1329,5,1,'Cristais do Zero Absoluto','Dispara diversos cristais que explodem ao tocar no inimigo, congelando seu sangue ou despedaçando-o caso já estiver congelado.','1329.png'),(3193,30,1330,2,1,'Desfiguramento Facial','Desfere uma poderosa voadora no rosto do inim