42,0,1,'Alma Gêmea','Realiza ataques com a potência de duas pessoas juntas, podendo perfurar qualquer defesa.','1342.png'),(3206,30,1343,4,1,'Desmembramento','Corta o braço ou alguma parte do inimigo de forma precisa, tornando-se quase impossível de se parar o sangramento.','1343.png'),(3207,30,1344,1,1,'Estrondo Glacial','Cria uma poderosa tempestade que congela o ar e aos poucos o corpo do inimigo, em seguida cria um poderoso estrondo que estoura o gelo e causa um grande dano no inimigo.','1344.png'),(3208,30,1345,2,1,'Desnorteamento','Executa um poderoso gancho no oponente capaz de danificar o cérebro e causar uma breve desorientação do inimigo.','1345.png'),(3209,30,1346,3,1,'Tríade Dourada','Cria uma parede triangular mágica que avança diante do inimigo, tendo a chance de anular sua fraqueza contra o golpe dele.','1346.png'),(3210,30,1714,0,1,'Benção da Deusa da Guerra','Uma energia dourada envolve seu corpo e, além de te proteger de golpes inimigos, cura seus ferimentos.','1714.png'),(3211,30,1722,0,1,'Morte Súbita','Acaba com a vida de seu inimigo num piscar de olhos.',NULL),(3212,30,1723,0,1,'Tentativa de Homicídio','Falha ao tentar matar o inimigo instantaneamente, porém acerta um poderoso golpe que o fere gravemente.',NULL),(3213,30,1858,0,1,'Jutsu de Substituição','Substitue o seu próprio corpo por algum objeto, geralmente com um bloco de madeira. Isso cria uma ilusão de ótica, fazendo com que o inimigo pense que o ataque foi bem sucedido.','1858.png'),(3214,0,1864,0,1,'Memorização de Personagem','Pode trocar para personagens que já tenha trocado antes por um valor menor.<br><b>Atenção:</b> suas habilidades, especialidades e golpes também serão trocados.','1864.png'),(3215,3,1865,0,1,'Esferas do Dragão',NULL,'1865.png'),(3216,3,1866,0,1,'Esferas do Dragão de Namekusei',NULL,'1866.png'),(3217,3,1867,0,1,'Esferas do Dragão de Namekusei',NULL,'1866.png'),(3218,0,1870,0,1,'Joia de Encantamento - Jade','Joia de Encantamento comum usada para encantar seus golpes.','1870.png'),(3219,0,1871,0,1,'Joia de Encantamento - Obsidiana','Joia de Encantamento comum usada para encantar seus golpes.','1871.png'),(3220,0,1872,0,1,'Joia de Encantamento - Zircão','Joia de Encantamento comum usada para encantar seus golpes.','1872.png'),(3221,0,1873,0,1,'Joia de Encantamento - Turquesa','Joia de Encantamento rara usada para encantar seus golpes.','1873.png'),(3222,0,1874,0,1,'Joia de Encantamento - Rubi','Joia de Encantamento rara usada para encantar seus golpes.','1874.png'),(3223,0,1875,0,1,'Joia de Encantamento - Safira','Joia de Encantamento rara usada para encantar seus golpes.','1875.png'),(3224,0,1876,0,1,'Joia de Encantamento - Topázio','Joia de Encantamento lendária usada para encantar seus golpes.','1876.png'),(3225,0,1877,0,1,'Joia de Encantamento - Ametista','Joia de Encantamento lendária usada para encantar seus golpes.','1877.png'),(3226,32,1,4,1,'Battoujutsu','Uma técnica que consiste em desembainhar a espada em alta velocidade e realizar um golpe em seguida.','1.png'),(3227,32,3,0,1,'Prova de Confiança','Recebendo um Lenço como prova de confiança, o usuario se enche de força e se prepara para enfrentar o inimigo.','2.png'),(3228,32,4,5,1,'Arremesso de Tigela','Arremessa uma tigela no rosto do inimigo para criar uma distração.','3.png'),(3229,32,6,4,1,'Bloqueio no Ar','Bloqueia a espada inimiga enquanto a mesma se encontra no ar.','4.png'),(3230,32,7,1,1,'Lança-Chamas','Utilizando uma bolsa de Óleo em sua barriga e pedras de fogo em sua boca, o usuario é capaz de cuspir fogo como um dragão.','5.png'),(3231,32,8,3,1,'Isukumi','Uma técnica que paralisa o inimigo de medo ao fazer contato visual.','6.png'),(3232,32,9,0,1,'Hipnóse','Usa Hipnóse em si mesmo para aumentar sua força.','7.png'),(3233,32,11,2,1,'Golpe Incapacitador','Golpe utilizando a bainha da espada para danificar os músculos do braço do adversario e impossibilitar que ele lute.','8.png'),(3234,32,13,2,1,'Escudo de Tatame','Utiliza um Tatami para se defender dos ataques inimigos.','9.png'),(3235,32,14,5,1,'Dardos Espirais','Dardos em forma espiral carregados de um veneno mortal capaz de matar em poucas horas.','10.png'),(3236,32,15,2,1,'Golpe com a Bainha','O usuário desfere um golpe utilizando a bainha da espada, no olho do inimigo, diminuindo sua capacidade de visão.','11.png'),(3237,32,16,0,1,'Intimidar','Libera um grande instinto assassino, fazendo com que o inimigo recue.','12.png'),(3238,32,18,3,1,'Izuna','Uma técnica onde a espada oscila no ar e cria uma espada de energia capaz de cortar ossos e nervos como se fossem papel.','13.png'),(3239,32,20,1,1,'Redirecionar','Utilizando sua espada e o vento, muda o ataque inimigo de direção.','14.png'),(3240,32,21,1,1,'Battoujutsu: Espada de Vento','Battoujutsu utilizando uma espada de vento que corta tudo em sua frente e torna o adversario incapaz de defender a si próprio.','15.png'),(3241,32,22,4,1,'Estilo Jigen: Golpe da Espada Única','O golpe possui o nome de Espada Unica por ser capaz de derrotar o inimigo em um unico golpe e é considerado um dos golpes de kenjutsu mais poderosos, dependendo do seu usuário.','16.png'),(3242,32,23,0,1,'Mão Leve','Possui mão leve capaz de roubar qualquer coisa e passar despercebido.','17.png'),(3243,32,25,2,1,'Golpe com a Palma da Mão','Utilizando sua perícia em artes marciais, o usuario desfere um ataque com a mão aberta que faz com que o inimigo perca sua consciência na hora.','18.png'),(3244,32,27,5,1,'Arma Escondida','Utilizando uma arma escondida, atira dardos no ombro do oponente fazendo ele errar.','19.png'),(3245,32,28,3,1,'Shin no Ippo','Uma técnica onde o usuário projeta seu chi no adversario e paralisa seu canal respiratório, fazendo com que ele perca a consciência lentamente.','20.png'),(3246,32,29,5,1,'Metralhadora','Uma arma Ocidental capaz de realizar vários disparos em um curto intervalo de tempo e assim fazendo com que o adversario fique incapaz de se mover livremente sem ser atingido.','21.png'),(3247,32,30,0,1,'Alguem para Proteger','Usando seu desejo de proteger a pessoa amada, o usuario libera uma grande onda de energia pelo corpo todo que aumenta sua força.','22.png'),(3248,32,32,4,1,'Blood Rain','Corta o inimigo enquanto o mesmo se encontra no ar e cria assim uma chuva de sangue.','23.png'),(3249,32,33,1,1,'Tornado de Chamas','Uma variação da técnica Lança-Chamas, onde o usuario ao cuspir fogo, controla a chama e cria um tornado, aprisionando o adversário.','24.png'),(3250,32,34,3,1,'Esquiva Divina','Usando a velocidade Divina, é capaz de se esquivar do golpe inimigo.','25.png'),(3251,32,447,0,1,'Golpe da Tartaruga Serena','Você se move calmamente, mas lendo todos os movimentos do inimigo, atacando-o bem rápido e com o acerto garantido.','tartaruga-serena.png'),(3252,32,36,0,1,'Passo Relâmpago','Você se move em uma velocidade surpreendente, deixando um rastro de raio para trás, e acerta o inimigo no estômago, arremessando-o com a força do impulso.','PassoRelampago.png'),(3253,32,1327,3,1,'Drenagem Sanguínea','Usa magia para drenar aos poucos o sangue do inimigo, causando mais dano se existir algum ferimento aberto.','1327.png'),(3254,32,1328,1,1,'Clarão Ofuscante','Aproveita a confusão cerebral do inimigo para criar um clarão e cegá-lo, criando uma abertura para atacar.','1328.png'),(3255,32,1329,5,1,'Cristais do Zero Absoluto','Dispara diversos cristais que explodem ao tocar no inimigo, congelando seu sangue ou despedaçando-o caso já estiver congelado.','1329.png'),(3256,32,1330,2,1,'Desfiguramento Facial','Desfere uma poderosa voadora no rosto do inimigo, danificando seu crânio. Funciona melhor caso o alvo não puder se mover.','1330.png'),(3257,32,1331,3,1,'Campo de Força','Cria uma barreira mágica capaz de te proteger de golpes podersos, possuindo uma resistência extra contra ataques comuns.','1331.png'),(3258,32,1332,2,1,'Pulso Gravitacional','Altera a gravidade ao seu redor e enfraquece qualquer golpe inimigo, podendo parar com as mãos até mesmo os golpes mais fortes.','1332