.','6.png'),(3287,16,9,0,1,'Familiar','Criaturas mantidas por contrato capazes de realizar qualquer vontade de seus mestres.','7.png'),(3288,16,11,5,1,'Lanças de Luz','Atira diversos raios em forma de lança no oponente.','8.png'),(3289,16,13,4,1,'Desvio com Espada','Usa uma espada para desviar o golpe inimigo.','9.png'),(3290,16,14,2,1,'Chute Alto','Desfere um poderoso chute de baixo para cima no queixo do oponente.','10.png'),(3291,16,15,4,1,'Golpe Rápido','Em um rápido movimento, usa o cabo da espada para acertar o queixo do oponente.','11.png'),(3292,16,16,0,1,'Asas do Inferno','Asas Demoníacas e Infernais capazes de bloquear qualquer golpe mágico.','12.png'),(3293,16,18,5,1,'Tiro Sagrado','Usa água benta como arma, fazendo todo ser demoníaco sofrer muito ao ser atingido por apenas gotas.','13.png'),(3294,16,20,2,1,'Defesa Imediata','Se defende imediatamente usando sua mão para parar o golpe inimigo.','14.png'),(3295,16,21,3,1,'Penas Ilusórias','Magia ilusória onde penas negras caem do céu. Quem tocar nessas penas sentirá uma dor muito intensa.','15.png'),(3296,16,22,1,1,'Bola de Fogo','Usa seu poder demoníaco para arremessar uma bola com muita força e então cria um círculo mágico na trajétoria da bola, fazendo com que ela pegue fogo e acerte o inimigo.','16.png'),(3297,16,23,0,1,'Poder Latente','Um poder que pode despertar a qualquer momento, tornando o usuário muito mais poderoso.','17.png'),(3298,16,25,2,1,'Soco Meteoro','Concentra energia no punho, sendo capaz de destruir rochas enormes com apenas um soco.','18.png'),(3299,16,27,1,1,'Chama Protetora','Envolve o corpo em chamas, protegendo-o de qualquer ataque.','19.png'),(3300,16,28,4,1,'Roda de Lâminas','Uma roda de Lâminas é criada ao redor do inimigo, em seguida, todas o perfuram.','20.png'),(3301,16,29,1,1,'Trovão Demoníaco','Libera uma enorme quantidade de energia, fazendo com que o céu escureça e trovões caiam sobre o inimigo.','21.png'),(3302,16,30,0,1,'Possessão Demoníaca','Ao ser possuído por um demô