DROP TABLE IF EXISTS `item_effects`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `item_effects` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `effect_type` enum('normal','percent') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'normal',
  `effect_direction` enum('buff','debuff') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'buff',
  `secret` tinyint(1) NOT NULL DEFAULT '0',
  `bleeding` int(11) NOT NULL DEFAULT '0',
  `stun` int(11) NOT NULL DEFAULT '0',
  `slowness` int(11) NOT NULL DEFAULT '0',
  `confusion` int(11) NOT NULL DEFAULT '0',
  `for_atk` int(11) NOT NULL DEFAULT '0',
  `for_def` int(11) NOT NULL DEFAULT '0',
  `for_crit` int(11) NOT NULL DEFAULT '0',
  `for_crit_inc` int(11) NOT NULL DEFAULT '0',
  `for_abs` int(11) NOT NULL DEFAULT '0',
  `for_abs_inc` int(11) NOT NULL DEFAULT '0',
  `for_prec` int(11) NOT NULL DEFAULT '0',
  `for_init` int(11) NOT NULL DEFAULT '0',
  `for_hit` int(11) NOT NULL DEFAULT '0',
  `attack_speed` int(11) NOT NULL DEFAULT '0',
  `next_mana_cost` int(11) NOT NULL DEFAULT '0',
  `lock_random_technique` int(11) NOT NULL DEFAULT '0',
  `copy_last_technique` int(11) NOT NULL DEFAULT '0',
  `last_hit_dont_die` int(11) NOT NULL DEFAULT '0',
  `null_next_attack` int(11) NOT NULL DEFAULT '0',
  `turns_attack_to_elemental` int(11) NOT NULL DEFAULT '0',
  `turns_attack_to_neutral` int(11) DEFAULT '0',
  `turns_attack_to_fighter` int(11) NOT NULL DEFAULT '0',
  `turns_attack_to_magic` int(11) NOT NULL DEFAULT '0',
  `turns_attack_to_warrior` int(11) NOT NULL DEFAULT '0',
  `turns_attack_to_ranger` int(11) NOT NULL DEFAULT '0',
  `removes_stun` int(11) NOT NULL DEFAULT '0',
  `remove_slowness` int(11) NOT NULL DEFAULT '0',
  `remove_bleeding` int(11) NOT NULL DEFAULT '0',
  `remove_confusion` int(11) NOT NULL DEFAULT '0',
  `double_bleeding_chance` int(11) NOT NULL DEFAULT '0',
  `double_stun_chance` int(11) NOT NULL DEFAULT '0',
