INSERT INTO `time_quest_descriptions` VALUES (1,1,0,1,'Reconhecendo o Inimigo','Você enfrentrará diversos inimigos durante sua jornada, e é importante reconhecer suas origens e habilidades. Estude cada um deles e aprenda enfrentá-los.'),(2,2,0,1,'Ninja Fugitivo','Um ninja roubou um pergaminho que contém um jutsu muito poderoso e está se escondendo nas montanhas. Encontre-o e nos informe.'),(3,3,0,1,'Cavaleiro Trapaceiro','Na arena da Guerra Galática, um cavaleiro trapaceou para vencer e levar a armadura de ouro embora. Agora que descobrimos, encontre-o e nos informe sua localização o mais rápido possível.'),(4,4,0,1,'Pirata que rouba Pirata','Um pirata é um pirata, mas um pirata que rouba outro pirata é um verdadeiro criminoso nesses mares. Encontre-o e nos informe para ensinarmos a ele que não se deve mexer com outro pirata.'),(5,5,0,1,'Galã Mágico','Um mago deve honrar o brasão de sua guilda, mas aparentemente um mago com a magia de Encanto está enfeitiçando as mulheres e sujando o nome de outro mago. Encontre-o imediatamente.'),(6,6,0,1,'Ladrão de Almas','Um perigoso habitante do mundo espiritual foi para o mundo dos humanos e está roubando a alma das pessoas com a luva Gokon Tekkou. Encontre-o e nos informe.'),(7,7,0,1,'Coleta de Informações','Precisamos que você vá até um país distante e espione as ações dos nossos possíveis inimigos.'),(8,8,0,1,'Radar Quebrado','Um radar que usamos para encontrar as famosas Esferas do Dragão ficou danificado com o impacto da nossa última luta. Pode levar para a manutenção na Corporação Cápsula pra mim ?'),(9,9,0,1,'Fechando as Fendas','Diversas fendas que ligam o mundo dos demônios se abriram na cidade, mas elas ainda estão pequenas. Corra e feche-as o mais rápido possível.'),(10,10,0,1,'Ovos de Bestas Espirituais','Dentro destes ovos existem bestas espirituais, que ao nascer, refletem a personalidade de seu mestre. Se o seu mestre for mal, a besta nascerá e devorará até o espírito das pessoas, portanto vá até lá e cuide desses ovos para ter certeza que nenhuma pessoa má tome conta de um deles.'),(11,11,0,1,'Comida Exótica','Diversos guerreiros estão iniciando uma competição de comida, mas não com ingredientes comuns. A competição envolve a caçada de bestas assustadoras, mas com um ótimo sabor! Como eles estão se preparando muito longe daqui, você poderia levar para eles esta nova lista de ingredientes ?'),(12,12,0,1,'Espadachim das Chamas','Um temível espadachim está usando suas habilidades misturadas com óleo para criar chamas diretamente dos seus cortes. Ele é muito perigoso para você enfrentá-lo sozinho, portanto apenas analise suas batalhas e nos traga um relatório.'),(13,13,0,1,'Proteção do Santuário','Nossa Deusa irá fazer o ritual de iluminação do mundo em poucos dias, e precisamos de um guarda-costas para protegê-la enquanto o ritual é executado. Conto com você.'),(14,14,0,1,'Miasma Letal','Um poderoso Hanyou espalhou um miasma extremamente letal que está corroendo tudo por onde passa, e está indo em direção à um pequeno vilarejo nas montanhas. Se você sair agora, chegará a tempo de evacuar a vila, então corra !'),(15,15,0,1,'Lacrimas Descontroladas','Recebemos um relatório urgente de que os cristais de lacrima da cidade estão emanando muito poder e estão saindo de controle. Corra até lá e normalize os poderes delas antes a cidade seja destruída.'),(16,16,0,1,'Padre Milagroso','Ouvimos boatos de que um padre está realizando milagres que podem até reviver alguém morto. Como já era de se esperar, ele está usando uma pequena Pedra Filosofal como anel. Vá até lá e destrua aquele anel antes que os mortos comecem a andar por toda a cidade.'),(17,17,0,1,'Justiceiro Psicopata','Um livro do mundo dos mortos caiu nas mãos de um humano, que descobriu que ele consegue matar qualquer um apenas escrevendo seu nome completo. Apesar de estar matando apenas criminosos, ele ainda é um assassino e precisa ser detido. Encontre uma forma de pegar seu livro e acabar com toda essa maluquisse.'),(18,18,0,1,'Luta pelo Graal','A batalha pelo Santo Graal, que pode realizar qualquer desejo, está prestes a começar. O problema é que eles estarão colocando em risco a vida de milhares de pessoas realizando essa batalha em uma cidade inteira. Vá conversar com a Igreja e os convença de realizar essa batalha longe da sociedade.'),(19,19,0,1,'Guerra entre Nações','Três nações sempre conseguiram entrar em um acordo de paz, mas uma das nações é apaixonada por dominação e guerras, então eles já estão planejando um novo ataque. Vá pessoalmente até o Senhor do Fogo e impeça que ele inicie uma nova guerra.'),(20,20,0,1,'Frutas Mortais','Existem algumas frutas que, ao serem comidas, te dão poderes incríveis, mas são únicas. Quando o usuário morre, ela renasce, e uma guerra é criada para coletá-la. Temos uma ideia de onde ela possa ter aparecido, então vá até lá e traga-a para nós em segurança o mais rápido possível.'),(21,21,0,1,'Ladrões das Trevas','Uma organização composta por 13 ladrões estão planejando atacar o leilão da cidade e roubar todos os itens do cofre. Temos pouco tempo até isso acontecer, então descubra o esconderijo deles e traga reforços antes que seja tarde.'),(22,22,0,1,'Conquistador de Planetas','Um ser extremamente poderoso apareceu na Terra, e está destruindo cidades rapidamente. Encontre-o, tome cuidado para não ser detectado por ele, e nos informe.\n'),(26,23,0,1,'Meu Primeiro Bichinho','Que tal ter um mascote pra te ajudar em combates? Ao finalizar essa missão, te darei um mascote aleatório. Para equipá-lo, vá em Personagem > Mascotes!'),(27,24,0,1,'Pikachu em Apuros','Essa não! A Equipe Rocket sequestrou o Pikachu de novo, mas essa vez foi enquanto o Ash dormia e ele não sabe onde eles estão. Procure-os, e quem sabe o Pikachu não queira se tornar seu companheiro?'),(28,25,0,1,'Limpando o Depósito','Nosso depósito está uma bagunça! Porque você não vai lá limpar? Bom, se você achar alguma coisa, pode ficar para você. É o mínimo que posso fazer!'),(29,26,0,1,'Monstros Digitais','Está vendo essas maravilhosas criaturas em nosso mundo? Eles são Digimons. seres digitais! Que tal se apresentar para eles? Talvez algum queira ser seu parceiro!'),(30,27,0,1,'Ajudando os Feridos','Muitos aliados se feriram em batalha e não temos muitos auxiliares. Como você não é médico, pode cuidar da parte de remover os equipamentos deles e limpar a infecção?'),(31,28,0,1,'Caos no Campo de Batalha','Perdemos muitos guerreiros nessa batalha, mas o Sir Dovahkon conseguiu nos enviar um sinal antes de morrer, sinalizando que está com o que fomos buscar. Vá até lá depressa e prove que a morte dele não foi em vão!'),(32,29,0,1,'Fuga das Feras','Parece que a última batalha que tivemos assustaram todas as criaturas daquela área, e agora eles estão correndo um grande perigo indo para outra batalha! Salve-os depressa!'),(33,30,0,1,'O Deus da Morte','Um misterioso caderno com capa preta foi encontrado em uma região isolada da cidade. Segundo as lendas, quem tocar no caderno passará a ver um Shinigami, um Deus da Morte. Quer ir até lá e ver se tem coragem de tocar?'),(34,31,0,1,'Lar dos Monstros','Diz a lenda que em algum lugar daqui existe um vale depois de uma caverna onde as mais estranhas criaturas vivem. Está interessado em procurá-la?'),(35,32,1,1,'Pergaminho Secreto','Chegou a hora. Você está preparado. Sente-se aqui, e vou lhe contar a história dos ninjas desde o princípio, e no final, lhe entregarei este pergaminho.'),(36,33,2,1,'Insígneas Espirituais','Chegou a hora. Você está preparado. Sente-se aqui, e vou lhe contar a história dos shinigamis desde o princípio, e no final, lhe entregarei esta insígnia.'),(37,34,3,1,'Fundação da Corporação Cápsula','Viva! Finalmente concluímos a construção da corporação cápsula! Me ajude a carregar essas caixas lá pra trás e eu te darei uma cápsula em troca!'),(38,35,4,1,'Tesouros Preciosos','É isso! Nós conseguimos! Nossa tripulação achou o tesouro dos tesouros! E por nos ajudar a procurar, vamos comer e beber juntos! Te prometo que te dou um tesouro no final!'),(39,36,5,1,'Lácrimas Mágicas','O mundo de Edolas, um paralelo ao nosso, não possui magia, e então eles usam lácrimas para aumentar seus poderes. Venha comigo que eu vou te mostrar o incrível poder delas e te darei uma no final.'),(40,37,6,1,'Armaduras Cósmicas','Todos os cavaleiros foram escolhidos por suas armaduras, e cada um escolhe o que protege. Vamos, caminhe um pouco comigo, e após entender nossa história, tenho certeza que uma armadura te escolherá.'),(41,38,7,1,'Um Grande Detetive','Vejo que o poder espiritual flui em você. Você sabe o que nós fazemos? Sente-se, que eu lhe explicarei tudo, e te darei uma ferramenta espiritual no final.'),(42,39,8,1,'Caçar ou ser Caçado','O mundo onde vivemos é cheio de perigos, mas cheio de maravilhas. Sei que você vai ser realmente forte um dia, então que tal começar com esse equipamento?'),(43,40,9,1,'O Melhor Jogador','Correr, pular, batalhar! É isso que nós jogadores fazemos, tudo para chegar ao topo e se tornar o melhor jogador que existe, não é? Tenho confiança em você, e por isso vou te dar esse equipamento. Boa sorte!'),(44,41,10,1,'Guerreiras Mágicas','Nós vivemos para proteger a paz e o amor no nosso mundo! Fomos escolhidas para combater as forças do mal, então fique com esse acessório, e juntas purificaremos esse mundo das trevas!'),(45,42,0,1,'O Trono da Guerra','Tivemos muitas batalhas para encontrar esse trono. Dizem que só o verdadeiro rei pode sentar, e comandar todo o mundo. Não tenho certeza que estamos perto, mas sinto o poder cada vez mais próximo! Como nosso soldado mais forte, quero que vá até lá!'),(46,43,11,1,'Poder de Alquimista','Você pode até ter aprendido alquimia, mas vou lhe explicar um pouco sobre as Pedras Filosofais e no final te darei uma para amplificar seus poderes.'),(47,44,12,1,'Anel Mafioso','Nós mafiosos usamos aneis magicos que amplificam nossos poderes. Vamos, sente que eu vou te explicar sobre esse aqui antes de te dar.'),(48,45,29,1,'Soldado da Humanidade','Devemos sempre estar preparados para proteger a humanidade dos titãs, então venha comido até o arsenal para pegar seu equipamento!'),(49,46,999,1,'Somos Estrelas','Se nós estamos aqui, somos importantes, e por isso devemos brilhar como grandes estrelas! Venha comigo, vou te entregar uma estrela para você ficar mais forte!'),(55,52,0,1,'Sempre de Barriga Cheia','Cada batalha gasta sua Stamina, e para recuperar você deve comer. Consiga comida na Roleta ou em outros lugares e use ela no seu Inventário!'),(54,51,0,1,'Meu Primeiro Equipamento','Devemos sempre estar preparados para o combate, então ao concluir essa missão, lhe darei um equipamento. Depois vá no menu Personagem > Equipamentos para equipá-lo!'),(56,53,0,1,'Habilidades e Especialidades','Uma das coisas mais importantes da batalha é saber usar as Habilidades e Especialidades. Altere de acordo com sua preferência no menu Personagem > Habilidades e Especialidades!'),(57,54,0,1,'Talentos','Ao evoluir sua conta, você pode colocar novos Talentos em qualquer personagem da conta! Basta ir em Personagem > Talentos.'),(58,55,0,1,'Treinamento de Atributos','Assim como os Talentos, você só ganha novos pontos ao evoluir sua conta, e então deverá ir em Academia > Treinamento de Atributos!'),(59,56,0,1,'Evoluindo a Conta nas Batalhas','Fazendo essas missões provavelmente você notou que não está evoluindo sua conta tanto assim. Para isso, você deve batalhar NPC e PVP! Acredito que você já está pronto, então boa sorte!'),(60,57,0,1,'Graduando','Assim que você conseguir Level 5 e ter vencido pelo menos um NPC, você já pode graduar! E isso significa que você conseguirá equipamentos cada vez mais fortes daqui pra frente!'),(61,58,31,1,'Aluno da Shibusen','Preste atenção! Agora você terá uma aula completa sobre Almas, e se você ficar até o final, te entregarei uma para te deixar mais forte.'),(62,59,0,1,'Limpando a Escola de Artesãos','Você é o encarregado de limpar todas as salas de aula da Shibusen, mas ande rápido antes que a escola feche!'),(63,60,0,1,'Caçador de Bruxas','Várias bruxas estão tramando um ataque, sua missão é derrotar todas antes que cheguem na Shibusen.'),(64,61,0,1,'Assassino em Série','O Assassino em série \"Jack, o Estripador\" atacou novamente, desta vez ele atacou duas mulheres e pegou suas almas, vá atrás dele e o mate antes que um Kishin nasça.'),(65,62,0,1,'Bruxa em Death City','Uma Bruxa foi detectada nos arredores da cidade, descubra seus objetivos e use a força se for necessário. Mas em hipótese alguma confie em uma Bruxa.'),(66,63,0,1,'Assalto ao Santuário','Foi visto na noite passada um individuo saindo do santuário, e tudo indica que ele foi o responsável pelo roubo de uma das armaduras de ouro, encontre esse individuo antes que a armadura sagrada caia em mãos erradas!'),(67,64,0,1,'Colisão com a Terra','A Lua começou a entrar na atmosfera da terra. Ela esta se desintegrando e se dividindo em vários pedaços. Junte os melhores Ninjas que encontrar e junto com eles pare todos os meteoritos que vierem na direção da vila!'),(68,65,0,1,'Death City em Apuros','Explosões foram vistas em vários pontos de Death City, e o que todos temiam pode ter se tornado realidade: Um novo Kishin nasceu. Vá em direção aos locais da explosões e evite que mais pessoas sejam feridas, e tente derrotá-lo a todo custo.'),(69,66,0,1,'Titãs Enfurecidos','Foi notado um comportamento estranho com vários Titãs, eles estão mais violentos e rápidos, em poucos minutos destruiram uma cidade inteira e são poucas as chances de terem sobreviventes. Vá com seus melhores soldados no local e acabe com essa matança.'),(70,67,0,1,'Ataque das Formigas','Foi alertado mais cedo por alguns civis um ataque de seres humanoides com caracteristicas de animais, tudo indica que são formigas Chimera que sobreviveram ao último incidente. Evite que mais pessoas sejam feridas e tragam esses seres para interrogatório.'),(71,68,0,1,'Artefatos Sagrados','As armas sagradas criadas pelo Rikudou Sennin e vários equipamentos poderosos foram roubados, não se sabe ao certo quem as robou, então junte todas as pistas no local do crime e vá atrás do ladrão antes que o pior aconteça.'),(72,69,0,1,'Ataque da Aranha','Um grupo desconhecido tem assaltado vários prédios nos ultimos dias, os locais onde estiveram não deixaram nenhum sobrevivente. Conforme algumas informações que adquirimos, eles usam poderosas técnicas de Nen. Vá com os melhores Hunters e detenha esse grupo.'),(73,70,0,1,'Hollows Descontrolados','Vários Hollows perderam o controle simultanêamente e a vida de varias pessoas estão em risco, procure a fonte deste estranho comportamento antes que alguém morra.'),(74,71,0,1,'Torneio em Perigo','Durante o torneio de artes marciais a arquibancada cheia de pessoas foi completamente destruída, testemunhas afirmam que o causador disso foi um ser estranho que provavelmente não pertence ao nosso planeta. Vá até o torneio de artes marciais e detenha esse individuo.'),(75,72,0,1,'Esferas Desaparecidas','Após vários mêses coletando as Esferas do Dragão, alguém roubou todas que já haviam sido coletadas e foi em direção do local onde provavelmente esta a Esfera que falta. Recupere as Esferas e evite que esse individuo faça o desejo para Shenlong, afinal não sabemos suas intenções.'),(76,73,0,1,'Mundo Digital em Apuros','Um Digimon maligno surgiu das trevas, ele tem escravizado vários Digimons e os que recusavam eram exterminados. Derrote esse Digimon Maligno e traga a paz para o Digimundo novamente.'),(77,75,0,1,'Desespero Colossal','O Titã Colossal apareceu novamente ao redor da muralha, ele esta tentando destruir o muro completamente. Não podemos deixar algo assim acontecer, pare o Titã Colossal a qualquer custo!'),(78,76,0,1,'A Destruição das Dez Caudas','A poderosíssima Bijuu de 10 Caudas se libertou e está destruindo vilas inteiras com apenas um disparo do seu poder. Precisamos juntar todas as vilas se quisermos tentar derrotá-la!'),(79,74,0,1,'Lendários Fora de Controle','Um poderoso e inteligente Pokémon chamado Mewtwo criou estranhas Pokébolas capaz de capturar qualquer Pokémon e transformá-los em seres malignos. Pare-o antes que todos corram mais risco de vida!'),(80,77,30,1,'Coleta de Suicidas','Nem todos nós somos violentos. Nós não matamos pessoas, e sim esperamos elas se matarem e coletamos seus corpos. Nos traga um estoque e te darei um equipamento.'),(81,78,32,1,'Limpando o Dojo','Assim como você, temos vários alunos frequentando nosso Dojo, e por isso precisamos mantê-lo sempre limpo. Faça isso e te darei algo como agradecimento.'),(82,79,16,1,'Pacto em Domicílio','Como você ainda não sabe usar um Círculo de Teletransporte, infelizmente você terá que atender os pactos de bicicleta. Te darei uma esfera como recompensa assim que voltar.'),(83,80,0,1,'Cuidando da Taverna','Um trabalho simples, mas muito importante para treinar sua coordenação motora. Cuidado para não deixar seu chefe...irado...'),(84,81,0,1,'Evacuando a Área','Destroços da batalha que está acontecendo aqui perto estão voando na vila e precisamos de sua ajuda para evacuar as áreas de risco.'),(85,82,0,1,'Floresta do Desespero','Pessoas se perderam numa floresta sinistra, mas ninguém é corajoso o bastante para entrar lá e procurar por elas. Pode fazer esse favor?'),(86,83,0,1,'Calabouço Sombrio','Um tesouro de uma nobre dama de nossa cidade foi roubado e levado para o Calabouço Sombrio. Recupere-o para ela.'),(87,84,0,1,'Barreira Mágica','Uma onda de energia maligna está se espalhando para o mundo todo, e precisamos que você se junte com os outros para criar uma poderosa barreira pela cidade.'),(88,85,0,1,'O Cavaleiro Cinzento','Existe um cavaleiro que não se denomina Heroi nem Vilão. Ele mantém o equilibrio no mundo, mas isso está causando mais confusão do que balanço.'),(89,86,0,1,'Clã dos Demônios','Um misterioso portal se abriu em cima da cidade e um exército de demônios começou a se formar nos céus. Precisamos urgentemente de sua ajuda para conter a invasão!'),(90,87,0,1,'Armadura de Selamento','Uma criatura ancestral está saindo de controle, porém ela não é maligna. Ajude-a colocando uma armadura para selar seus poderes e restaurar a sanidade.'),(91,88,0,1,'Demônio da Fênix','Quer algo pior que um demônio? Um demônio que renasce das cinzas. Precisamos que você o pare enquanto preparamos uma armadilha adequada para esse tipo de criatura.'),(92,89,0,1,'Enchendo a Muralha','Descobrimos que os titãs ficam mais fracos e desorientados sem a luz do Sol, então precisamos de sua ajuda para prendê-los dentro de nossas muralhas e conter os ataques dos outros titãs.'),(93,90,0,1,'Invasores Lunares','Um poderoso clã ancestral se revelou estar morando na Lua, e agora pretendem destruir nosso planeta. Precisamos que você entre pelo portal e os detenha!'),(94,91,0,1,'Pecados Descontrolados','Ex-Cavaleiros Sagrados se tornaram tão poderosos que viraram os Sete Pecados Capitais depois de seus crimes. Eles saíram de controle e apenas você pode fazê-los voltarem ao normal!'),(95,92,0,1,'Registro Animal','Olá! O número de animais em nossa vila cresceu demais e precisamos de ajuda para registrá-los em nosso livro. Você poderia nos ajudar?'),(96,93,0,1,'Exame da Justiça','Precisamos avisar todos os herois e heroinas da cidade que o exame foi adiantado para daqui 1 hora! Só você é rápido o suficiente para avisá-los!'),(97,94,0,1,'Frente de Batalha','Como um novo recruta da Frente de Batalha Como-se-eu-estivesse-morto, precisamos que você vá e recrute novos membros para enfrentar-mos o destino!'),(98,95,0,1,'Crianças Escolhidas','Já achamos duas Crianças capazes de pilotar os EVAs, mas não conseguimos encontrar a terceira. Por favor, ajude-nos!'),(99,96,0,1,'Hora do Duelo','Já encontramos quase todas as cartas do lendário Exódia, mas a última está perdida. Com suas habilidades, sei que será capaz de encontrá-la para mim.'),(100,97,0,1,'Guardião do Mundo Celestial','Precisamos de apenas mais um Guarda temporário para proteger nossa Deusa, e sei que você é capaz de tal ato.'),(101,98,0,1,'Invasão de Monstros Gigantes','Nossa cidade está sendo atacada por monstros gigantes de todas as direções e precisamos do maior número de guerreiros possível!'),(102,99,0,1,'Juppongatana','Essa equipe de criminosos assassinos está à solta, aniquilando vilarejos inteiros e queimando pessoas vivas. Eles precisam ser parados imediatamente!'),(103,100,0,1,'Meteoro Nìvel Dragão','Um meteoro gigantesco está caindo em direção à nossa cidade e destruirá ela por completo. Somente alguém do seu nível será capaz de destruí-lo por completo!'),(104,101,33,1,'Em Busca dos Pecados Capitais','O reino está corrupto e precisamos da ajuda dos Sete Pecados Capitais para restaurar a paz! Sua missão será procurar por alguma pista e lhe entregarei um equipamento em troca.'),(105,103,35,1,'Pequenos Crimes','Como alguém que ainda vai iniciar a vida de Heroi, você pode começar pegando ladrões de bolsas que estão na Cidade-Z. Após voltar, te darei um Emblema.'),(106,104,36,1,'Preparando o Time','Estamos precisando de ajuda para recolher o uniforme do time e prepará-los para o próximo jogo. Se você me ajudar, deixo você ficar com uma peça.'),(107,105,37,1,'Trabalhando para o Império','Como um mero aspirante, você está encarregado de levar os equipamentos para nossos soldados. Faça direito e te deixarei ficar com um.'),(108,106,38,1,'Treinamento de Hamon','Vá aprender com os mestres no mínimo o significado de Hamon. Após isso volte e lhe darei uma carta.'),(109,107,39,1,'Fazendo Paródias','Você faz parte de um universo cheio de paródias. Mostre que você também sabe fazer e te recompensarei.');
/*!40000 ALTER TABLE `time_quest_descriptions` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `time_quests`
--

DROP TABLE IF EXISTS `time_quests`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `time_quests` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `anime_id` int(11) NOT NULL DEFAULT '0',
  `is_generic` tinyint(1) NOT NULL DEFAULT '0',
  `req_level` int(11) NOT NULL DEFAULT '0',
  `req_graduation_sorting` int(11) NOT NULL DEFAULT '0',
  `random_equipment_chance` int(11) NOT NULL DEFAULT '0',
  `random_pet_chance` int(11) NOT NULL DEFAULT '0',
  `reward_item_id` int(11) NOT NULL DEFAULT '0',
  `total_time` char(6) COLLATE utf8_unicode_ci NOT NULL DEFAULT '000000',
  `durations` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `anime_id` (`anime_id`)
) ENGINE=MyISAM AUTO_INCREMENT=108 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `time_quests`
--

